{"line": "\u0623\u064e\u0648\u0652 \u0643\u064e\u0635\u064e\u064a\u0651\u0650\u0628\u064d\u06e2 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0627\u0653\u0621\u0650 \u0641\u0650\u064a\u0647\u0650 \u0638\u064f\u0644\u064f\u0645\u064e\u0640\u0670\u062a\u064c\u06ed \u0648\u064e\u0631\u064e\u0639\u0652\u062f\u064c\u06ed \u0648\u064e\u0628\u064e\u0631\u0652\u0642\u064c\u06ed \u064a\u064e\u062c\u0652\u0639\u064e\u0644\u064f\u0648\u0646\u064e \u0623\u064e\u0635\u064e\u0640\u0670\u0628\u0650\u0639\u064e\u0647\u064f\u0645\u0652 \u0641\u0650\u0649\u0653 \u0621\u064e\u0627\u0630\u064e\u0627\u0646\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0635\u0651\u064e\u0648\u064e\u0670\u0639\u0650\u0642\u0650 \u062d\u064e\u0630\u064e\u0631\u064e \u0671\u0644\u0652\u0645\u064e\u0648\u0652\u062a\u0650 \u06da \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0645\u064f\u062d\u0650\u064a\u0637\u064c\u06e2 \u0628\u0650\u0671\u0644\u0652\u0643\u064e\u0640\u0670\u0641\u0650\u0631\u0650\u064a\u0646\u064e", "num": 19}
{"line": "\u064a\u064e\u0643\u064e\u0627\u062f\u064f \u0671\u0644\u0652\u0628\u064e\u0631\u0652\u0642\u064f \u064a\u064e\u062e\u0652\u0637\u064e\u0641\u064f \u0623\u064e\u0628\u0652\u0635\u064e\u0640\u0670\u0631\u064e\u0647\u064f\u0645\u0652 \u06d6 \u0643\u064f\u0644\u0651\u064e\u0645\u064e\u0627\u0653 \u0623\u064e\u0636\u064e\u0627\u0653\u0621\u064e \u0644\u064e\u0647\u064f\u0645 \u0645\u0651\u064e\u0634\u064e\u0648\u0652\u0627\u06df \u0641\u0650\u064a\u0647\u0650 \u0648\u064e\u0625\u0650\u0630\u064e\u0627\u0653 \u0623\u064e\u0638\u0652\u0644\u064e\u0645\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u0642\u064e\u0627\u0645\u064f\u0648\u0627\u06df \u06da \u0648\u064e\u0644\u064e\u0648\u0652 \u0634\u064e\u0627\u0653\u0621\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0644\u064e\u0630\u064e\u0647\u064e\u0628\u064e \u0628\u0650\u0633\u064e\u0645\u0652\u0639\u0650\u0647\u0650\u0645\u0652 \u0648\u064e\u0623\u064e\u0628\u0652\u0635\u064e\u0640\u0670\u0631\u0650\u0647\u0650\u0645\u0652 \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u064e\u0644\u064e\u0649\u0670 \u0643\u064f\u0644\u0651\u0650 \u0634\u064e\u0649\u0652\u0621\u064d\u06e2 \u0642\u064e\u062f\u0650\u064a\u0631\u064c\u06ed", "num": 20}
{"line": "\u064a\u064e\u0640\u0670\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u064f \u0671\u0639\u0652\u0628\u064f\u062f\u064f\u0648\u0627\u06df \u0631\u064e\u0628\u0651\u064e\u0643\u064f\u0645\u064f \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u062e\u064e\u0644\u064e\u0642\u064e\u0643\u064f\u0645\u0652 \u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0645\u0650\u0646 \u0642\u064e\u0628\u0652\u0644\u0650\u0643\u064f\u0645\u0652 \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u062a\u064e\u062a\u0651\u064e\u0642\u064f\u0648\u0646\u064e", "num": 21}
{"line": "\u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u062c\u064e\u0639\u064e\u0644\u064e \u0644\u064e\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u064e \u0641\u0650\u0631\u064e\u0670\u0634\u064b\u06ed\u0627 \u0648\u064e\u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0627\u0653\u0621\u064e \u0628\u0650\u0646\u064e\u0627\u0653\u0621\u064b\u06ed \u0648\u064e\u0623\u064e\u0646\u0632\u064e\u0644\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0627\u0653\u0621\u0650 \u0645\u064e\u0627\u0653\u0621\u064b\u06ed \u0641\u064e\u0623\u064e\u062e\u0652\u0631\u064e\u062c\u064e \u0628\u0650\u0647\u0650\u06e6 \u0645\u0650\u0646\u064e \u0671\u0644\u062b\u0651\u064e\u0645\u064e\u0631\u064e\u0670\u062a\u0650 \u0631\u0650\u0632\u0652\u0642\u064b\u06ed\u0627 \u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u06d6 \u0641\u064e\u0644\u064e\u0627 \u062a\u064e\u062c\u0652\u0639\u064e\u0644\u064f\u0648\u0627\u06df \u0644\u0650\u0644\u0651\u064e\u0647\u0650 \u0623\u064e\u0646\u062f\u064e\u0627\u062f\u064b\u06ed\u0627 \u0648\u064e\u0623\u064e\u0646\u062a\u064f\u0645\u0652 \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 22}
{"line": "\u0648\u064e\u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u0641\u0650\u0649 \u0631\u064e\u064a\u0652\u0628\u064d\u06e2 \u0645\u0651\u0650\u0645\u0651\u064e\u0627 \u0646\u064e\u0632\u0651\u064e\u0644\u0652\u0646\u064e\u0627 \u0639\u064e\u0644\u064e\u0649\u0670 \u0639\u064e\u0628\u0652\u062f\u0650\u0646\u064e\u0627 \u0641\u064e\u0623\u0652\u062a\u064f\u0648\u0627\u06df \u0628\u0650\u0633\u064f\u0648\u0631\u064e\u0629\u064d\u06e2 \u0645\u0651\u0650\u0646 \u0645\u0651\u0650\u062b\u0652\u0644\u0650\u0647\u0650\u06e6 \u0648\u064e\u0671\u062f\u0652\u0639\u064f\u0648\u0627\u06df \u0634\u064f\u0647\u064e\u062f\u064e\u0627\u0653\u0621\u064e\u0643\u064f\u0645 \u0645\u0651\u0650\u0646 \u062f\u064f\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u0635\u064e\u0640\u0670\u062f\u0650\u0642\u0650\u064a\u0646\u064e", "num": 23}
{"line": "\u0641\u064e\u0625\u0650\u0646 \u0644\u0651\u064e\u0645\u0652 \u062a\u064e\u0641\u0652\u0639\u064e\u0644\u064f\u0648\u0627\u06df \u0648\u064e\u0644\u064e\u0646 \u062a\u064e\u0641\u0652\u0639\u064e\u0644\u064f\u0648\u0627\u06df \u0641\u064e\u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u064e \u0671\u0644\u0651\u064e\u062a\u0650\u0649 \u0648\u064e\u0642\u064f\u0648\u062f\u064f\u0647\u064e\u0627 \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u064f \u0648\u064e\u0671\u0644\u0652\u062d\u0650\u062c\u064e\u0627\u0631\u064e\u0629\u064f \u06d6 \u0623\u064f\u0639\u0650\u062f\u0651\u064e\u062a\u0652 \u0644\u0650\u0644\u0652\u0643\u064e\u0640\u0670\u0641\u0650\u0631\u0650\u064a\u0646\u064e", "num": 24}
{"line": "\u0648\u064e\u0628\u064e\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0648\u064e\u0639\u064e\u0645\u0650\u0644\u064f\u0648\u0627\u06df \u0671\u0644\u0635\u0651\u064e\u0640\u0670\u0644\u0650\u062d\u064e\u0640\u0670\u062a\u0650 \u0623\u064e\u0646\u0651\u064e \u0644\u064e\u0647\u064f\u0645\u0652 \u062c\u064e\u0646\u0651\u064e\u0640\u0670\u062a\u064d\u06e2 \u062a\u064e\u062c\u0652\u0631\u0650\u0649 \u0645\u0650\u0646 \u062a\u064e\u062d\u0652\u062a\u0650\u0647\u064e\u0627 \u0671\u0644\u0652\u0623\u064e\u0646\u0652\u0647\u064e\u0640\u0670\u0631\u064f \u06d6 \u0643\u064f\u0644\u0651\u064e\u0645\u064e\u0627 \u0631\u064f\u0632\u0650\u0642\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u0652\u0647\u064e\u0627 \u0645\u0650\u0646 \u062b\u064e\u0645\u064e\u0631\u064e\u0629\u064d\u06e2 \u0631\u0651\u0650\u0632\u0652\u0642\u064b\u06ed\u0627 \u06d9 \u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0647\u064e\u0640\u0670\u0630\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u0631\u064f\u0632\u0650\u0642\u0652\u0646\u064e\u0627 \u0645\u0650\u0646 \u0642\u064e\u0628\u0652\u0644\u064f \u06d6 \u0648\u064e\u0623\u064f\u062a\u064f\u0648\u0627\u06df \u0628\u0650\u0647\u0650\u06e6 \u0645\u064f\u062a\u064e\u0634\u064e\u0640\u0670\u0628\u0650\u0647\u064b\u06ed\u0627 \u06d6 \u0648\u064e\u0644\u064e\u0647\u064f\u0645\u0652 \u0641\u0650\u064a\u0647\u064e\u0627\u0653 \u0623\u064e\u0632\u0652\u0648\u064e\u0670\u062c\u064c\u06ed \u0645\u0651\u064f\u0637\u064e\u0647\u0651\u064e\u0631\u064e\u0629\u064c\u06ed \u06d6 \u0648\u064e\u0647\u064f\u0645\u0652 \u0641\u0650\u064a\u0647\u064e\u0627 \u062e\u064e\u0640\u0670\u0644\u0650\u062f\u064f\u0648\u0646\u064e", "num": 25}
{"line": "\u06de \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0644\u064e\u0627 \u064a\u064e\u0633\u0652\u062a\u064e\u062d\u0652\u0649\u0650\u06e6\u0653 \u0623\u064e\u0646 \u064a\u064e\u0636\u0652\u0631\u0650\u0628\u064e \u0645\u064e\u062b\u064e\u0644\u064b\u06ed\u0627 \u0645\u0651\u064e\u0627 \u0628\u064e\u0639\u064f\u0648\u0636\u064e\u0629\u064b\u06ed \u0641\u064e\u0645\u064e\u0627 \u0641\u064e\u0648\u0652\u0642\u064e\u0647\u064e\u0627 \u06da \u0641\u064e\u0623\u064e\u0645\u0651\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0641\u064e\u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e \u0623\u064e\u0646\u0651\u064e\u0647\u064f \u0671\u0644\u0652\u062d\u064e\u0642\u0651\u064f \u0645\u0650\u0646 \u0631\u0651\u064e\u0628\u0651\u0650\u0647\u0650\u0645\u0652 \u06d6 \u0648\u064e\u0623\u064e\u0645\u0651\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0643\u064e\u0641\u064e\u0631\u064f\u0648\u0627\u06df \u0641\u064e\u064a\u064e\u0642\u064f\u0648\u0644\u064f\u0648\u0646\u064e \u0645\u064e\u0627\u0630\u064e\u0627\u0653 \u0623\u064e\u0631\u064e\u0627\u062f\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u0647\u064e\u0640\u0670\u0630\u064e\u0627 \u0645\u064e\u062b\u064e\u0644\u064b\u06ed\u0627 \u06d8 \u064a\u064f\u0636\u0650\u0644\u0651\u064f \u0628\u0650\u0647\u0650\u06e6 \u0643\u064e\u062b\u0650\u064a\u0631\u064b\u06ed\u0627 \u0648\u064e\u064a\u064e\u0647\u0652\u062f\u0650\u0649 \u0628\u0650\u0647\u0650\u06e6 \u0643\u064e\u062b\u0650\u064a\u0631\u064b\u06ed\u0627 \u06da \u0648\u064e\u0645\u064e\u0627 \u064a\u064f\u0636\u0650\u0644\u0651\u064f \u0628\u0650\u0647\u0650\u06e6\u0653 \u0625\u0650\u0644\u0651\u064e\u0627 \u0671\u0644\u0652\u0641\u064e\u0640\u0670\u0633\u0650\u0642\u0650\u064a\u0646\u064e", "num": 26}
{"line": "\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064e\u0646\u0642\u064f\u0636\u064f\u0648\u0646\u064e \u0639\u064e\u0647\u0652\u062f\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0645\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0645\u0650\u064a\u062b\u064e\u0640\u0670\u0642\u0650\u0647\u0650\u06e6 \u0648\u064e\u064a\u064e\u0642\u0652\u0637\u064e\u0639\u064f\u0648\u0646\u064e \u0645\u064e\u0627\u0653 \u0623\u064e\u0645\u064e\u0631\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u0647\u0650\u06e6\u0653 \u0623\u064e\u0646 \u064a\u064f\u0648\u0635\u064e\u0644\u064e \u0648\u064e\u064a\u064f\u0641\u0652\u0633\u0650\u062f\u064f\u0648\u0646\u064e \u0641\u0650\u0649 \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u06da \u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0647\u064f\u0645\u064f \u0671\u0644\u0652\u062e\u064e\u0640\u0670\u0633\u0650\u0631\u064f\u0648\u0646\u064e", "num": 27}
{"line": "\u0643\u064e\u064a\u0652\u0641\u064e \u062a\u064e\u0643\u0652\u0641\u064f\u0631\u064f\u0648\u0646\u064e \u0628\u0650\u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u0623\u064e\u0645\u0652\u0648\u064e\u0670\u062a\u064b\u06ed\u0627 \u0641\u064e\u0623\u064e\u062d\u0652\u064a\u064e\u0640\u0670\u0643\u064f\u0645\u0652 \u06d6 \u062b\u064f\u0645\u0651\u064e \u064a\u064f\u0645\u0650\u064a\u062a\u064f\u0643\u064f\u0645\u0652 \u062b\u064f\u0645\u0651\u064e \u064a\u064f\u062d\u0652\u064a\u0650\u064a\u0643\u064f\u0645\u0652 \u062b\u064f\u0645\u0651\u064e \u0625\u0650\u0644\u064e\u064a\u0652\u0647\u0650 \u062a\u064f\u0631\u0652\u062c\u064e\u0639\u064f\u0648\u0646\u064e", "num": 28}
{"line": "\u0647\u064f\u0648\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u062e\u064e\u0644\u064e\u0642\u064e \u0644\u064e\u0643\u064f\u0645 \u0645\u0651\u064e\u0627 \u0641\u0650\u0649 \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u062c\u064e\u0645\u0650\u064a\u0639\u064b\u06ed\u0627 \u062b\u064f\u0645\u0651\u064e \u0671\u0633\u0652\u062a\u064e\u0648\u064e\u0649\u0670\u0653 \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0627\u0653\u0621\u0650 \u0641\u064e\u0633\u064e\u0648\u0651\u064e\u0649\u0670\u0647\u064f\u0646\u0651\u064e \u0633\u064e\u0628\u0652\u0639\u064e \u0633\u064e\u0645\u064e\u0640\u0670\u0648\u064e\u0670\u062a\u064d\u06e2 \u06da \u0648\u064e\u0647\u064f\u0648\u064e \u0628\u0650\u0643\u064f\u0644\u0651\u0650 \u0634\u064e\u0649\u0652\u0621\u064d \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 29}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u0642\u064e\u0627\u0644\u064e \u0631\u064e\u0628\u0651\u064f\u0643\u064e \u0644\u0650\u0644\u0652\u0645\u064e\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e\u0629\u0650 \u0625\u0650\u0646\u0651\u0650\u0649 \u062c\u064e\u0627\u0639\u0650\u0644\u064c\u06ed \u0641\u0650\u0649 \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u062e\u064e\u0644\u0650\u064a\u0641\u064e\u0629\u064b\u06ed \u06d6 \u0642\u064e\u0627\u0644\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u062a\u064e\u062c\u0652\u0639\u064e\u0644\u064f \u0641\u0650\u064a\u0647\u064e\u0627 \u0645\u064e\u0646 \u064a\u064f\u0641\u0652\u0633\u0650\u062f\u064f \u0641\u0650\u064a\u0647\u064e\u0627 \u0648\u064e\u064a\u064e\u0633\u0652\u0641\u0650\u0643\u064f \u0671\u0644\u062f\u0651\u0650\u0645\u064e\u0627\u0653\u0621\u064e \u0648\u064e\u0646\u064e\u062d\u0652\u0646\u064f \u0646\u064f\u0633\u064e\u0628\u0651\u0650\u062d\u064f \u0628\u0650\u062d\u064e\u0645\u0652\u062f\u0650\u0643\u064e \u0648\u064e\u0646\u064f\u0642\u064e\u062f\u0651\u0650\u0633\u064f \u0644\u064e\u0643\u064e \u06d6 \u0642\u064e\u0627\u0644\u064e \u0625\u0650\u0646\u0651\u0650\u0649\u0653 \u0623\u064e\u0639\u0652\u0644\u064e\u0645\u064f \u0645\u064e\u0627 \u0644\u064e\u0627 \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 30}
{"line": "\u0648\u064e\u0639\u064e\u0644\u0651\u064e\u0645\u064e \u0621\u064e\u0627\u062f\u064e\u0645\u064e \u0671\u0644\u0652\u0623\u064e\u0633\u0652\u0645\u064e\u0627\u0653\u0621\u064e \u0643\u064f\u0644\u0651\u064e\u0647\u064e\u0627 \u062b\u064f\u0645\u0651\u064e \u0639\u064e\u0631\u064e\u0636\u064e\u0647\u064f\u0645\u0652 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0645\u064e\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e\u0629\u0650 \u0641\u064e\u0642\u064e\u0627\u0644\u064e \u0623\u064e\u0646\u06e2\u0628\u0650\u0640\u0654\u064f\u0648\u0646\u0650\u0649 \u0628\u0650\u0623\u064e\u0633\u0652\u0645\u064e\u0627\u0653\u0621\u0650 \u0647\u064e\u0640\u0670\u0653\u0624\u064f\u0644\u064e\u0627\u0653\u0621\u0650 \u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u0635\u064e\u0640\u0670\u062f\u0650\u0642\u0650\u064a\u0646\u064e", "num": 31}
{"line": "\u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0633\u064f\u0628\u0652\u062d\u064e\u0640\u0670\u0646\u064e\u0643\u064e \u0644\u064e\u0627 \u0639\u0650\u0644\u0652\u0645\u064e \u0644\u064e\u0646\u064e\u0627\u0653 \u0625\u0650\u0644\u0651\u064e\u0627 \u0645\u064e\u0627 \u0639\u064e\u0644\u0651\u064e\u0645\u0652\u062a\u064e\u0646\u064e\u0627\u0653 \u06d6 \u0625\u0650\u0646\u0651\u064e\u0643\u064e \u0623\u064e\u0646\u062a\u064e \u0671\u0644\u0652\u0639\u064e\u0644\u0650\u064a\u0645\u064f \u0671\u0644\u0652\u062d\u064e\u0643\u0650\u064a\u0645\u064f", "num": 32}
{"line": "\u0642\u064e\u0627\u0644\u064e \u064a\u064e\u0640\u0670\u0653\u0640\u0654\u064e\u0627\u062f\u064e\u0645\u064f \u0623\u064e\u0646\u06e2\u0628\u0650\u0626\u0652\u0647\u064f\u0645 \u0628\u0650\u0623\u064e\u0633\u0652\u0645\u064e\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u0652 \u06d6 \u0641\u064e\u0644\u064e\u0645\u0651\u064e\u0627\u0653 \u0623\u064e\u0646\u06e2\u0628\u064e\u0623\u064e\u0647\u064f\u0645 \u0628\u0650\u0623\u064e\u0633\u0652\u0645\u064e\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u0652 \u0642\u064e\u0627\u0644\u064e \u0623\u064e\u0644\u064e\u0645\u0652 \u0623\u064e\u0642\u064f\u0644 \u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u0625\u0650\u0646\u0651\u0650\u0649\u0653 \u0623\u064e\u0639\u0652\u0644\u064e\u0645\u064f \u063a\u064e\u064a\u0652\u0628\u064e \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0640\u0670\u0648\u064e\u0670\u062a\u0650 \u0648\u064e\u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u0648\u064e\u0623\u064e\u0639\u0652\u0644\u064e\u0645\u064f \u0645\u064e\u0627 \u062a\u064f\u0628\u0652\u062f\u064f\u0648\u0646\u064e \u0648\u064e\u0645\u064e\u0627 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u062a\u064e\u0643\u0652\u062a\u064f\u0645\u064f\u0648\u0646\u064e", "num": 33}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u0642\u064f\u0644\u0652\u0646\u064e\u0627 \u0644\u0650\u0644\u0652\u0645\u064e\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e\u0629\u0650 \u0671\u0633\u0652\u062c\u064f\u062f\u064f\u0648\u0627\u06df \u0644\u0650\u0640\u0654\u064e\u0627\u062f\u064e\u0645\u064e \u0641\u064e\u0633\u064e\u062c\u064e\u062f\u064f\u0648\u0653\u0627\u06df \u0625\u0650\u0644\u0651\u064e\u0627\u0653 \u0625\u0650\u0628\u0652\u0644\u0650\u064a\u0633\u064e \u0623\u064e\u0628\u064e\u0649\u0670 \u0648\u064e\u0671\u0633\u0652\u062a\u064e\u0643\u0652\u0628\u064e\u0631\u064e \u0648\u064e\u0643\u064e\u0627\u0646\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0643\u064e\u0640\u0670\u0641\u0650\u0631\u0650\u064a\u0646\u064e", "num": 34}
{"line": "\u0648\u064e\u0642\u064f\u0644\u0652\u0646\u064e\u0627 \u064a\u064e\u0640\u0670\u0653\u0640\u0654\u064e\u0627\u062f\u064e\u0645\u064f \u0671\u0633\u0652\u0643\u064f\u0646\u0652 \u0623\u064e\u0646\u062a\u064e \u0648\u064e\u0632\u064e\u0648\u0652\u062c\u064f\u0643\u064e \u0671\u0644\u0652\u062c\u064e\u0646\u0651\u064e\u0629\u064e \u0648\u064e\u0643\u064f\u0644\u064e\u0627 \u0645\u0650\u0646\u0652\u0647\u064e\u0627 \u0631\u064e\u063a\u064e\u062f\u064b\u0627 \u062d\u064e\u064a\u0652\u062b\u064f \u0634\u0650\u0626\u0652\u062a\u064f\u0645\u064e\u0627 \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0642\u0652\u0631\u064e\u0628\u064e\u0627 \u0647\u064e\u0640\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u0634\u0651\u064e\u062c\u064e\u0631\u064e\u0629\u064e \u0641\u064e\u062a\u064e\u0643\u064f\u0648\u0646\u064e\u0627 \u0645\u0650\u0646\u064e \u0671\u0644\u0638\u0651\u064e\u0640\u0670\u0644\u0650\u0645\u0650\u064a\u0646\u064e", "num": 35}
{"line": "\u0641\u064e\u0623\u064e\u0632\u064e\u0644\u0651\u064e\u0647\u064f\u0645\u064e\u0627 \u0671\u0644\u0634\u0651\u064e\u064a\u0652\u0637\u064e\u0640\u0670\u0646\u064f \u0639\u064e\u0646\u0652\u0647\u064e\u0627 \u0641\u064e\u0623\u064e\u062e\u0652\u0631\u064e\u062c\u064e\u0647\u064f\u0645\u064e\u0627 \u0645\u0650\u0645\u0651\u064e\u0627 \u0643\u064e\u0627\u0646\u064e\u0627 \u0641\u0650\u064a\u0647\u0650 \u06d6 \u0648\u064e\u0642\u064f\u0644\u0652\u0646\u064e\u0627 \u0671\u0647\u0652\u0628\u0650\u0637\u064f\u0648\u0627\u06df \u0628\u064e\u0639\u0652\u0636\u064f\u0643\u064f\u0645\u0652 \u0644\u0650\u0628\u064e\u0639\u0652\u0636\u064d \u0639\u064e\u062f\u064f\u0648\u0651\u064c\u06ed \u06d6 \u0648\u064e\u0644\u064e\u0643\u064f\u0645\u0652 \u0641\u0650\u0649 \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u0645\u064f\u0633\u0652\u062a\u064e\u0642\u064e\u0631\u0651\u064c\u06ed \u0648\u064e\u0645\u064e\u062a\u064e\u0640\u0670\u0639\u064c \u0625\u0650\u0644\u064e\u0649\u0670 \u062d\u0650\u064a\u0646\u064d\u06e2", "num": 36}
{"line": "\u0641\u064e\u062a\u064e\u0644\u064e\u0642\u0651\u064e\u0649\u0670\u0653 \u0621\u064e\u0627\u062f\u064e\u0645\u064f \u0645\u0650\u0646 \u0631\u0651\u064e\u0628\u0651\u0650\u0647\u0650\u06e6 \u0643\u064e\u0644\u0650\u0645\u064e\u0640\u0670\u062a\u064d\u06e2 \u0641\u064e\u062a\u064e\u0627\u0628\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u06da \u0625\u0650\u0646\u0651\u064e\u0647\u064f\u06e5 \u0647\u064f\u0648\u064e \u0671\u0644\u062a\u0651\u064e\u0648\u0651\u064e\u0627\u0628\u064f \u0671\u0644\u0631\u0651\u064e\u062d\u0650\u064a\u0645\u064f", "num": 37}
{"line": "\u0642\u064f\u0644\u0652\u0646\u064e\u0627 \u0671\u0647\u0652\u0628\u0650\u0637\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u0652\u0647\u064e\u0627 \u062c\u064e\u0645\u0650\u064a\u0639\u064b\u06ed\u0627 \u06d6 \u0641\u064e\u0625\u0650\u0645\u0651\u064e\u0627 \u064a\u064e\u0623\u0652\u062a\u0650\u064a\u064e\u0646\u0651\u064e\u0643\u064f\u0645 \u0645\u0651\u0650\u0646\u0651\u0650\u0649 \u0647\u064f\u062f\u064b\u06ed\u0649 \u0641\u064e\u0645\u064e\u0646 \u062a\u064e\u0628\u0650\u0639\u064e \u0647\u064f\u062f\u064e\u0627\u0649\u064e \u0641\u064e\u0644\u064e\u0627 \u062e\u064e\u0648\u0652\u0641\u064c \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u0647\u064f\u0645\u0652 \u064a\u064e\u062d\u0652\u0632\u064e\u0646\u064f\u0648\u0646\u064e", "num": 38}
{"line": "\u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0643\u064e\u0641\u064e\u0631\u064f\u0648\u0627\u06df \u0648\u064e\u0643\u064e\u0630\u0651\u064e\u0628\u064f\u0648\u0627\u06df \u0628\u0650\u0640\u0654\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u0650\u0646\u064e\u0627\u0653 \u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0623\u064e\u0635\u0652\u062d\u064e\u0640\u0670\u0628\u064f \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u0650 \u06d6 \u0647\u064f\u0645\u0652 \u0641\u0650\u064a\u0647\u064e\u0627 \u062e\u064e\u0640\u0670\u0644\u0650\u062f\u064f\u0648\u0646\u064e", "num": 39}
{"line": "\u064a\u064e\u0640\u0670\u0628\u064e\u0646\u0650\u0649\u0653 \u0625\u0650\u0633\u0652\u0631\u064e\u0670\u0653\u0621\u0650\u064a\u0644\u064e \u0671\u0630\u0652\u0643\u064f\u0631\u064f\u0648\u0627\u06df \u0646\u0650\u0639\u0652\u0645\u064e\u062a\u0650\u0649\u064e \u0671\u0644\u0651\u064e\u062a\u0650\u0649\u0653 \u0623\u064e\u0646\u0652\u0639\u064e\u0645\u0652\u062a\u064f \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0648\u064e\u0623\u064e\u0648\u0652\u0641\u064f\u0648\u0627\u06df \u0628\u0650\u0639\u064e\u0647\u0652\u062f\u0650\u0649\u0653 \u0623\u064f\u0648\u0641\u0650 \u0628\u0650\u0639\u064e\u0647\u0652\u062f\u0650\u0643\u064f\u0645\u0652 \u0648\u064e\u0625\u0650\u064a\u0651\u064e\u0640\u0670\u0649\u064e \u0641\u064e\u0671\u0631\u0652\u0647\u064e\u0628\u064f\u0648\u0646\u0650", "num": 40}
