{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u0642\u064f\u0644\u0652\u062a\u064f\u0645\u0652 \u064a\u064e\u0640\u0670\u0645\u064f\u0648\u0633\u064e\u0649\u0670 \u0644\u064e\u0646 \u0646\u0651\u064f\u0624\u0652\u0645\u0650\u0646\u064e \u0644\u064e\u0643\u064e \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u0646\u064e\u0631\u064e\u0649 \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u062c\u064e\u0647\u0652\u0631\u064e\u0629\u064b\u06ed \u0641\u064e\u0623\u064e\u062e\u064e\u0630\u064e\u062a\u0652\u0643\u064f\u0645\u064f \u0671\u0644\u0635\u0651\u064e\u0640\u0670\u0639\u0650\u0642\u064e\u0629\u064f \u0648\u064e\u0623\u064e\u0646\u062a\u064f\u0645\u0652 \u062a\u064e\u0646\u0638\u064f\u0631\u064f\u0648\u0646\u064e", "num": 55}
{"line": "\u062b\u064f\u0645\u0651\u064e \u0628\u064e\u0639\u064e\u062b\u0652\u0646\u064e\u0640\u0670\u0643\u064f\u0645 \u0645\u0651\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0645\u064e\u0648\u0652\u062a\u0650\u0643\u064f\u0645\u0652 \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u062a\u064e\u0634\u0652\u0643\u064f\u0631\u064f\u0648\u0646\u064e", "num": 56}
{"line": "\u0648\u064e\u0638\u064e\u0644\u0651\u064e\u0644\u0652\u0646\u064e\u0627 \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u063a\u064e\u0645\u064e\u0627\u0645\u064e \u0648\u064e\u0623\u064e\u0646\u0632\u064e\u0644\u0652\u0646\u064e\u0627 \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u0645\u064e\u0646\u0651\u064e \u0648\u064e\u0671\u0644\u0633\u0651\u064e\u0644\u0652\u0648\u064e\u0649\u0670 \u06d6 \u0643\u064f\u0644\u064f\u0648\u0627\u06df \u0645\u0650\u0646 \u0637\u064e\u064a\u0651\u0650\u0628\u064e\u0640\u0670\u062a\u0650 \u0645\u064e\u0627 \u0631\u064e\u0632\u064e\u0642\u0652\u0646\u064e\u0640\u0670\u0643\u064f\u0645\u0652 \u06d6 \u0648\u064e\u0645\u064e\u0627 \u0638\u064e\u0644\u064e\u0645\u064f\u0648\u0646\u064e\u0627 \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646 \u0643\u064e\u0627\u0646\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0641\u064f\u0633\u064e\u0647\u064f\u0645\u0652 \u064a\u064e\u0638\u0652\u0644\u0650\u0645\u064f\u0648\u0646\u064e", "num": 57}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u0642\u064f\u0644\u0652\u0646\u064e\u0627 \u0671\u062f\u0652\u062e\u064f\u0644\u064f\u0648\u0627\u06df \u0647\u064e\u0640\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u0652\u0642\u064e\u0631\u0652\u064a\u064e\u0629\u064e \u0641\u064e\u0643\u064f\u0644\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u0652\u0647\u064e\u0627 \u062d\u064e\u064a\u0652\u062b\u064f \u0634\u0650\u0626\u0652\u062a\u064f\u0645\u0652 \u0631\u064e\u063a\u064e\u062f\u064b\u06ed\u0627 \u0648\u064e\u0671\u062f\u0652\u062e\u064f\u0644\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u0628\u064e\u0627\u0628\u064e \u0633\u064f\u062c\u0651\u064e\u062f\u064b\u06ed\u0627 \u0648\u064e\u0642\u064f\u0648\u0644\u064f\u0648\u0627\u06df \u062d\u0650\u0637\u0651\u064e\u0629\u064c\u06ed \u0646\u0651\u064e\u063a\u0652\u0641\u0650\u0631\u0652 \u0644\u064e\u0643\u064f\u0645\u0652 \u062e\u064e\u0637\u064e\u0640\u0670\u064a\u064e\u0640\u0670\u0643\u064f\u0645\u0652 \u06da \u0648\u064e\u0633\u064e\u0646\u064e\u0632\u0650\u064a\u062f\u064f \u0671\u0644\u0652\u0645\u064f\u062d\u0652\u0633\u0650\u0646\u0650\u064a\u0646\u064e", "num": 58}
{"line": "\u0641\u064e\u0628\u064e\u062f\u0651\u064e\u0644\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0638\u064e\u0644\u064e\u0645\u064f\u0648\u0627\u06df \u0642\u064e\u0648\u0652\u0644\u064b\u0627 \u063a\u064e\u064a\u0652\u0631\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u0642\u0650\u064a\u0644\u064e \u0644\u064e\u0647\u064f\u0645\u0652 \u0641\u064e\u0623\u064e\u0646\u0632\u064e\u0644\u0652\u0646\u064e\u0627 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0638\u064e\u0644\u064e\u0645\u064f\u0648\u0627\u06df \u0631\u0650\u062c\u0652\u0632\u064b\u06ed\u0627 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0627\u0653\u0621\u0650 \u0628\u0650\u0645\u064e\u0627 \u0643\u064e\u0627\u0646\u064f\u0648\u0627\u06df \u064a\u064e\u0641\u0652\u0633\u064f\u0642\u064f\u0648\u0646\u064e", "num": 59}
{"line": "\u06de \u0648\u064e\u0625\u0650\u0630\u0650 \u0671\u0633\u0652\u062a\u064e\u0633\u0652\u0642\u064e\u0649\u0670 \u0645\u064f\u0648\u0633\u064e\u0649\u0670 \u0644\u0650\u0642\u064e\u0648\u0652\u0645\u0650\u0647\u0650\u06e6 \u0641\u064e\u0642\u064f\u0644\u0652\u0646\u064e\u0627 \u0671\u0636\u0652\u0631\u0650\u0628 \u0628\u0651\u0650\u0639\u064e\u0635\u064e\u0627\u0643\u064e \u0671\u0644\u0652\u062d\u064e\u062c\u064e\u0631\u064e \u06d6 \u0641\u064e\u0671\u0646\u0641\u064e\u062c\u064e\u0631\u064e\u062a\u0652 \u0645\u0650\u0646\u0652\u0647\u064f \u0671\u062b\u0652\u0646\u064e\u062a\u064e\u0627 \u0639\u064e\u0634\u0652\u0631\u064e\u0629\u064e \u0639\u064e\u064a\u0652\u0646\u064b\u06ed\u0627 \u06d6 \u0642\u064e\u062f\u0652 \u0639\u064e\u0644\u0650\u0645\u064e \u0643\u064f\u0644\u0651\u064f \u0623\u064f\u0646\u064e\u0627\u0633\u064d\u06e2 \u0645\u0651\u064e\u0634\u0652\u0631\u064e\u0628\u064e\u0647\u064f\u0645\u0652 \u06d6 \u0643\u064f\u0644\u064f\u0648\u0627\u06df \u0648\u064e\u0671\u0634\u0652\u0631\u064e\u0628\u064f\u0648\u0627\u06df \u0645\u0650\u0646 \u0631\u0651\u0650\u0632\u0652\u0642\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0639\u0652\u062b\u064e\u0648\u0652\u0627\u06df \u0641\u0650\u0649 \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u0645\u064f\u0641\u0652\u0633\u0650\u062f\u0650\u064a\u0646\u064e", "num": 60}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u0642\u064f\u0644\u0652\u062a\u064f\u0645\u0652 \u064a\u064e\u0640\u0670\u0645\u064f\u0648\u0633\u064e\u0649\u0670 \u0644\u064e\u0646 \u0646\u0651\u064e\u0635\u0652\u0628\u0650\u0631\u064e \u0639\u064e\u0644\u064e\u0649\u0670 \u0637\u064e\u0639\u064e\u0627\u0645\u064d\u06e2 \u0648\u064e\u0670\u062d\u0650\u062f\u064d\u06e2 \u0641\u064e\u0671\u062f\u0652\u0639\u064f \u0644\u064e\u0646\u064e\u0627 \u0631\u064e\u0628\u0651\u064e\u0643\u064e \u064a\u064f\u062e\u0652\u0631\u0650\u062c\u0652 \u0644\u064e\u0646\u064e\u0627 \u0645\u0650\u0645\u0651\u064e\u0627 \u062a\u064f\u0646\u06e2\u0628\u0650\u062a\u064f \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u064f \u0645\u0650\u0646\u06e2 \u0628\u064e\u0642\u0652\u0644\u0650\u0647\u064e\u0627 \u0648\u064e\u0642\u0650\u062b\u0651\u064e\u0627\u0653\u0626\u0650\u0647\u064e\u0627 \u0648\u064e\u0641\u064f\u0648\u0645\u0650\u0647\u064e\u0627 \u0648\u064e\u0639\u064e\u062f\u064e\u0633\u0650\u0647\u064e\u0627 \u0648\u064e\u0628\u064e\u0635\u064e\u0644\u0650\u0647\u064e\u0627 \u06d6 \u0642\u064e\u0627\u0644\u064e \u0623\u064e\u062a\u064e\u0633\u0652\u062a\u064e\u0628\u0652\u062f\u0650\u0644\u064f\u0648\u0646\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u0647\u064f\u0648\u064e \u0623\u064e\u062f\u0652\u0646\u064e\u0649\u0670 \u0628\u0650\u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u0647\u064f\u0648\u064e \u062e\u064e\u064a\u0652\u0631\u064c \u06da \u0671\u0647\u0652\u0628\u0650\u0637\u064f\u0648\u0627\u06df \u0645\u0650\u0635\u0652\u0631\u064b\u06ed\u0627 \u0641\u064e\u0625\u0650\u0646\u0651\u064e \u0644\u064e\u0643\u064f\u0645 \u0645\u0651\u064e\u0627 \u0633\u064e\u0623\u064e\u0644\u0652\u062a\u064f\u0645\u0652 \u06d7 \u0648\u064e\u0636\u064f\u0631\u0650\u0628\u064e\u062a\u0652 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u064f \u0671\u0644\u0630\u0651\u0650\u0644\u0651\u064e\u0629\u064f \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u0633\u0652\u0643\u064e\u0646\u064e\u0629\u064f \u0648\u064e\u0628\u064e\u0627\u0653\u0621\u064f\u0648 \u0628\u0650\u063a\u064e\u0636\u064e\u0628\u064d\u06e2 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d7 \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u0628\u0650\u0623\u064e\u0646\u0651\u064e\u0647\u064f\u0645\u0652 \u0643\u064e\u0627\u0646\u064f\u0648\u0627\u06df \u064a\u064e\u0643\u0652\u0641\u064f\u0631\u064f\u0648\u0646\u064e \u0628\u0650\u0640\u0654\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u064a\u064e\u0642\u0652\u062a\u064f\u0644\u064f\u0648\u0646\u064e \u0671\u0644\u0646\u0651\u064e\u0628\u0650\u064a\u0651\u0650\u0640\u06e7\u0646\u064e \u0628\u0650\u063a\u064e\u064a\u0652\u0631\u0650 \u0671\u0644\u0652\u062d\u064e\u0642\u0651\u0650 \u06d7 \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u0628\u0650\u0645\u064e\u0627 \u0639\u064e\u0635\u064e\u0648\u0627\u06df \u0648\u0651\u064e\u0643\u064e\u0627\u0646\u064f\u0648\u0627\u06df \u064a\u064e\u0639\u0652\u062a\u064e\u062f\u064f\u0648\u0646\u064e", "num": 61}
{"line": "\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0647\u064e\u0627\u062f\u064f\u0648\u0627\u06df \u0648\u064e\u0671\u0644\u0646\u0651\u064e\u0635\u064e\u0640\u0670\u0631\u064e\u0649\u0670 \u0648\u064e\u0671\u0644\u0635\u0651\u064e\u0640\u0670\u0628\u0650\u0640\u0654\u0650\u064a\u0646\u064e \u0645\u064e\u0646\u0652 \u0621\u064e\u0627\u0645\u064e\u0646\u064e \u0628\u0650\u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0671\u0644\u0652\u064a\u064e\u0648\u0652\u0645\u0650 \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u0650 \u0648\u064e\u0639\u064e\u0645\u0650\u0644\u064e \u0635\u064e\u0640\u0670\u0644\u0650\u062d\u064b\u06ed\u0627 \u0641\u064e\u0644\u064e\u0647\u064f\u0645\u0652 \u0623\u064e\u062c\u0652\u0631\u064f\u0647\u064f\u0645\u0652 \u0639\u0650\u0646\u062f\u064e \u0631\u064e\u0628\u0651\u0650\u0647\u0650\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u062e\u064e\u0648\u0652\u0641\u064c \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u0647\u064f\u0645\u0652 \u064a\u064e\u062d\u0652\u0632\u064e\u0646\u064f\u0648\u0646\u064e", "num": 62}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u0623\u064e\u062e\u064e\u0630\u0652\u0646\u064e\u0627 \u0645\u0650\u064a\u062b\u064e\u0640\u0670\u0642\u064e\u0643\u064f\u0645\u0652 \u0648\u064e\u0631\u064e\u0641\u064e\u0639\u0652\u0646\u064e\u0627 \u0641\u064e\u0648\u0652\u0642\u064e\u0643\u064f\u0645\u064f \u0671\u0644\u0637\u0651\u064f\u0648\u0631\u064e \u062e\u064f\u0630\u064f\u0648\u0627\u06df \u0645\u064e\u0627\u0653 \u0621\u064e\u0627\u062a\u064e\u064a\u0652\u0646\u064e\u0640\u0670\u0643\u064f\u0645 \u0628\u0650\u0642\u064f\u0648\u0651\u064e\u0629\u064d\u06e2 \u0648\u064e\u0671\u0630\u0652\u0643\u064f\u0631\u064f\u0648\u0627\u06df \u0645\u064e\u0627 \u0641\u0650\u064a\u0647\u0650 \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u062a\u064e\u062a\u0651\u064e\u0642\u064f\u0648\u0646\u064e", "num": 63}
{"line": "\u062b\u064f\u0645\u0651\u064e \u062a\u064e\u0648\u064e\u0644\u0651\u064e\u064a\u0652\u062a\u064f\u0645 \u0645\u0651\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u06d6 \u0641\u064e\u0644\u064e\u0648\u0652\u0644\u064e\u0627 \u0641\u064e\u0636\u0652\u0644\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0648\u064e\u0631\u064e\u062d\u0652\u0645\u064e\u062a\u064f\u0647\u064f\u06e5 \u0644\u064e\u0643\u064f\u0646\u062a\u064f\u0645 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0652\u062e\u064e\u0640\u0670\u0633\u0650\u0631\u0650\u064a\u0646\u064e", "num": 64}
{"line": "\u0648\u064e\u0644\u064e\u0642\u064e\u062f\u0652 \u0639\u064e\u0644\u0650\u0645\u0652\u062a\u064f\u0645\u064f \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0671\u0639\u0652\u062a\u064e\u062f\u064e\u0648\u0652\u0627\u06df \u0645\u0650\u0646\u0643\u064f\u0645\u0652 \u0641\u0650\u0649 \u0671\u0644\u0633\u0651\u064e\u0628\u0652\u062a\u0650 \u0641\u064e\u0642\u064f\u0644\u0652\u0646\u064e\u0627 \u0644\u064e\u0647\u064f\u0645\u0652 \u0643\u064f\u0648\u0646\u064f\u0648\u0627\u06df \u0642\u0650\u0631\u064e\u062f\u064e\u0629\u064b \u062e\u064e\u0640\u0670\u0633\u0650\u0640\u0654\u0650\u064a\u0646\u064e", "num": 65}
{"line": "\u0641\u064e\u062c\u064e\u0639\u064e\u0644\u0652\u0646\u064e\u0640\u0670\u0647\u064e\u0627 \u0646\u064e\u0643\u064e\u0640\u0670\u0644\u064b\u06ed\u0627 \u0644\u0651\u0650\u0645\u064e\u0627 \u0628\u064e\u064a\u0652\u0646\u064e \u064a\u064e\u062f\u064e\u064a\u0652\u0647\u064e\u0627 \u0648\u064e\u0645\u064e\u0627 \u062e\u064e\u0644\u0652\u0641\u064e\u0647\u064e\u0627 \u0648\u064e\u0645\u064e\u0648\u0652\u0639\u0650\u0638\u064e\u0629\u064b\u06ed \u0644\u0651\u0650\u0644\u0652\u0645\u064f\u062a\u0651\u064e\u0642\u0650\u064a\u0646\u064e", "num": 66}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u0642\u064e\u0627\u0644\u064e \u0645\u064f\u0648\u0633\u064e\u0649\u0670 \u0644\u0650\u0642\u064e\u0648\u0652\u0645\u0650\u0647\u0650\u06e6\u0653 \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u064a\u064e\u0623\u0652\u0645\u064f\u0631\u064f\u0643\u064f\u0645\u0652 \u0623\u064e\u0646 \u062a\u064e\u0630\u0652\u0628\u064e\u062d\u064f\u0648\u0627\u06df \u0628\u064e\u0642\u064e\u0631\u064e\u0629\u064b\u06ed \u06d6 \u0642\u064e\u0627\u0644\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u062a\u064e\u062a\u0651\u064e\u062e\u0650\u0630\u064f\u0646\u064e\u0627 \u0647\u064f\u0632\u064f\u0648\u064b\u06ed\u0627 \u06d6 \u0642\u064e\u0627\u0644\u064e \u0623\u064e\u0639\u064f\u0648\u0630\u064f \u0628\u0650\u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0623\u064e\u0646\u0652 \u0623\u064e\u0643\u064f\u0648\u0646\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u062c\u064e\u0640\u0670\u0647\u0650\u0644\u0650\u064a\u0646\u064e", "num": 67}
{"line": "\u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0671\u062f\u0652\u0639\u064f \u0644\u064e\u0646\u064e\u0627 \u0631\u064e\u0628\u0651\u064e\u0643\u064e \u064a\u064f\u0628\u064e\u064a\u0651\u0650\u0646 \u0644\u0651\u064e\u0646\u064e\u0627 \u0645\u064e\u0627 \u0647\u0650\u0649\u064e \u06da \u0642\u064e\u0627\u0644\u064e \u0625\u0650\u0646\u0651\u064e\u0647\u064f\u06e5 \u064a\u064e\u0642\u064f\u0648\u0644\u064f \u0625\u0650\u0646\u0651\u064e\u0647\u064e\u0627 \u0628\u064e\u0642\u064e\u0631\u064e\u0629\u064c\u06ed \u0644\u0651\u064e\u0627 \u0641\u064e\u0627\u0631\u0650\u0636\u064c\u06ed \u0648\u064e\u0644\u064e\u0627 \u0628\u0650\u0643\u0652\u0631\u064c \u0639\u064e\u0648\u064e\u0627\u0646\u064c\u06e2 \u0628\u064e\u064a\u0652\u0646\u064e \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u06d6 \u0641\u064e\u0671\u0641\u0652\u0639\u064e\u0644\u064f\u0648\u0627\u06df \u0645\u064e\u0627 \u062a\u064f\u0624\u0652\u0645\u064e\u0631\u064f\u0648\u0646\u064e", "num": 68}
{"line": "\u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0671\u062f\u0652\u0639\u064f \u0644\u064e\u0646\u064e\u0627 \u0631\u064e\u0628\u0651\u064e\u0643\u064e \u064a\u064f\u0628\u064e\u064a\u0651\u0650\u0646 \u0644\u0651\u064e\u0646\u064e\u0627 \u0645\u064e\u0627 \u0644\u064e\u0648\u0652\u0646\u064f\u0647\u064e\u0627 \u06da \u0642\u064e\u0627\u0644\u064e \u0625\u0650\u0646\u0651\u064e\u0647\u064f\u06e5 \u064a\u064e\u0642\u064f\u0648\u0644\u064f \u0625\u0650\u0646\u0651\u064e\u0647\u064e\u0627 \u0628\u064e\u0642\u064e\u0631\u064e\u0629\u064c\u06ed \u0635\u064e\u0641\u0652\u0631\u064e\u0627\u0653\u0621\u064f \u0641\u064e\u0627\u0642\u0650\u0639\u064c\u06ed \u0644\u0651\u064e\u0648\u0652\u0646\u064f\u0647\u064e\u0627 \u062a\u064e\u0633\u064f\u0631\u0651\u064f \u0671\u0644\u0646\u0651\u064e\u0640\u0670\u0638\u0650\u0631\u0650\u064a\u0646\u064e", "num": 69}
{"line": "\u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0671\u062f\u0652\u0639\u064f \u0644\u064e\u0646\u064e\u0627 \u0631\u064e\u0628\u0651\u064e\u0643\u064e \u064a\u064f\u0628\u064e\u064a\u0651\u0650\u0646 \u0644\u0651\u064e\u0646\u064e\u0627 \u0645\u064e\u0627 \u0647\u0650\u0649\u064e \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0652\u0628\u064e\u0642\u064e\u0631\u064e \u062a\u064e\u0634\u064e\u0640\u0670\u0628\u064e\u0647\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0646\u064e\u0627 \u0648\u064e\u0625\u0650\u0646\u0651\u064e\u0627\u0653 \u0625\u0650\u0646 \u0634\u064e\u0627\u0653\u0621\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0644\u064e\u0645\u064f\u0647\u0652\u062a\u064e\u062f\u064f\u0648\u0646\u064e", "num": 70}
{"line": "\u0642\u064e\u0627\u0644\u064e \u0625\u0650\u0646\u0651\u064e\u0647\u064f\u06e5 \u064a\u064e\u0642\u064f\u0648\u0644\u064f \u0625\u0650\u0646\u0651\u064e\u0647\u064e\u0627 \u0628\u064e\u0642\u064e\u0631\u064e\u0629\u064c\u06ed \u0644\u0651\u064e\u0627 \u0630\u064e\u0644\u064f\u0648\u0644\u064c\u06ed \u062a\u064f\u062b\u0650\u064a\u0631\u064f \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u064e \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0633\u0652\u0642\u0650\u0649 \u0671\u0644\u0652\u062d\u064e\u0631\u0652\u062b\u064e \u0645\u064f\u0633\u064e\u0644\u0651\u064e\u0645\u064e\u0629\u064c\u06ed \u0644\u0651\u064e\u0627 \u0634\u0650\u064a\u064e\u0629\u064e \u0641\u0650\u064a\u0647\u064e\u0627 \u06da \u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u0640\u0654\u064e\u0640\u0670\u0646\u064e \u062c\u0650\u0626\u0652\u062a\u064e \u0628\u0650\u0671\u0644\u0652\u062d\u064e\u0642\u0651\u0650 \u06da \u0641\u064e\u0630\u064e\u0628\u064e\u062d\u064f\u0648\u0647\u064e\u0627 \u0648\u064e\u0645\u064e\u0627 \u0643\u064e\u0627\u062f\u064f\u0648\u0627\u06df \u064a\u064e\u0641\u0652\u0639\u064e\u0644\u064f\u0648\u0646\u064e", "num": 71}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u0642\u064e\u062a\u064e\u0644\u0652\u062a\u064f\u0645\u0652 \u0646\u064e\u0641\u0652\u0633\u064b\u06ed\u0627 \u0641\u064e\u0671\u062f\u0651\u064e\u0670\u0631\u064e\u0670\u0654\u0652\u062a\u064f\u0645\u0652 \u0641\u0650\u064a\u0647\u064e\u0627 \u06d6 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0645\u064f\u062e\u0652\u0631\u0650\u062c\u064c\u06ed \u0645\u0651\u064e\u0627 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u062a\u064e\u0643\u0652\u062a\u064f\u0645\u064f\u0648\u0646\u064e", "num": 72}
{"line": "\u0641\u064e\u0642\u064f\u0644\u0652\u0646\u064e\u0627 \u0671\u0636\u0652\u0631\u0650\u0628\u064f\u0648\u0647\u064f \u0628\u0650\u0628\u064e\u0639\u0652\u0636\u0650\u0647\u064e\u0627 \u06da \u0643\u064e\u0630\u064e\u0670\u0644\u0650\u0643\u064e \u064a\u064f\u062d\u0652\u0649\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0671\u0644\u0652\u0645\u064e\u0648\u0652\u062a\u064e\u0649\u0670 \u0648\u064e\u064a\u064f\u0631\u0650\u064a\u0643\u064f\u0645\u0652 \u0621\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u0650\u0647\u0650\u06e6 \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u062a\u064e\u0639\u0652\u0642\u0650\u0644\u064f\u0648\u0646\u064e", "num": 73}
{"line": "\u062b\u064f\u0645\u0651\u064e \u0642\u064e\u0633\u064e\u062a\u0652 \u0642\u064f\u0644\u064f\u0648\u0628\u064f\u0643\u064f\u0645 \u0645\u0651\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u0641\u064e\u0647\u0650\u0649\u064e \u0643\u064e\u0671\u0644\u0652\u062d\u0650\u062c\u064e\u0627\u0631\u064e\u0629\u0650 \u0623\u064e\u0648\u0652 \u0623\u064e\u0634\u064e\u062f\u0651\u064f \u0642\u064e\u0633\u0652\u0648\u064e\u0629\u064b\u06ed \u06da \u0648\u064e\u0625\u0650\u0646\u0651\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u062d\u0650\u062c\u064e\u0627\u0631\u064e\u0629\u0650 \u0644\u064e\u0645\u064e\u0627 \u064a\u064e\u062a\u064e\u0641\u064e\u062c\u0651\u064e\u0631\u064f \u0645\u0650\u0646\u0652\u0647\u064f \u0671\u0644\u0652\u0623\u064e\u0646\u0652\u0647\u064e\u0640\u0670\u0631\u064f \u06da \u0648\u064e\u0625\u0650\u0646\u0651\u064e \u0645\u0650\u0646\u0652\u0647\u064e\u0627 \u0644\u064e\u0645\u064e\u0627 \u064a\u064e\u0634\u0651\u064e\u0642\u0651\u064e\u0642\u064f \u0641\u064e\u064a\u064e\u062e\u0652\u0631\u064f\u062c\u064f \u0645\u0650\u0646\u0652\u0647\u064f \u0671\u0644\u0652\u0645\u064e\u0627\u0653\u0621\u064f \u06da \u0648\u064e\u0625\u0650\u0646\u0651\u064e \u0645\u0650\u0646\u0652\u0647\u064e\u0627 \u0644\u064e\u0645\u064e\u0627 \u064a\u064e\u0647\u0652\u0628\u0650\u0637\u064f \u0645\u0650\u0646\u0652 \u062e\u064e\u0634\u0652\u064a\u064e\u0629\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d7 \u0648\u064e\u0645\u064e\u0627 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u063a\u064e\u0640\u0670\u0641\u0650\u0644\u064d \u0639\u064e\u0645\u0651\u064e\u0627 \u062a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e", "num": 74}
{"line": "\u06de \u0623\u064e\u0641\u064e\u062a\u064e\u0637\u0652\u0645\u064e\u0639\u064f\u0648\u0646\u064e \u0623\u064e\u0646 \u064a\u064f\u0624\u0652\u0645\u0650\u0646\u064f\u0648\u0627\u06df \u0644\u064e\u0643\u064f\u0645\u0652 \u0648\u064e\u0642\u064e\u062f\u0652 \u0643\u064e\u0627\u0646\u064e \u0641\u064e\u0631\u0650\u064a\u0642\u064c\u06ed \u0645\u0651\u0650\u0646\u0652\u0647\u064f\u0645\u0652 \u064a\u064e\u0633\u0652\u0645\u064e\u0639\u064f\u0648\u0646\u064e \u0643\u064e\u0644\u064e\u0640\u0670\u0645\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u062b\u064f\u0645\u0651\u064e \u064a\u064f\u062d\u064e\u0631\u0651\u0650\u0641\u064f\u0648\u0646\u064e\u0647\u064f\u06e5 \u0645\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0645\u064e\u0627 \u0639\u064e\u0642\u064e\u0644\u064f\u0648\u0647\u064f \u0648\u064e\u0647\u064f\u0645\u0652 \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 75}
{"line": "\u0648\u064e\u0625\u0650\u0630\u064e\u0627 \u0644\u064e\u0642\u064f\u0648\u0627\u06df \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0642\u064e\u0627\u0644\u064f\u0648\u0653\u0627\u06df \u0621\u064e\u0627\u0645\u064e\u0646\u0651\u064e\u0627 \u0648\u064e\u0625\u0650\u0630\u064e\u0627 \u062e\u064e\u0644\u064e\u0627 \u0628\u064e\u0639\u0652\u0636\u064f\u0647\u064f\u0645\u0652 \u0625\u0650\u0644\u064e\u0649\u0670 \u0628\u064e\u0639\u0652\u0636\u064d\u06e2 \u0642\u064e\u0627\u0644\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u062a\u064f\u062d\u064e\u062f\u0651\u0650\u062b\u064f\u0648\u0646\u064e\u0647\u064f\u0645 \u0628\u0650\u0645\u064e\u0627 \u0641\u064e\u062a\u064e\u062d\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0644\u0650\u064a\u064f\u062d\u064e\u0627\u0653\u062c\u0651\u064f\u0648\u0643\u064f\u0645 \u0628\u0650\u0647\u0650\u06e6 \u0639\u0650\u0646\u062f\u064e \u0631\u064e\u0628\u0651\u0650\u0643\u064f\u0645\u0652 \u06da \u0623\u064e\u0641\u064e\u0644\u064e\u0627 \u062a\u064e\u0639\u0652\u0642\u0650\u0644\u064f\u0648\u0646\u064e", "num": 76}
{"line": "\u0623\u064e\u0648\u064e\u0644\u064e\u0627 \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f \u0645\u064e\u0627 \u064a\u064f\u0633\u0650\u0631\u0651\u064f\u0648\u0646\u064e \u0648\u064e\u0645\u064e\u0627 \u064a\u064f\u0639\u0652\u0644\u0650\u0646\u064f\u0648\u0646\u064e", "num": 77}
{"line": "\u0648\u064e\u0645\u0650\u0646\u0652\u0647\u064f\u0645\u0652 \u0623\u064f\u0645\u0651\u0650\u064a\u0651\u064f\u0648\u0646\u064e \u0644\u064e\u0627 \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u0625\u0650\u0644\u0651\u064e\u0627\u0653 \u0623\u064e\u0645\u064e\u0627\u0646\u0650\u0649\u0651\u064e \u0648\u064e\u0625\u0650\u0646\u0652 \u0647\u064f\u0645\u0652 \u0625\u0650\u0644\u0651\u064e\u0627 \u064a\u064e\u0638\u064f\u0646\u0651\u064f\u0648\u0646\u064e", "num": 78}
{"line": "\u0641\u064e\u0648\u064e\u064a\u0652\u0644\u064c\u06ed \u0644\u0651\u0650\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064e\u0643\u0652\u062a\u064f\u0628\u064f\u0648\u0646\u064e \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u0628\u0650\u0623\u064e\u064a\u0652\u062f\u0650\u064a\u0647\u0650\u0645\u0652 \u062b\u064f\u0645\u0651\u064e \u064a\u064e\u0642\u064f\u0648\u0644\u064f\u0648\u0646\u064e \u0647\u064e\u0640\u0670\u0630\u064e\u0627 \u0645\u0650\u0646\u0652 \u0639\u0650\u0646\u062f\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0644\u0650\u064a\u064e\u0634\u0652\u062a\u064e\u0631\u064f\u0648\u0627\u06df \u0628\u0650\u0647\u0650\u06e6 \u062b\u064e\u0645\u064e\u0646\u064b\u06ed\u0627 \u0642\u064e\u0644\u0650\u064a\u0644\u064b\u06ed\u0627 \u06d6 \u0641\u064e\u0648\u064e\u064a\u0652\u0644\u064c\u06ed \u0644\u0651\u064e\u0647\u064f\u0645 \u0645\u0651\u0650\u0645\u0651\u064e\u0627 \u0643\u064e\u062a\u064e\u0628\u064e\u062a\u0652 \u0623\u064e\u064a\u0652\u062f\u0650\u064a\u0647\u0650\u0645\u0652 \u0648\u064e\u0648\u064e\u064a\u0652\u0644\u064c\u06ed \u0644\u0651\u064e\u0647\u064f\u0645 \u0645\u0651\u0650\u0645\u0651\u064e\u0627 \u064a\u064e\u0643\u0652\u0633\u0650\u0628\u064f\u0648\u0646\u064e", "num": 79}
{"line": "\u0648\u064e\u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0644\u064e\u0646 \u062a\u064e\u0645\u064e\u0633\u0651\u064e\u0646\u064e\u0627 \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u064f \u0625\u0650\u0644\u0651\u064e\u0627\u0653 \u0623\u064e\u064a\u0651\u064e\u0627\u0645\u064b\u06ed\u0627 \u0645\u0651\u064e\u0639\u0652\u062f\u064f\u0648\u062f\u064e\u0629\u064b\u06ed \u06da \u0642\u064f\u0644\u0652 \u0623\u064e\u062a\u0651\u064e\u062e\u064e\u0630\u0652\u062a\u064f\u0645\u0652 \u0639\u0650\u0646\u062f\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0639\u064e\u0647\u0652\u062f\u064b\u06ed\u0627 \u0641\u064e\u0644\u064e\u0646 \u064a\u064f\u062e\u0652\u0644\u0650\u0641\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0647\u0652\u062f\u064e\u0647\u064f\u06e5\u0653 \u06d6 \u0623\u064e\u0645\u0652 \u062a\u064e\u0642\u064f\u0648\u0644\u064f\u0648\u0646\u064e \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0645\u064e\u0627 \u0644\u064e\u0627 \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 80}
{"line": "\u0628\u064e\u0644\u064e\u0649\u0670 \u0645\u064e\u0646 \u0643\u064e\u0633\u064e\u0628\u064e \u0633\u064e\u064a\u0651\u0650\u0626\u064e\u0629\u064b\u06ed \u0648\u064e\u0623\u064e\u062d\u064e\u0640\u0670\u0637\u064e\u062a\u0652 \u0628\u0650\u0647\u0650\u06e6 \u062e\u064e\u0637\u0650\u064a\u0653\u0640\u0654\u064e\u062a\u064f\u0647\u064f\u06e5 \u0641\u064e\u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0623\u064e\u0635\u0652\u062d\u064e\u0640\u0670\u0628\u064f \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u0650 \u06d6 \u0647\u064f\u0645\u0652 \u0641\u0650\u064a\u0647\u064e\u0627 \u062e\u064e\u0640\u0670\u0644\u0650\u062f\u064f\u0648\u0646\u064e", "num": 81}
{"line": "\u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0648\u064e\u0639\u064e\u0645\u0650\u0644\u064f\u0648\u0627\u06df \u0671\u0644\u0635\u0651\u064e\u0640\u0670\u0644\u0650\u062d\u064e\u0640\u0670\u062a\u0650 \u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0623\u064e\u0635\u0652\u062d\u064e\u0640\u0670\u0628\u064f \u0671\u0644\u0652\u062c\u064e\u0646\u0651\u064e\u0629\u0650 \u06d6 \u0647\u064f\u0645\u0652 \u0641\u0650\u064a\u0647\u064e\u0627 \u062e\u064e\u0640\u0670\u0644\u0650\u062f\u064f\u0648\u0646\u064e", "num": 82}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u0623\u064e\u062e\u064e\u0630\u0652\u0646\u064e\u0627 \u0645\u0650\u064a\u062b\u064e\u0640\u0670\u0642\u064e \u0628\u064e\u0646\u0650\u0649\u0653 \u0625\u0650\u0633\u0652\u0631\u064e\u0670\u0653\u0621\u0650\u064a\u0644\u064e \u0644\u064e\u0627 \u062a\u064e\u0639\u0652\u0628\u064f\u062f\u064f\u0648\u0646\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0648\u064e\u0628\u0650\u0671\u0644\u0652\u0648\u064e\u0670\u0644\u0650\u062f\u064e\u064a\u0652\u0646\u0650 \u0625\u0650\u062d\u0652\u0633\u064e\u0627\u0646\u064b\u06ed\u0627 \u0648\u064e\u0630\u0650\u0649 \u0671\u0644\u0652\u0642\u064f\u0631\u0652\u0628\u064e\u0649\u0670 \u0648\u064e\u0671\u0644\u0652\u064a\u064e\u062a\u064e\u0640\u0670\u0645\u064e\u0649\u0670 \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u0633\u064e\u0640\u0670\u0643\u0650\u064a\u0646\u0650 \u0648\u064e\u0642\u064f\u0648\u0644\u064f\u0648\u0627\u06df \u0644\u0650\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u062d\u064f\u0633\u0652\u0646\u064b\u06ed\u0627 \u0648\u064e\u0623\u064e\u0642\u0650\u064a\u0645\u064f\u0648\u0627\u06df \u0671\u0644\u0635\u0651\u064e\u0644\u064e\u0648\u0670\u0629\u064e \u0648\u064e\u0621\u064e\u0627\u062a\u064f\u0648\u0627\u06df \u0671\u0644\u0632\u0651\u064e\u0643\u064e\u0648\u0670\u0629\u064e \u062b\u064f\u0645\u0651\u064e \u062a\u064e\u0648\u064e\u0644\u0651\u064e\u064a\u0652\u062a\u064f\u0645\u0652 \u0625\u0650\u0644\u0651\u064e\u0627 \u0642\u064e\u0644\u0650\u064a\u0644\u064b\u06ed\u0627 \u0645\u0651\u0650\u0646\u0643\u064f\u0645\u0652 \u0648\u064e\u0623\u064e\u0646\u062a\u064f\u0645 \u0645\u0651\u064f\u0639\u0652\u0631\u0650\u0636\u064f\u0648\u0646\u064e", "num": 83}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u0623\u064e\u062e\u064e\u0630\u0652\u0646\u064e\u0627 \u0645\u0650\u064a\u062b\u064e\u0640\u0670\u0642\u064e\u0643\u064f\u0645\u0652 \u0644\u064e\u0627 \u062a\u064e\u0633\u0652\u0641\u0650\u0643\u064f\u0648\u0646\u064e \u062f\u0650\u0645\u064e\u0627\u0653\u0621\u064e\u0643\u064f\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u062a\u064f\u062e\u0652\u0631\u0650\u062c\u064f\u0648\u0646\u064e \u0623\u064e\u0646\u0641\u064f\u0633\u064e\u0643\u064f\u0645 \u0645\u0651\u0650\u0646 \u062f\u0650\u064a\u064e\u0640\u0670\u0631\u0650\u0643\u064f\u0645\u0652 \u062b\u064f\u0645\u0651\u064e \u0623\u064e\u0642\u0652\u0631\u064e\u0631\u0652\u062a\u064f\u0645\u0652 \u0648\u064e\u0623\u064e\u0646\u062a\u064f\u0645\u0652 \u062a\u064e\u0634\u0652\u0647\u064e\u062f\u064f\u0648\u0646\u064e", "num": 84}
{"line": "\u062b\u064f\u0645\u0651\u064e \u0623\u064e\u0646\u062a\u064f\u0645\u0652 \u0647\u064e\u0640\u0670\u0653\u0624\u064f\u0644\u064e\u0627\u0653\u0621\u0650 \u062a\u064e\u0642\u0652\u062a\u064f\u0644\u064f\u0648\u0646\u064e \u0623\u064e\u0646\u0641\u064f\u0633\u064e\u0643\u064f\u0645\u0652 \u0648\u064e\u062a\u064f\u062e\u0652\u0631\u0650\u062c\u064f\u0648\u0646\u064e \u0641\u064e\u0631\u0650\u064a\u0642\u064b\u06ed\u0627 \u0645\u0651\u0650\u0646\u0643\u064f\u0645 \u0645\u0651\u0650\u0646 \u062f\u0650\u064a\u064e\u0640\u0670\u0631\u0650\u0647\u0650\u0645\u0652 \u062a\u064e\u0638\u064e\u0640\u0670\u0647\u064e\u0631\u064f\u0648\u0646\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645 \u0628\u0650\u0671\u0644\u0652\u0625\u0650\u062b\u0652\u0645\u0650 \u0648\u064e\u0671\u0644\u0652\u0639\u064f\u062f\u0652\u0648\u064e\u0670\u0646\u0650 \u0648\u064e\u0625\u0650\u0646 \u064a\u064e\u0623\u0652\u062a\u064f\u0648\u0643\u064f\u0645\u0652 \u0623\u064f\u0633\u064e\u0640\u0670\u0631\u064e\u0649\u0670 \u062a\u064f\u0641\u064e\u0640\u0670\u062f\u064f\u0648\u0647\u064f\u0645\u0652 \u0648\u064e\u0647\u064f\u0648\u064e \u0645\u064f\u062d\u064e\u0631\u0651\u064e\u0645\u064c \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0625\u0650\u062e\u0652\u0631\u064e\u0627\u062c\u064f\u0647\u064f\u0645\u0652 \u06da \u0623\u064e\u0641\u064e\u062a\u064f\u0624\u0652\u0645\u0650\u0646\u064f\u0648\u0646\u064e \u0628\u0650\u0628\u064e\u0639\u0652\u0636\u0650 \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u0650 \u0648\u064e\u062a\u064e\u0643\u0652\u0641\u064f\u0631\u064f\u0648\u0646\u064e \u0628\u0650\u0628\u064e\u0639\u0652\u0636\u064d\u06e2 \u06da \u0641\u064e\u0645\u064e\u0627 \u062c\u064e\u0632\u064e\u0627\u0653\u0621\u064f \u0645\u064e\u0646 \u064a\u064e\u0641\u0652\u0639\u064e\u0644\u064f \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u0645\u0650\u0646\u0643\u064f\u0645\u0652 \u0625\u0650\u0644\u0651\u064e\u0627 \u062e\u0650\u0632\u0652\u0649\u064c\u06ed \u0641\u0650\u0649 \u0671\u0644\u0652\u062d\u064e\u064a\u064e\u0648\u0670\u0629\u0650 \u0671\u0644\u062f\u0651\u064f\u0646\u0652\u064a\u064e\u0627 \u06d6 \u0648\u064e\u064a\u064e\u0648\u0652\u0645\u064e \u0671\u0644\u0652\u0642\u0650\u064a\u064e\u0640\u0670\u0645\u064e\u0629\u0650 \u064a\u064f\u0631\u064e\u062f\u0651\u064f\u0648\u0646\u064e \u0625\u0650\u0644\u064e\u0649\u0670\u0653 \u0623\u064e\u0634\u064e\u062f\u0651\u0650 \u0671\u0644\u0652\u0639\u064e\u0630\u064e\u0627\u0628\u0650 \u06d7 \u0648\u064e\u0645\u064e\u0627 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u063a\u064e\u0640\u0670\u0641\u0650\u0644\u064d \u0639\u064e\u0645\u0651\u064e\u0627 \u062a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e", "num": 85}
{"line": "\u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0671\u0634\u0652\u062a\u064e\u0631\u064e\u0648\u064f\u0627\u06df \u0671\u0644\u0652\u062d\u064e\u064a\u064e\u0648\u0670\u0629\u064e \u0671\u0644\u062f\u0651\u064f\u0646\u0652\u064a\u064e\u0627 \u0628\u0650\u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u064e\u0629\u0650 \u06d6 \u0641\u064e\u0644\u064e\u0627 \u064a\u064f\u062e\u064e\u0641\u0651\u064e\u0641\u064f \u0639\u064e\u0646\u0652\u0647\u064f\u0645\u064f \u0671\u0644\u0652\u0639\u064e\u0630\u064e\u0627\u0628\u064f \u0648\u064e\u0644\u064e\u0627 \u0647\u064f\u0645\u0652 \u064a\u064f\u0646\u0635\u064e\u0631\u064f\u0648\u0646\u064e", "num": 86}
{"line": "\u0648\u064e\u0644\u064e\u0642\u064e\u062f\u0652 \u0621\u064e\u0627\u062a\u064e\u064a\u0652\u0646\u064e\u0627 \u0645\u064f\u0648\u0633\u064e\u0649 \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u0648\u064e\u0642\u064e\u0641\u0651\u064e\u064a\u0652\u0646\u064e\u0627 \u0645\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650\u0647\u0650\u06e6 \u0628\u0650\u0671\u0644\u0631\u0651\u064f\u0633\u064f\u0644\u0650 \u06d6 \u0648\u064e\u0621\u064e\u0627\u062a\u064e\u064a\u0652\u0646\u064e\u0627 \u0639\u0650\u064a\u0633\u064e\u0649 \u0671\u0628\u0652\u0646\u064e \u0645\u064e\u0631\u0652\u064a\u064e\u0645\u064e \u0671\u0644\u0652\u0628\u064e\u064a\u0651\u0650\u0646\u064e\u0640\u0670\u062a\u0650 \u0648\u064e\u0623\u064e\u064a\u0651\u064e\u062f\u0652\u0646\u064e\u0640\u0670\u0647\u064f \u0628\u0650\u0631\u064f\u0648\u062d\u0650 \u0671\u0644\u0652\u0642\u064f\u062f\u064f\u0633\u0650 \u06d7 \u0623\u064e\u0641\u064e\u0643\u064f\u0644\u0651\u064e\u0645\u064e\u0627 \u062c\u064e\u0627\u0653\u0621\u064e\u0643\u064f\u0645\u0652 \u0631\u064e\u0633\u064f\u0648\u0644\u064c\u06e2 \u0628\u0650\u0645\u064e\u0627 \u0644\u064e\u0627 \u062a\u064e\u0647\u0652\u0648\u064e\u0649\u0670\u0653 \u0623\u064e\u0646\u0641\u064f\u0633\u064f\u0643\u064f\u0645\u064f \u0671\u0633\u0652\u062a\u064e\u0643\u0652\u0628\u064e\u0631\u0652\u062a\u064f\u0645\u0652 \u0641\u064e\u0641\u064e\u0631\u0650\u064a\u0642\u064b\u06ed\u0627 \u0643\u064e\u0630\u0651\u064e\u0628\u0652\u062a\u064f\u0645\u0652 \u0648\u064e\u0641\u064e\u0631\u0650\u064a\u0642\u064b\u06ed\u0627 \u062a\u064e\u0642\u0652\u062a\u064f\u0644\u064f\u0648\u0646\u064e", "num": 87}
{"line": "\u0648\u064e\u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0642\u064f\u0644\u064f\u0648\u0628\u064f\u0646\u064e\u0627 \u063a\u064f\u0644\u0652\u0641\u064c\u06e2 \u06da \u0628\u064e\u0644 \u0644\u0651\u064e\u0639\u064e\u0646\u064e\u0647\u064f\u0645\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u0643\u064f\u0641\u0652\u0631\u0650\u0647\u0650\u0645\u0652 \u0641\u064e\u0642\u064e\u0644\u0650\u064a\u0644\u064b\u06ed\u0627 \u0645\u0651\u064e\u0627 \u064a\u064f\u0624\u0652\u0645\u0650\u0646\u064f\u0648\u0646\u064e", "num": 88}
{"line": "\u0648\u064e\u0644\u064e\u0645\u0651\u064e\u0627 \u062c\u064e\u0627\u0653\u0621\u064e\u0647\u064f\u0645\u0652 \u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064c\u06ed \u0645\u0651\u0650\u0646\u0652 \u0639\u0650\u0646\u062f\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0645\u064f\u0635\u064e\u062f\u0651\u0650\u0642\u064c\u06ed \u0644\u0651\u0650\u0645\u064e\u0627 \u0645\u064e\u0639\u064e\u0647\u064f\u0645\u0652 \u0648\u064e\u0643\u064e\u0627\u0646\u064f\u0648\u0627\u06df \u0645\u0650\u0646 \u0642\u064e\u0628\u0652\u0644\u064f \u064a\u064e\u0633\u0652\u062a\u064e\u0641\u0652\u062a\u0650\u062d\u064f\u0648\u0646\u064e \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0643\u064e\u0641\u064e\u0631\u064f\u0648\u0627\u06df \u0641\u064e\u0644\u064e\u0645\u0651\u064e\u0627 \u062c\u064e\u0627\u0653\u0621\u064e\u0647\u064f\u0645 \u0645\u0651\u064e\u0627 \u0639\u064e\u0631\u064e\u0641\u064f\u0648\u0627\u06df \u0643\u064e\u0641\u064e\u0631\u064f\u0648\u0627\u06df \u0628\u0650\u0647\u0650\u06e6 \u06da \u0641\u064e\u0644\u064e\u0639\u0652\u0646\u064e\u0629\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0643\u064e\u0640\u0670\u0641\u0650\u0631\u0650\u064a\u0646\u064e", "num": 89}
{"line": "\u0628\u0650\u0626\u0652\u0633\u064e\u0645\u064e\u0627 \u0671\u0634\u0652\u062a\u064e\u0631\u064e\u0648\u0652\u0627\u06df \u0628\u0650\u0647\u0650\u06e6\u0653 \u0623\u064e\u0646\u0641\u064f\u0633\u064e\u0647\u064f\u0645\u0652 \u0623\u064e\u0646 \u064a\u064e\u0643\u0652\u0641\u064f\u0631\u064f\u0648\u0627\u06df \u0628\u0650\u0645\u064e\u0627\u0653 \u0623\u064e\u0646\u0632\u064e\u0644\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u064e\u063a\u0652\u064a\u064b\u0627 \u0623\u064e\u0646 \u064a\u064f\u0646\u064e\u0632\u0651\u0650\u0644\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0645\u0650\u0646 \u0641\u064e\u0636\u0652\u0644\u0650\u0647\u0650\u06e6 \u0639\u064e\u0644\u064e\u0649\u0670 \u0645\u064e\u0646 \u064a\u064e\u0634\u064e\u0627\u0653\u0621\u064f \u0645\u0650\u0646\u0652 \u0639\u0650\u0628\u064e\u0627\u062f\u0650\u0647\u0650\u06e6 \u06d6 \u0641\u064e\u0628\u064e\u0627\u0653\u0621\u064f\u0648 \u0628\u0650\u063a\u064e\u0636\u064e\u0628\u064d \u0639\u064e\u0644\u064e\u0649\u0670 \u063a\u064e\u0636\u064e\u0628\u064d\u06e2 \u06da \u0648\u064e\u0644\u0650\u0644\u0652\u0643\u064e\u0640\u0670\u0641\u0650\u0631\u0650\u064a\u0646\u064e \u0639\u064e\u0630\u064e\u0627\u0628\u064c\u06ed \u0645\u0651\u064f\u0647\u0650\u064a\u0646\u064c\u06ed", "num": 90}
{"line": "\u0648\u064e\u0625\u0650\u0630\u064e\u0627 \u0642\u0650\u064a\u0644\u064e \u0644\u064e\u0647\u064f\u0645\u0652 \u0621\u064e\u0627\u0645\u0650\u0646\u064f\u0648\u0627\u06df \u0628\u0650\u0645\u064e\u0627\u0653 \u0623\u064e\u0646\u0632\u064e\u0644\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0646\u064f\u0624\u0652\u0645\u0650\u0646\u064f \u0628\u0650\u0645\u064e\u0627\u0653 \u0623\u064f\u0646\u0632\u0650\u0644\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0646\u064e\u0627 \u0648\u064e\u064a\u064e\u0643\u0652\u0641\u064f\u0631\u064f\u0648\u0646\u064e \u0628\u0650\u0645\u064e\u0627 \u0648\u064e\u0631\u064e\u0627\u0653\u0621\u064e\u0647\u064f\u06e5 \u0648\u064e\u0647\u064f\u0648\u064e \u0671\u0644\u0652\u062d\u064e\u0642\u0651\u064f \u0645\u064f\u0635\u064e\u062f\u0651\u0650\u0642\u064b\u06ed\u0627 \u0644\u0651\u0650\u0645\u064e\u0627 \u0645\u064e\u0639\u064e\u0647\u064f\u0645\u0652 \u06d7 \u0642\u064f\u0644\u0652 \u0641\u064e\u0644\u0650\u0645\u064e \u062a\u064e\u0642\u0652\u062a\u064f\u0644\u064f\u0648\u0646\u064e \u0623\u064e\u0646\u06e2\u0628\u0650\u064a\u064e\u0627\u0653\u0621\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0645\u0650\u0646 \u0642\u064e\u0628\u0652\u0644\u064f \u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645 \u0645\u0651\u064f\u0624\u0652\u0645\u0650\u0646\u0650\u064a\u0646\u064e", "num": 91}
{"line": "\u06de \u0648\u064e\u0644\u064e\u0642\u064e\u062f\u0652 \u062c\u064e\u0627\u0653\u0621\u064e\u0643\u064f\u0645 \u0645\u0651\u064f\u0648\u0633\u064e\u0649\u0670 \u0628\u0650\u0671\u0644\u0652\u0628\u064e\u064a\u0651\u0650\u0646\u064e\u0640\u0670\u062a\u0650 \u062b\u064f\u0645\u0651\u064e \u0671\u062a\u0651\u064e\u062e\u064e\u0630\u0652\u062a\u064f\u0645\u064f \u0671\u0644\u0652\u0639\u0650\u062c\u0652\u0644\u064e \u0645\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650\u0647\u0650\u06e6 \u0648\u064e\u0623\u064e\u0646\u062a\u064f\u0645\u0652 \u0638\u064e\u0640\u0670\u0644\u0650\u0645\u064f\u0648\u0646\u064e", "num": 92}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u0623\u064e\u062e\u064e\u0630\u0652\u0646\u064e\u0627 \u0645\u0650\u064a\u062b\u064e\u0640\u0670\u0642\u064e\u0643\u064f\u0645\u0652 \u0648\u064e\u0631\u064e\u0641\u064e\u0639\u0652\u0646\u064e\u0627 \u0641\u064e\u0648\u0652\u0642\u064e\u0643\u064f\u0645\u064f \u0671\u0644\u0637\u0651\u064f\u0648\u0631\u064e \u062e\u064f\u0630\u064f\u0648\u0627\u06df \u0645\u064e\u0627\u0653 \u0621\u064e\u0627\u062a\u064e\u064a\u0652\u0646\u064e\u0640\u0670\u0643\u064f\u0645 \u0628\u0650\u0642\u064f\u0648\u0651\u064e\u0629\u064d\u06e2 \u0648\u064e\u0671\u0633\u0652\u0645\u064e\u0639\u064f\u0648\u0627\u06df \u06d6 \u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0633\u064e\u0645\u0650\u0639\u0652\u0646\u064e\u0627 \u0648\u064e\u0639\u064e\u0635\u064e\u064a\u0652\u0646\u064e\u0627 \u0648\u064e\u0623\u064f\u0634\u0652\u0631\u0650\u0628\u064f\u0648\u0627\u06df \u0641\u0650\u0649 \u0642\u064f\u0644\u064f\u0648\u0628\u0650\u0647\u0650\u0645\u064f \u0671\u0644\u0652\u0639\u0650\u062c\u0652\u0644\u064e \u0628\u0650\u0643\u064f\u0641\u0652\u0631\u0650\u0647\u0650\u0645\u0652 \u06da \u0642\u064f\u0644\u0652 \u0628\u0650\u0626\u0652\u0633\u064e\u0645\u064e\u0627 \u064a\u064e\u0623\u0652\u0645\u064f\u0631\u064f\u0643\u064f\u0645 \u0628\u0650\u0647\u0650\u06e6\u0653 \u0625\u0650\u064a\u0645\u064e\u0640\u0670\u0646\u064f\u0643\u064f\u0645\u0652 \u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645 \u0645\u0651\u064f\u0624\u0652\u0645\u0650\u0646\u0650\u064a\u0646\u064e", "num": 93}
{"line": "\u0642\u064f\u0644\u0652 \u0625\u0650\u0646 \u0643\u064e\u0627\u0646\u064e\u062a\u0652 \u0644\u064e\u0643\u064f\u0645\u064f \u0671\u0644\u062f\u0651\u064e\u0627\u0631\u064f \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u064e\u0629\u064f \u0639\u0650\u0646\u062f\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u062e\u064e\u0627\u0644\u0650\u0635\u064e\u0629\u064b\u06ed \u0645\u0651\u0650\u0646 \u062f\u064f\u0648\u0646\u0650 \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0641\u064e\u062a\u064e\u0645\u064e\u0646\u0651\u064e\u0648\u064f\u0627\u06df \u0671\u0644\u0652\u0645\u064e\u0648\u0652\u062a\u064e \u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u0635\u064e\u0640\u0670\u062f\u0650\u0642\u0650\u064a\u0646\u064e", "num": 94}
{"line": "\u0648\u064e\u0644\u064e\u0646 \u064a\u064e\u062a\u064e\u0645\u064e\u0646\u0651\u064e\u0648\u0652\u0647\u064f \u0623\u064e\u0628\u064e\u062f\u064b\u06e2\u0627 \u0628\u0650\u0645\u064e\u0627 \u0642\u064e\u062f\u0651\u064e\u0645\u064e\u062a\u0652 \u0623\u064e\u064a\u0652\u062f\u0650\u064a\u0647\u0650\u0645\u0652 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06e2 \u0628\u0650\u0671\u0644\u0638\u0651\u064e\u0640\u0670\u0644\u0650\u0645\u0650\u064a\u0646\u064e", "num": 95}
{"line": "\u0648\u064e\u0644\u064e\u062a\u064e\u062c\u0650\u062f\u064e\u0646\u0651\u064e\u0647\u064f\u0645\u0652 \u0623\u064e\u062d\u0652\u0631\u064e\u0635\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0639\u064e\u0644\u064e\u0649\u0670 \u062d\u064e\u064a\u064e\u0648\u0670\u0629\u064d\u06e2 \u0648\u064e\u0645\u0650\u0646\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0623\u064e\u0634\u0652\u0631\u064e\u0643\u064f\u0648\u0627\u06df \u06da \u064a\u064e\u0648\u064e\u062f\u0651\u064f \u0623\u064e\u062d\u064e\u062f\u064f\u0647\u064f\u0645\u0652 \u0644\u064e\u0648\u0652 \u064a\u064f\u0639\u064e\u0645\u0651\u064e\u0631\u064f \u0623\u064e\u0644\u0652\u0641\u064e \u0633\u064e\u0646\u064e\u0629\u064d\u06e2 \u0648\u064e\u0645\u064e\u0627 \u0647\u064f\u0648\u064e \u0628\u0650\u0645\u064f\u0632\u064e\u062d\u0652\u0632\u0650\u062d\u0650\u0647\u0650\u06e6 \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0639\u064e\u0630\u064e\u0627\u0628\u0650 \u0623\u064e\u0646 \u064a\u064f\u0639\u064e\u0645\u0651\u064e\u0631\u064e \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u064e\u0635\u0650\u064a\u0631\u064c\u06e2 \u0628\u0650\u0645\u064e\u0627 \u064a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e", "num": 96}
{"line": "\u0642\u064f\u0644\u0652 \u0645\u064e\u0646 \u0643\u064e\u0627\u0646\u064e \u0639\u064e\u062f\u064f\u0648\u0651\u064b\u06ed\u0627 \u0644\u0651\u0650\u062c\u0650\u0628\u0652\u0631\u0650\u064a\u0644\u064e \u0641\u064e\u0625\u0650\u0646\u0651\u064e\u0647\u064f\u06e5 \u0646\u064e\u0632\u0651\u064e\u0644\u064e\u0647\u064f\u06e5 \u0639\u064e\u0644\u064e\u0649\u0670 \u0642\u064e\u0644\u0652\u0628\u0650\u0643\u064e \u0628\u0650\u0625\u0650\u0630\u0652\u0646\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0645\u064f\u0635\u064e\u062f\u0651\u0650\u0642\u064b\u06ed\u0627 \u0644\u0651\u0650\u0645\u064e\u0627 \u0628\u064e\u064a\u0652\u0646\u064e \u064a\u064e\u062f\u064e\u064a\u0652\u0647\u0650 \u0648\u064e\u0647\u064f\u062f\u064b\u06ed\u0649 \u0648\u064e\u0628\u064f\u0634\u0652\u0631\u064e\u0649\u0670 \u0644\u0650\u0644\u0652\u0645\u064f\u0624\u0652\u0645\u0650\u0646\u0650\u064a\u0646\u064e", "num": 97}
{"line": "\u0645\u064e\u0646 \u0643\u064e\u0627\u0646\u064e \u0639\u064e\u062f\u064f\u0648\u0651\u064b\u06ed\u0627 \u0644\u0651\u0650\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0645\u064e\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e\u062a\u0650\u0647\u0650\u06e6 \u0648\u064e\u0631\u064f\u0633\u064f\u0644\u0650\u0647\u0650\u06e6 \u0648\u064e\u062c\u0650\u0628\u0652\u0631\u0650\u064a\u0644\u064e \u0648\u064e\u0645\u0650\u064a\u0643\u064e\u0649\u0670\u0644\u064e \u0641\u064e\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u064e\u062f\u064f\u0648\u0651\u064c\u06ed \u0644\u0651\u0650\u0644\u0652\u0643\u064e\u0640\u0670\u0641\u0650\u0631\u0650\u064a\u0646\u064e", "num": 98}
{"line": "\u0648\u064e\u0644\u064e\u0642\u064e\u062f\u0652 \u0623\u064e\u0646\u0632\u064e\u0644\u0652\u0646\u064e\u0627\u0653 \u0625\u0650\u0644\u064e\u064a\u0652\u0643\u064e \u0621\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u064d\u06ed \u0628\u064e\u064a\u0651\u0650\u0646\u064e\u0640\u0670\u062a\u064d\u06e2 \u06d6 \u0648\u064e\u0645\u064e\u0627 \u064a\u064e\u0643\u0652\u0641\u064f\u0631\u064f \u0628\u0650\u0647\u064e\u0627\u0653 \u0625\u0650\u0644\u0651\u064e\u0627 \u0671\u0644\u0652\u0641\u064e\u0640\u0670\u0633\u0650\u0642\u064f\u0648\u0646\u064e", "num": 99}
{"line": "\u0623\u064e\u0648\u064e\u0643\u064f\u0644\u0651\u064e\u0645\u064e\u0627 \u0639\u064e\u0640\u0670\u0647\u064e\u062f\u064f\u0648\u0627\u06df \u0639\u064e\u0647\u0652\u062f\u064b\u06ed\u0627 \u0646\u0651\u064e\u0628\u064e\u0630\u064e\u0647\u064f\u06e5 \u0641\u064e\u0631\u0650\u064a\u0642\u064c\u06ed \u0645\u0651\u0650\u0646\u0652\u0647\u064f\u0645 \u06da \u0628\u064e\u0644\u0652 \u0623\u064e\u0643\u0652\u062b\u064e\u0631\u064f\u0647\u064f\u0645\u0652 \u0644\u064e\u0627 \u064a\u064f\u0624\u0652\u0645\u0650\u0646\u064f\u0648\u0646\u064e", "num": 100}
{"line": "\u0648\u064e\u0644\u064e\u0645\u0651\u064e\u0627 \u062c\u064e\u0627\u0653\u0621\u064e\u0647\u064f\u0645\u0652 \u0631\u064e\u0633\u064f\u0648\u0644\u064c\u06ed \u0645\u0651\u0650\u0646\u0652 \u0639\u0650\u0646\u062f\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0645\u064f\u0635\u064e\u062f\u0651\u0650\u0642\u064c\u06ed \u0644\u0651\u0650\u0645\u064e\u0627 \u0645\u064e\u0639\u064e\u0647\u064f\u0645\u0652 \u0646\u064e\u0628\u064e\u0630\u064e \u0641\u064e\u0631\u0650\u064a\u0642\u064c\u06ed \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0623\u064f\u0648\u062a\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0631\u064e\u0627\u0653\u0621\u064e \u0638\u064f\u0647\u064f\u0648\u0631\u0650\u0647\u0650\u0645\u0652 \u0643\u064e\u0623\u064e\u0646\u0651\u064e\u0647\u064f\u0645\u0652 \u0644\u064e\u0627 \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 101}
{"line": "\u0648\u064e\u0671\u062a\u0651\u064e\u0628\u064e\u0639\u064f\u0648\u0627\u06df \u0645\u064e\u0627 \u062a\u064e\u062a\u0652\u0644\u064f\u0648\u0627\u06df \u0671\u0644\u0634\u0651\u064e\u064a\u064e\u0640\u0670\u0637\u0650\u064a\u0646\u064f \u0639\u064e\u0644\u064e\u0649\u0670 \u0645\u064f\u0644\u0652\u0643\u0650 \u0633\u064f\u0644\u064e\u064a\u0652\u0645\u064e\u0640\u0670\u0646\u064e \u06d6 \u0648\u064e\u0645\u064e\u0627 \u0643\u064e\u0641\u064e\u0631\u064e \u0633\u064f\u0644\u064e\u064a\u0652\u0645\u064e\u0640\u0670\u0646\u064f \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646\u0651\u064e \u0671\u0644\u0634\u0651\u064e\u064a\u064e\u0640\u0670\u0637\u0650\u064a\u0646\u064e \u0643\u064e\u0641\u064e\u0631\u064f\u0648\u0627\u06df \u064a\u064f\u0639\u064e\u0644\u0651\u0650\u0645\u064f\u0648\u0646\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u064e \u0671\u0644\u0633\u0651\u0650\u062d\u0652\u0631\u064e \u0648\u064e\u0645\u064e\u0627\u0653 \u0623\u064f\u0646\u0632\u0650\u0644\u064e \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0645\u064e\u0644\u064e\u0643\u064e\u064a\u0652\u0646\u0650 \u0628\u0650\u0628\u064e\u0627\u0628\u0650\u0644\u064e \u0647\u064e\u0640\u0670\u0631\u064f\u0648\u062a\u064e \u0648\u064e\u0645\u064e\u0640\u0670\u0631\u064f\u0648\u062a\u064e \u06da \u0648\u064e\u0645\u064e\u0627 \u064a\u064f\u0639\u064e\u0644\u0651\u0650\u0645\u064e\u0627\u0646\u0650 \u0645\u0650\u0646\u0652 \u0623\u064e\u062d\u064e\u062f\u064d \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u064a\u064e\u0642\u064f\u0648\u0644\u064e\u0627\u0653 \u0625\u0650\u0646\u0651\u064e\u0645\u064e\u0627 \u0646\u064e\u062d\u0652\u0646\u064f \u0641\u0650\u062a\u0652\u0646\u064e\u0629\u064c\u06ed \u0641\u064e\u0644\u064e\u0627 \u062a\u064e\u0643\u0652\u0641\u064f\u0631\u0652 \u06d6 \u0641\u064e\u064a\u064e\u062a\u064e\u0639\u064e\u0644\u0651\u064e\u0645\u064f\u0648\u0646\u064e \u0645\u0650\u0646\u0652\u0647\u064f\u0645\u064e\u0627 \u0645\u064e\u0627 \u064a\u064f\u0641\u064e\u0631\u0651\u0650\u0642\u064f\u0648\u0646\u064e \u0628\u0650\u0647\u0650\u06e6 \u0628\u064e\u064a\u0652\u0646\u064e \u0671\u0644\u0652\u0645\u064e\u0631\u0652\u0621\u0650 \u0648\u064e\u0632\u064e\u0648\u0652\u062c\u0650\u0647\u0650\u06e6 \u06da \u0648\u064e\u0645\u064e\u0627 \u0647\u064f\u0645 \u0628\u0650\u0636\u064e\u0627\u0653\u0631\u0651\u0650\u064a\u0646\u064e \u0628\u0650\u0647\u0650\u06e6 \u0645\u0650\u0646\u0652 \u0623\u064e\u062d\u064e\u062f\u064d \u0625\u0650\u0644\u0651\u064e\u0627 \u0628\u0650\u0625\u0650\u0630\u0652\u0646\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06da \u0648\u064e\u064a\u064e\u062a\u064e\u0639\u064e\u0644\u0651\u064e\u0645\u064f\u0648\u0646\u064e \u0645\u064e\u0627 \u064a\u064e\u0636\u064f\u0631\u0651\u064f\u0647\u064f\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u064a\u064e\u0646\u0641\u064e\u0639\u064f\u0647\u064f\u0645\u0652 \u06da \u0648\u064e\u0644\u064e\u0642\u064e\u062f\u0652 \u0639\u064e\u0644\u0650\u0645\u064f\u0648\u0627\u06df \u0644\u064e\u0645\u064e\u0646\u0650 \u0671\u0634\u0652\u062a\u064e\u0631\u064e\u0649\u0670\u0647\u064f \u0645\u064e\u0627 \u0644\u064e\u0647\u064f\u06e5 \u0641\u0650\u0649 \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u064e\u0629\u0650 \u0645\u0650\u0646\u0652 \u062e\u064e\u0644\u064e\u0640\u0670\u0642\u064d\u06e2 \u06da \u0648\u064e\u0644\u064e\u0628\u0650\u0626\u0652\u0633\u064e \u0645\u064e\u0627 \u0634\u064e\u0631\u064e\u0648\u0652\u0627\u06df \u0628\u0650\u0647\u0650\u06e6\u0653 \u0623\u064e\u0646\u0641\u064f\u0633\u064e\u0647\u064f\u0645\u0652 \u06da \u0644\u064e\u0648\u0652 \u0643\u064e\u0627\u0646\u064f\u0648\u0627\u06df \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 102}
{"line": "\u0648\u064e\u0644\u064e\u0648\u0652 \u0623\u064e\u0646\u0651\u064e\u0647\u064f\u0645\u0652 \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0648\u064e\u0671\u062a\u0651\u064e\u0642\u064e\u0648\u0652\u0627\u06df \u0644\u064e\u0645\u064e\u062b\u064f\u0648\u0628\u064e\u0629\u064c\u06ed \u0645\u0651\u0650\u0646\u0652 \u0639\u0650\u0646\u062f\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u062e\u064e\u064a\u0652\u0631\u064c\u06ed \u06d6 \u0644\u0651\u064e\u0648\u0652 \u0643\u064e\u0627\u0646\u064f\u0648\u0627\u06df \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 103}
{"line": "\u064a\u064e\u0640\u0670\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0644\u064e\u0627 \u062a\u064e\u0642\u064f\u0648\u0644\u064f\u0648\u0627\u06df \u0631\u064e\u0670\u0639\u0650\u0646\u064e\u0627 \u0648\u064e\u0642\u064f\u0648\u0644\u064f\u0648\u0627\u06df \u0671\u0646\u0638\u064f\u0631\u0652\u0646\u064e\u0627 \u0648\u064e\u0671\u0633\u0652\u0645\u064e\u0639\u064f\u0648\u0627\u06df \u06d7 \u0648\u064e\u0644\u0650\u0644\u0652\u0643\u064e\u0640\u0670\u0641\u0650\u0631\u0650\u064a\u0646\u064e \u0639\u064e\u0630\u064e\u0627\u0628\u064c \u0623\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 104}
{"line": "\u0645\u0651\u064e\u0627 \u064a\u064e\u0648\u064e\u062f\u0651\u064f \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0643\u064e\u0641\u064e\u0631\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u0652 \u0623\u064e\u0647\u0652\u0644\u0650 \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u0650 \u0648\u064e\u0644\u064e\u0627 \u0671\u0644\u0652\u0645\u064f\u0634\u0652\u0631\u0650\u0643\u0650\u064a\u0646\u064e \u0623\u064e\u0646 \u064a\u064f\u0646\u064e\u0632\u0651\u064e\u0644\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645 \u0645\u0651\u0650\u0646\u0652 \u062e\u064e\u064a\u0652\u0631\u064d\u06e2 \u0645\u0651\u0650\u0646 \u0631\u0651\u064e\u0628\u0651\u0650\u0643\u064f\u0645\u0652 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064e\u062e\u0652\u062a\u064e\u0635\u0651\u064f \u0628\u0650\u0631\u064e\u062d\u0652\u0645\u064e\u062a\u0650\u0647\u0650\u06e6 \u0645\u064e\u0646 \u064a\u064e\u0634\u064e\u0627\u0653\u0621\u064f \u06da \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0630\u064f\u0648 \u0671\u0644\u0652\u0641\u064e\u0636\u0652\u0644\u0650 \u0671\u0644\u0652\u0639\u064e\u0638\u0650\u064a\u0645\u0650", "num": 105}
{"line": "\u06de \u0645\u064e\u0627 \u0646\u064e\u0646\u0633\u064e\u062e\u0652 \u0645\u0650\u0646\u0652 \u0621\u064e\u0627\u064a\u064e\u0629\u064d \u0623\u064e\u0648\u0652 \u0646\u064f\u0646\u0633\u0650\u0647\u064e\u0627 \u0646\u064e\u0623\u0652\u062a\u0650 \u0628\u0650\u062e\u064e\u064a\u0652\u0631\u064d\u06e2 \u0645\u0651\u0650\u0646\u0652\u0647\u064e\u0627\u0653 \u0623\u064e\u0648\u0652 \u0645\u0650\u062b\u0652\u0644\u0650\u0647\u064e\u0627\u0653 \u06d7 \u0623\u064e\u0644\u064e\u0645\u0652 \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u0652 \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u064e\u0644\u064e\u0649\u0670 \u0643\u064f\u0644\u0651\u0650 \u0634\u064e\u0649\u0652\u0621\u064d\u06e2 \u0642\u064e\u062f\u0650\u064a\u0631\u064c", "num": 106}
{"line": "\u0623\u064e\u0644\u064e\u0645\u0652 \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u0652 \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0644\u064e\u0647\u064f\u06e5 \u0645\u064f\u0644\u0652\u0643\u064f \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0640\u0670\u0648\u064e\u0670\u062a\u0650 \u0648\u064e\u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u06d7 \u0648\u064e\u0645\u064e\u0627 \u0644\u064e\u0643\u064f\u0645 \u0645\u0651\u0650\u0646 \u062f\u064f\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0645\u0650\u0646 \u0648\u064e\u0644\u0650\u0649\u0651\u064d\u06e2 \u0648\u064e\u0644\u064e\u0627 \u0646\u064e\u0635\u0650\u064a\u0631\u064d", "num": 107}
{"line": "\u0623\u064e\u0645\u0652 \u062a\u064f\u0631\u0650\u064a\u062f\u064f\u0648\u0646\u064e \u0623\u064e\u0646 \u062a\u064e\u0633\u0652\u0640\u0654\u064e\u0644\u064f\u0648\u0627\u06df \u0631\u064e\u0633\u064f\u0648\u0644\u064e\u0643\u064f\u0645\u0652 \u0643\u064e\u0645\u064e\u0627 \u0633\u064f\u0626\u0650\u0644\u064e \u0645\u064f\u0648\u0633\u064e\u0649\u0670 \u0645\u0650\u0646 \u0642\u064e\u0628\u0652\u0644\u064f \u06d7 \u0648\u064e\u0645\u064e\u0646 \u064a\u064e\u062a\u064e\u0628\u064e\u062f\u0651\u064e\u0644\u0650 \u0671\u0644\u0652\u0643\u064f\u0641\u0652\u0631\u064e \u0628\u0650\u0671\u0644\u0652\u0625\u0650\u064a\u0645\u064e\u0640\u0670\u0646\u0650 \u0641\u064e\u0642\u064e\u062f\u0652 \u0636\u064e\u0644\u0651\u064e \u0633\u064e\u0648\u064e\u0627\u0653\u0621\u064e \u0671\u0644\u0633\u0651\u064e\u0628\u0650\u064a\u0644\u0650", "num": 108}
{"line": "\u0648\u064e\u062f\u0651\u064e \u0643\u064e\u062b\u0650\u064a\u0631\u064c\u06ed \u0645\u0651\u0650\u0646\u0652 \u0623\u064e\u0647\u0652\u0644\u0650 \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u0650 \u0644\u064e\u0648\u0652 \u064a\u064e\u0631\u064f\u062f\u0651\u064f\u0648\u0646\u064e\u0643\u064f\u0645 \u0645\u0651\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0625\u0650\u064a\u0645\u064e\u0640\u0670\u0646\u0650\u0643\u064f\u0645\u0652 \u0643\u064f\u0641\u0651\u064e\u0627\u0631\u064b\u0627 \u062d\u064e\u0633\u064e\u062f\u064b\u06ed\u0627 \u0645\u0651\u0650\u0646\u0652 \u0639\u0650\u0646\u062f\u0650 \u0623\u064e\u0646\u0641\u064f\u0633\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0645\u064e\u0627 \u062a\u064e\u0628\u064e\u064a\u0651\u064e\u0646\u064e \u0644\u064e\u0647\u064f\u0645\u064f \u0671\u0644\u0652\u062d\u064e\u0642\u0651\u064f \u06d6 \u0641\u064e\u0671\u0639\u0652\u0641\u064f\u0648\u0627\u06df \u0648\u064e\u0671\u0635\u0652\u0641\u064e\u062d\u064f\u0648\u0627\u06df \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u064a\u064e\u0623\u0652\u062a\u0650\u0649\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u0623\u064e\u0645\u0652\u0631\u0650\u0647\u0650\u06e6\u0653 \u06d7 \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u064e\u0644\u064e\u0649\u0670 \u0643\u064f\u0644\u0651\u0650 \u0634\u064e\u0649\u0652\u0621\u064d\u06e2 \u0642\u064e\u062f\u0650\u064a\u0631\u064c\u06ed", "num": 109}
{"line": "\u0648\u064e\u0623\u064e\u0642\u0650\u064a\u0645\u064f\u0648\u0627\u06df \u0671\u0644\u0635\u0651\u064e\u0644\u064e\u0648\u0670\u0629\u064e \u0648\u064e\u0621\u064e\u0627\u062a\u064f\u0648\u0627\u06df \u0671\u0644\u0632\u0651\u064e\u0643\u064e\u0648\u0670\u0629\u064e \u06da \u0648\u064e\u0645\u064e\u0627 \u062a\u064f\u0642\u064e\u062f\u0651\u0650\u0645\u064f\u0648\u0627\u06df \u0644\u0650\u0623\u064e\u0646\u0641\u064f\u0633\u0650\u0643\u064f\u0645 \u0645\u0651\u0650\u0646\u0652 \u062e\u064e\u064a\u0652\u0631\u064d\u06e2 \u062a\u064e\u062c\u0650\u062f\u064f\u0648\u0647\u064f \u0639\u0650\u0646\u062f\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d7 \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0628\u0650\u0645\u064e\u0627 \u062a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e \u0628\u064e\u0635\u0650\u064a\u0631\u064c\u06ed", "num": 110}
{"line": "\u0648\u064e\u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0644\u064e\u0646 \u064a\u064e\u062f\u0652\u062e\u064f\u0644\u064e \u0671\u0644\u0652\u062c\u064e\u0646\u0651\u064e\u0629\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0645\u064e\u0646 \u0643\u064e\u0627\u0646\u064e \u0647\u064f\u0648\u062f\u064b\u0627 \u0623\u064e\u0648\u0652 \u0646\u064e\u0635\u064e\u0640\u0670\u0631\u064e\u0649\u0670 \u06d7 \u062a\u0650\u0644\u0652\u0643\u064e \u0623\u064e\u0645\u064e\u0627\u0646\u0650\u064a\u0651\u064f\u0647\u064f\u0645\u0652 \u06d7 \u0642\u064f\u0644\u0652 \u0647\u064e\u0627\u062a\u064f\u0648\u0627\u06df \u0628\u064f\u0631\u0652\u0647\u064e\u0640\u0670\u0646\u064e\u0643\u064f\u0645\u0652 \u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u0635\u064e\u0640\u0670\u062f\u0650\u0642\u0650\u064a\u0646\u064e", "num": 111}
{"line": "\u0628\u064e\u0644\u064e\u0649\u0670 \u0645\u064e\u0646\u0652 \u0623\u064e\u0633\u0652\u0644\u064e\u0645\u064e \u0648\u064e\u062c\u0652\u0647\u064e\u0647\u064f\u06e5 \u0644\u0650\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0647\u064f\u0648\u064e \u0645\u064f\u062d\u0652\u0633\u0650\u0646\u064c\u06ed \u0641\u064e\u0644\u064e\u0647\u064f\u06e5\u0653 \u0623\u064e\u062c\u0652\u0631\u064f\u0647\u064f\u06e5 \u0639\u0650\u0646\u062f\u064e \u0631\u064e\u0628\u0651\u0650\u0647\u0650\u06e6 \u0648\u064e\u0644\u064e\u0627 \u062e\u064e\u0648\u0652\u0641\u064c \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u0647\u064f\u0645\u0652 \u064a\u064e\u062d\u0652\u0632\u064e\u0646\u064f\u0648\u0646\u064e", "num": 112}
{"line": "\u0648\u064e\u0642\u064e\u0627\u0644\u064e\u062a\u0650 \u0671\u0644\u0652\u064a\u064e\u0647\u064f\u0648\u062f\u064f \u0644\u064e\u064a\u0652\u0633\u064e\u062a\u0650 \u0671\u0644\u0646\u0651\u064e\u0635\u064e\u0640\u0670\u0631\u064e\u0649\u0670 \u0639\u064e\u0644\u064e\u0649\u0670 \u0634\u064e\u0649\u0652\u0621\u064d\u06e2 \u0648\u064e\u0642\u064e\u0627\u0644\u064e\u062a\u0650 \u0671\u0644\u0646\u0651\u064e\u0635\u064e\u0640\u0670\u0631\u064e\u0649\u0670 \u0644\u064e\u064a\u0652\u0633\u064e\u062a\u0650 \u0671\u0644\u0652\u064a\u064e\u0647\u064f\u0648\u062f\u064f \u0639\u064e\u0644\u064e\u0649\u0670 \u0634\u064e\u0649\u0652\u0621\u064d\u06e2 \u0648\u064e\u0647\u064f\u0645\u0652 \u064a\u064e\u062a\u0652\u0644\u064f\u0648\u0646\u064e \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u06d7 \u0643\u064e\u0630\u064e\u0670\u0644\u0650\u0643\u064e \u0642\u064e\u0627\u0644\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0644\u064e\u0627 \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e \u0645\u0650\u062b\u0652\u0644\u064e \u0642\u064e\u0648\u0652\u0644\u0650\u0647\u0650\u0645\u0652 \u06da \u0641\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064e\u062d\u0652\u0643\u064f\u0645\u064f \u0628\u064e\u064a\u0652\u0646\u064e\u0647\u064f\u0645\u0652 \u064a\u064e\u0648\u0652\u0645\u064e \u0671\u0644\u0652\u0642\u0650\u064a\u064e\u0640\u0670\u0645\u064e\u0629\u0650 \u0641\u0650\u064a\u0645\u064e\u0627 \u0643\u064e\u0627\u0646\u064f\u0648\u0627\u06df \u0641\u0650\u064a\u0647\u0650 \u064a\u064e\u062e\u0652\u062a\u064e\u0644\u0650\u0641\u064f\u0648\u0646\u064e", "num": 113}
{"line": "\u0648\u064e\u0645\u064e\u0646\u0652 \u0623\u064e\u0638\u0652\u0644\u064e\u0645\u064f \u0645\u0650\u0645\u0651\u064e\u0646 \u0645\u0651\u064e\u0646\u064e\u0639\u064e \u0645\u064e\u0633\u064e\u0640\u0670\u062c\u0650\u062f\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0623\u064e\u0646 \u064a\u064f\u0630\u0652\u0643\u064e\u0631\u064e \u0641\u0650\u064a\u0647\u064e\u0627 \u0671\u0633\u0652\u0645\u064f\u0647\u064f\u06e5 \u0648\u064e\u0633\u064e\u0639\u064e\u0649\u0670 \u0641\u0650\u0649 \u062e\u064e\u0631\u064e\u0627\u0628\u0650\u0647\u064e\u0627\u0653 \u06da \u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0645\u064e\u0627 \u0643\u064e\u0627\u0646\u064e \u0644\u064e\u0647\u064f\u0645\u0652 \u0623\u064e\u0646 \u064a\u064e\u062f\u0652\u062e\u064f\u0644\u064f\u0648\u0647\u064e\u0627\u0653 \u0625\u0650\u0644\u0651\u064e\u0627 \u062e\u064e\u0627\u0653\u0626\u0650\u0641\u0650\u064a\u0646\u064e \u06da \u0644\u064e\u0647\u064f\u0645\u0652 \u0641\u0650\u0649 \u0671\u0644\u062f\u0651\u064f\u0646\u0652\u064a\u064e\u0627 \u062e\u0650\u0632\u0652\u0649\u064c\u06ed \u0648\u064e\u0644\u064e\u0647\u064f\u0645\u0652 \u0641\u0650\u0649 \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u064e\u0629\u0650 \u0639\u064e\u0630\u064e\u0627\u0628\u064c \u0639\u064e\u0638\u0650\u064a\u0645\u064c\u06ed", "num": 114}
{"line": "\u0648\u064e\u0644\u0650\u0644\u0651\u064e\u0647\u0650 \u0671\u0644\u0652\u0645\u064e\u0634\u0652\u0631\u0650\u0642\u064f \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u063a\u0652\u0631\u0650\u0628\u064f \u06da \u0641\u064e\u0623\u064e\u064a\u0652\u0646\u064e\u0645\u064e\u0627 \u062a\u064f\u0648\u064e\u0644\u0651\u064f\u0648\u0627\u06df \u0641\u064e\u062b\u064e\u0645\u0651\u064e \u0648\u064e\u062c\u0652\u0647\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0648\u064e\u0670\u0633\u0650\u0639\u064c \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 115}
{"line": "\u0648\u064e\u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0671\u062a\u0651\u064e\u062e\u064e\u0630\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0648\u064e\u0644\u064e\u062f\u064b\u06ed\u0627 \u06d7 \u0633\u064f\u0628\u0652\u062d\u064e\u0640\u0670\u0646\u064e\u0647\u064f\u06e5 \u06d6 \u0628\u064e\u0644 \u0644\u0651\u064e\u0647\u064f\u06e5 \u0645\u064e\u0627 \u0641\u0650\u0649 \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0640\u0670\u0648\u064e\u0670\u062a\u0650 \u0648\u064e\u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u06d6 \u0643\u064f\u0644\u0651\u064c\u06ed \u0644\u0651\u064e\u0647\u064f\u06e5 \u0642\u064e\u0640\u0670\u0646\u0650\u062a\u064f\u0648\u0646\u064e", "num": 116}
{"line": "\u0628\u064e\u062f\u0650\u064a\u0639\u064f \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0640\u0670\u0648\u064e\u0670\u062a\u0650 \u0648\u064e\u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u06d6 \u0648\u064e\u0625\u0650\u0630\u064e\u0627 \u0642\u064e\u0636\u064e\u0649\u0670\u0653 \u0623\u064e\u0645\u0652\u0631\u064b\u06ed\u0627 \u0641\u064e\u0625\u0650\u0646\u0651\u064e\u0645\u064e\u0627 \u064a\u064e\u0642\u064f\u0648\u0644\u064f \u0644\u064e\u0647\u064f\u06e5 \u0643\u064f\u0646 \u0641\u064e\u064a\u064e\u0643\u064f\u0648\u0646\u064f", "num": 117}
{"line": "\u0648\u064e\u0642\u064e\u0627\u0644\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0644\u064e\u0627 \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e \u0644\u064e\u0648\u0652\u0644\u064e\u0627 \u064a\u064f\u0643\u064e\u0644\u0651\u0650\u0645\u064f\u0646\u064e\u0627 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0623\u064e\u0648\u0652 \u062a\u064e\u0623\u0652\u062a\u0650\u064a\u0646\u064e\u0627\u0653 \u0621\u064e\u0627\u064a\u064e\u0629\u064c\u06ed \u06d7 \u0643\u064e\u0630\u064e\u0670\u0644\u0650\u0643\u064e \u0642\u064e\u0627\u0644\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0645\u0650\u0646 \u0642\u064e\u0628\u0652\u0644\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u062b\u0652\u0644\u064e \u0642\u064e\u0648\u0652\u0644\u0650\u0647\u0650\u0645\u0652 \u06d8 \u062a\u064e\u0634\u064e\u0640\u0670\u0628\u064e\u0647\u064e\u062a\u0652 \u0642\u064f\u0644\u064f\u0648\u0628\u064f\u0647\u064f\u0645\u0652 \u06d7 \u0642\u064e\u062f\u0652 \u0628\u064e\u064a\u0651\u064e\u0646\u0651\u064e\u0627 \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u0650 \u0644\u0650\u0642\u064e\u0648\u0652\u0645\u064d\u06e2 \u064a\u064f\u0648\u0642\u0650\u0646\u064f\u0648\u0646\u064e", "num": 118}
{"line": "\u0625\u0650\u0646\u0651\u064e\u0627\u0653 \u0623\u064e\u0631\u0652\u0633\u064e\u0644\u0652\u0646\u064e\u0640\u0670\u0643\u064e \u0628\u0650\u0671\u0644\u0652\u062d\u064e\u0642\u0651\u0650 \u0628\u064e\u0634\u0650\u064a\u0631\u064b\u06ed\u0627 \u0648\u064e\u0646\u064e\u0630\u0650\u064a\u0631\u064b\u06ed\u0627 \u06d6 \u0648\u064e\u0644\u064e\u0627 \u062a\u064f\u0633\u0652\u0640\u0654\u064e\u0644\u064f \u0639\u064e\u0646\u0652 \u0623\u064e\u0635\u0652\u062d\u064e\u0640\u0670\u0628\u0650 \u0671\u0644\u0652\u062c\u064e\u062d\u0650\u064a\u0645\u0650", "num": 119}
{"line": "\u0648\u064e\u0644\u064e\u0646 \u062a\u064e\u0631\u0652\u0636\u064e\u0649\u0670 \u0639\u064e\u0646\u0643\u064e \u0671\u0644\u0652\u064a\u064e\u0647\u064f\u0648\u062f\u064f \u0648\u064e\u0644\u064e\u0627 \u0671\u0644\u0646\u0651\u064e\u0635\u064e\u0640\u0670\u0631\u064e\u0649\u0670 \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u062a\u064e\u062a\u0651\u064e\u0628\u0650\u0639\u064e \u0645\u0650\u0644\u0651\u064e\u062a\u064e\u0647\u064f\u0645\u0652 \u06d7 \u0642\u064f\u0644\u0652 \u0625\u0650\u0646\u0651\u064e \u0647\u064f\u062f\u064e\u0649 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0647\u064f\u0648\u064e \u0671\u0644\u0652\u0647\u064f\u062f\u064e\u0649\u0670 \u06d7 \u0648\u064e\u0644\u064e\u0626\u0650\u0646\u0650 \u0671\u062a\u0651\u064e\u0628\u064e\u0639\u0652\u062a\u064e \u0623\u064e\u0647\u0652\u0648\u064e\u0627\u0653\u0621\u064e\u0647\u064f\u0645 \u0628\u064e\u0639\u0652\u062f\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u062c\u064e\u0627\u0653\u0621\u064e\u0643\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0639\u0650\u0644\u0652\u0645\u0650 \u06d9 \u0645\u064e\u0627 \u0644\u064e\u0643\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0645\u0650\u0646 \u0648\u064e\u0644\u0650\u0649\u0651\u064d\u06e2 \u0648\u064e\u0644\u064e\u0627 \u0646\u064e\u0635\u0650\u064a\u0631\u064d", "num": 120}
{"line": "\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u062a\u064e\u064a\u0652\u0646\u064e\u0640\u0670\u0647\u064f\u0645\u064f \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u064a\u064e\u062a\u0652\u0644\u064f\u0648\u0646\u064e\u0647\u064f\u06e5 \u062d\u064e\u0642\u0651\u064e \u062a\u0650\u0644\u064e\u0627\u0648\u064e\u062a\u0650\u0647\u0650\u06e6\u0653 \u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u064a\u064f\u0624\u0652\u0645\u0650\u0646\u064f\u0648\u0646\u064e \u0628\u0650\u0647\u0650\u06e6 \u06d7 \u0648\u064e\u0645\u064e\u0646 \u064a\u064e\u0643\u0652\u0641\u064f\u0631\u0652 \u0628\u0650\u0647\u0650\u06e6 \u0641\u064e\u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0647\u064f\u0645\u064f \u0671\u0644\u0652\u062e\u064e\u0640\u0670\u0633\u0650\u0631\u064f\u0648\u0646\u064e", "num": 121}
{"line": "\u064a\u064e\u0640\u0670\u0628\u064e\u0646\u0650\u0649\u0653 \u0625\u0650\u0633\u0652\u0631\u064e\u0670\u0653\u0621\u0650\u064a\u0644\u064e \u0671\u0630\u0652\u0643\u064f\u0631\u064f\u0648\u0627\u06df \u0646\u0650\u0639\u0652\u0645\u064e\u062a\u0650\u0649\u064e \u0671\u0644\u0651\u064e\u062a\u0650\u0649\u0653 \u0623\u064e\u0646\u0652\u0639\u064e\u0645\u0652\u062a\u064f \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0648\u064e\u0623\u064e\u0646\u0651\u0650\u0649 \u0641\u064e\u0636\u0651\u064e\u0644\u0652\u062a\u064f\u0643\u064f\u0645\u0652 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0639\u064e\u0640\u0670\u0644\u064e\u0645\u0650\u064a\u0646\u064e", "num": 122}
{"line": "\u0648\u064e\u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u064a\u064e\u0648\u0652\u0645\u064b\u06ed\u0627 \u0644\u0651\u064e\u0627 \u062a\u064e\u062c\u0652\u0632\u0650\u0649 \u0646\u064e\u0641\u0652\u0633\u064c \u0639\u064e\u0646 \u0646\u0651\u064e\u0641\u0652\u0633\u064d\u06e2 \u0634\u064e\u064a\u0652\u0640\u0654\u064b\u06ed\u0627 \u0648\u064e\u0644\u064e\u0627 \u064a\u064f\u0642\u0652\u0628\u064e\u0644\u064f \u0645\u0650\u0646\u0652\u0647\u064e\u0627 \u0639\u064e\u062f\u0652\u0644\u064c\u06ed \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0646\u0641\u064e\u0639\u064f\u0647\u064e\u0627 \u0634\u064e\u0641\u064e\u0640\u0670\u0639\u064e\u0629\u064c\u06ed \u0648\u064e\u0644\u064e\u0627 \u0647\u064f\u0645\u0652 \u064a\u064f\u0646\u0635\u064e\u0631\u064f\u0648\u0646\u064e", "num": 123}
{"line": "\u06de \u0648\u064e\u0625\u0650\u0630\u0650 \u0671\u0628\u0652\u062a\u064e\u0644\u064e\u0649\u0670\u0653 \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064e \u0631\u064e\u0628\u0651\u064f\u0647\u064f\u06e5 \u0628\u0650\u0643\u064e\u0644\u0650\u0645\u064e\u0640\u0670\u062a\u064d\u06e2 \u0641\u064e\u0623\u064e\u062a\u064e\u0645\u0651\u064e\u0647\u064f\u0646\u0651\u064e \u06d6 \u0642\u064e\u0627\u0644\u064e \u0625\u0650\u0646\u0651\u0650\u0649 \u062c\u064e\u0627\u0639\u0650\u0644\u064f\u0643\u064e \u0644\u0650\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0625\u0650\u0645\u064e\u0627\u0645\u064b\u06ed\u0627 \u06d6 \u0642\u064e\u0627\u0644\u064e \u0648\u064e\u0645\u0650\u0646 \u0630\u064f\u0631\u0651\u0650\u064a\u0651\u064e\u062a\u0650\u0649 \u06d6 \u0642\u064e\u0627\u0644\u064e \u0644\u064e\u0627 \u064a\u064e\u0646\u064e\u0627\u0644\u064f \u0639\u064e\u0647\u0652\u062f\u0650\u0649 \u0671\u0644\u0638\u0651\u064e\u0640\u0670\u0644\u0650\u0645\u0650\u064a\u0646\u064e", "num": 124}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u062c\u064e\u0639\u064e\u0644\u0652\u0646\u064e\u0627 \u0671\u0644\u0652\u0628\u064e\u064a\u0652\u062a\u064e \u0645\u064e\u062b\u064e\u0627\u0628\u064e\u0629\u064b\u06ed \u0644\u0651\u0650\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0648\u064e\u0623\u064e\u0645\u0652\u0646\u064b\u06ed\u0627 \u0648\u064e\u0671\u062a\u0651\u064e\u062e\u0650\u0630\u064f\u0648\u0627\u06df \u0645\u0650\u0646 \u0645\u0651\u064e\u0642\u064e\u0627\u0645\u0650 \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064e \u0645\u064f\u0635\u064e\u0644\u0651\u064b\u06ed\u0649 \u06d6 \u0648\u064e\u0639\u064e\u0647\u0650\u062f\u0652\u0646\u064e\u0627\u0653 \u0625\u0650\u0644\u064e\u0649\u0670\u0653 \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064e \u0648\u064e\u0625\u0650\u0633\u0652\u0645\u064e\u0640\u0670\u0639\u0650\u064a\u0644\u064e \u0623\u064e\u0646 \u0637\u064e\u0647\u0651\u0650\u0631\u064e\u0627 \u0628\u064e\u064a\u0652\u062a\u0650\u0649\u064e \u0644\u0650\u0644\u0637\u0651\u064e\u0627\u0653\u0626\u0650\u0641\u0650\u064a\u0646\u064e \u0648\u064e\u0671\u0644\u0652\u0639\u064e\u0640\u0670\u0643\u0650\u0641\u0650\u064a\u0646\u064e \u0648\u064e\u0671\u0644\u0631\u0651\u064f\u0643\u0651\u064e\u0639\u0650 \u0671\u0644\u0633\u0651\u064f\u062c\u064f\u0648\u062f\u0650", "num": 125}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u0642\u064e\u0627\u0644\u064e \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064f \u0631\u064e\u0628\u0651\u0650 \u0671\u062c\u0652\u0639\u064e\u0644\u0652 \u0647\u064e\u0640\u0670\u0630\u064e\u0627 \u0628\u064e\u0644\u064e\u062f\u064b\u0627 \u0621\u064e\u0627\u0645\u0650\u0646\u064b\u06ed\u0627 \u0648\u064e\u0671\u0631\u0652\u0632\u064f\u0642\u0652 \u0623\u064e\u0647\u0652\u0644\u064e\u0647\u064f\u06e5 \u0645\u0650\u0646\u064e \u0671\u0644\u062b\u0651\u064e\u0645\u064e\u0631\u064e\u0670\u062a\u0650 \u0645\u064e\u0646\u0652 \u0621\u064e\u0627\u0645\u064e\u0646\u064e \u0645\u0650\u0646\u0652\u0647\u064f\u0645 \u0628\u0650\u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0671\u0644\u0652\u064a\u064e\u0648\u0652\u0645\u0650 \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u0650 \u06d6 \u0642\u064e\u0627\u0644\u064e \u0648\u064e\u0645\u064e\u0646 \u0643\u064e\u0641\u064e\u0631\u064e \u0641\u064e\u0623\u064f\u0645\u064e\u062a\u0651\u0650\u0639\u064f\u0647\u064f\u06e5 \u0642\u064e\u0644\u0650\u064a\u0644\u064b\u06ed\u0627 \u062b\u064f\u0645\u0651\u064e \u0623\u064e\u0636\u0652\u0637\u064e\u0631\u0651\u064f\u0647\u064f\u06e5\u0653 \u0625\u0650\u0644\u064e\u0649\u0670 \u0639\u064e\u0630\u064e\u0627\u0628\u0650 \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u0650 \u06d6 \u0648\u064e\u0628\u0650\u0626\u0652\u0633\u064e \u0671\u0644\u0652\u0645\u064e\u0635\u0650\u064a\u0631\u064f", "num": 126}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u064a\u064e\u0631\u0652\u0641\u064e\u0639\u064f \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064f \u0671\u0644\u0652\u0642\u064e\u0648\u064e\u0627\u0639\u0650\u062f\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0628\u064e\u064a\u0652\u062a\u0650 \u0648\u064e\u0625\u0650\u0633\u0652\u0645\u064e\u0640\u0670\u0639\u0650\u064a\u0644\u064f \u0631\u064e\u0628\u0651\u064e\u0646\u064e\u0627 \u062a\u064e\u0642\u064e\u0628\u0651\u064e\u0644\u0652 \u0645\u0650\u0646\u0651\u064e\u0627\u0653 \u06d6 \u0625\u0650\u0646\u0651\u064e\u0643\u064e \u0623\u064e\u0646\u062a\u064e \u0671\u0644\u0633\u0651\u064e\u0645\u0650\u064a\u0639\u064f \u0671\u0644\u0652\u0639\u064e\u0644\u0650\u064a\u0645\u064f", "num": 127}
{"line": "\u0631\u064e\u0628\u0651\u064e\u0646\u064e\u0627 \u0648\u064e\u0671\u062c\u0652\u0639\u064e\u0644\u0652\u0646\u064e\u0627 \u0645\u064f\u0633\u0652\u0644\u0650\u0645\u064e\u064a\u0652\u0646\u0650 \u0644\u064e\u0643\u064e \u0648\u064e\u0645\u0650\u0646 \u0630\u064f\u0631\u0651\u0650\u064a\u0651\u064e\u062a\u0650\u0646\u064e\u0627\u0653 \u0623\u064f\u0645\u0651\u064e\u0629\u064b\u06ed \u0645\u0651\u064f\u0633\u0652\u0644\u0650\u0645\u064e\u0629\u064b\u06ed \u0644\u0651\u064e\u0643\u064e \u0648\u064e\u0623\u064e\u0631\u0650\u0646\u064e\u0627 \u0645\u064e\u0646\u064e\u0627\u0633\u0650\u0643\u064e\u0646\u064e\u0627 \u0648\u064e\u062a\u064f\u0628\u0652 \u0639\u064e\u0644\u064e\u064a\u0652\u0646\u064e\u0627\u0653 \u06d6 \u0625\u0650\u0646\u0651\u064e\u0643\u064e \u0623\u064e\u0646\u062a\u064e \u0671\u0644\u062a\u0651\u064e\u0648\u0651\u064e\u0627\u0628\u064f \u0671\u0644\u0631\u0651\u064e\u062d\u0650\u064a\u0645\u064f", "num": 128}
{"line": "\u0631\u064e\u0628\u0651\u064e\u0646\u064e\u0627 \u0648\u064e\u0671\u0628\u0652\u0639\u064e\u062b\u0652 \u0641\u0650\u064a\u0647\u0650\u0645\u0652 \u0631\u064e\u0633\u064f\u0648\u0644\u064b\u06ed\u0627 \u0645\u0651\u0650\u0646\u0652\u0647\u064f\u0645\u0652 \u064a\u064e\u062a\u0652\u0644\u064f\u0648\u0627\u06df \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u0621\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u0650\u0643\u064e \u0648\u064e\u064a\u064f\u0639\u064e\u0644\u0651\u0650\u0645\u064f\u0647\u064f\u0645\u064f \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u0648\u064e\u0671\u0644\u0652\u062d\u0650\u0643\u0652\u0645\u064e\u0629\u064e \u0648\u064e\u064a\u064f\u0632\u064e\u0643\u0651\u0650\u064a\u0647\u0650\u0645\u0652 \u06da \u0625\u0650\u0646\u0651\u064e\u0643\u064e \u0623\u064e\u0646\u062a\u064e \u0671\u0644\u0652\u0639\u064e\u0632\u0650\u064a\u0632\u064f \u0671\u0644\u0652\u062d\u064e\u0643\u0650\u064a\u0645\u064f", "num": 129}
{"line": "\u0648\u064e\u0645\u064e\u0646 \u064a\u064e\u0631\u0652\u063a\u064e\u0628\u064f \u0639\u064e\u0646 \u0645\u0651\u0650\u0644\u0651\u064e\u0629\u0650 \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0645\u064e\u0646 \u0633\u064e\u0641\u0650\u0647\u064e \u0646\u064e\u0641\u0652\u0633\u064e\u0647\u064f\u06e5 \u06da \u0648\u064e\u0644\u064e\u0642\u064e\u062f\u0650 \u0671\u0635\u0652\u0637\u064e\u0641\u064e\u064a\u0652\u0646\u064e\u0640\u0670\u0647\u064f \u0641\u0650\u0649 \u0671\u0644\u062f\u0651\u064f\u0646\u0652\u064a\u064e\u0627 \u06d6 \u0648\u064e\u0625\u0650\u0646\u0651\u064e\u0647\u064f\u06e5 \u0641\u0650\u0649 \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u064e\u0629\u0650 \u0644\u064e\u0645\u0650\u0646\u064e \u0671\u0644\u0635\u0651\u064e\u0640\u0670\u0644\u0650\u062d\u0650\u064a\u0646\u064e", "num": 130}
{"line": "\u0625\u0650\u0630\u0652 \u0642\u064e\u0627\u0644\u064e \u0644\u064e\u0647\u064f\u06e5 \u0631\u064e\u0628\u0651\u064f\u0647\u064f\u06e5\u0653 \u0623\u064e\u0633\u0652\u0644\u0650\u0645\u0652 \u06d6 \u0642\u064e\u0627\u0644\u064e \u0623\u064e\u0633\u0652\u0644\u064e\u0645\u0652\u062a\u064f \u0644\u0650\u0631\u064e\u0628\u0651\u0650 \u0671\u0644\u0652\u0639\u064e\u0640\u0670\u0644\u064e\u0645\u0650\u064a\u0646\u064e", "num": 131}
{"line": "\u0648\u064e\u0648\u064e\u0635\u0651\u064e\u0649\u0670 \u0628\u0650\u0647\u064e\u0627\u0653 \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064f \u0628\u064e\u0646\u0650\u064a\u0647\u0650 \u0648\u064e\u064a\u064e\u0639\u0652\u0642\u064f\u0648\u0628\u064f \u064a\u064e\u0640\u0670\u0628\u064e\u0646\u0650\u0649\u0651\u064e \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0671\u0635\u0652\u0637\u064e\u0641\u064e\u0649\u0670 \u0644\u064e\u0643\u064f\u0645\u064f \u0671\u0644\u062f\u0651\u0650\u064a\u0646\u064e \u0641\u064e\u0644\u064e\u0627 \u062a\u064e\u0645\u064f\u0648\u062a\u064f\u0646\u0651\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0648\u064e\u0623\u064e\u0646\u062a\u064f\u0645 \u0645\u0651\u064f\u0633\u0652\u0644\u0650\u0645\u064f\u0648\u0646\u064e", "num": 132}
{"line": "\u0623\u064e\u0645\u0652 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u0634\u064f\u0647\u064e\u062f\u064e\u0627\u0653\u0621\u064e \u0625\u0650\u0630\u0652 \u062d\u064e\u0636\u064e\u0631\u064e \u064a\u064e\u0639\u0652\u0642\u064f\u0648\u0628\u064e \u0671\u0644\u0652\u0645\u064e\u0648\u0652\u062a\u064f \u0625\u0650\u0630\u0652 \u0642\u064e\u0627\u0644\u064e \u0644\u0650\u0628\u064e\u0646\u0650\u064a\u0647\u0650 \u0645\u064e\u0627 \u062a\u064e\u0639\u0652\u0628\u064f\u062f\u064f\u0648\u0646\u064e \u0645\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650\u0649 \u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0646\u064e\u0639\u0652\u0628\u064f\u062f\u064f \u0625\u0650\u0644\u064e\u0640\u0670\u0647\u064e\u0643\u064e \u0648\u064e\u0625\u0650\u0644\u064e\u0640\u0670\u0647\u064e \u0621\u064e\u0627\u0628\u064e\u0627\u0653\u0626\u0650\u0643\u064e \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064e \u0648\u064e\u0625\u0650\u0633\u0652\u0645\u064e\u0640\u0670\u0639\u0650\u064a\u0644\u064e \u0648\u064e\u0625\u0650\u0633\u0652\u062d\u064e\u0640\u0670\u0642\u064e \u0625\u0650\u0644\u064e\u0640\u0670\u0647\u064b\u06ed\u0627 \u0648\u064e\u0670\u062d\u0650\u062f\u064b\u06ed\u0627 \u0648\u064e\u0646\u064e\u062d\u0652\u0646\u064f \u0644\u064e\u0647\u064f\u06e5 \u0645\u064f\u0633\u0652\u0644\u0650\u0645\u064f\u0648\u0646\u064e", "num": 133}
{"line": "\u062a\u0650\u0644\u0652\u0643\u064e \u0623\u064f\u0645\u0651\u064e\u0629\u064c\u06ed \u0642\u064e\u062f\u0652 \u062e\u064e\u0644\u064e\u062a\u0652 \u06d6 \u0644\u064e\u0647\u064e\u0627 \u0645\u064e\u0627 \u0643\u064e\u0633\u064e\u0628\u064e\u062a\u0652 \u0648\u064e\u0644\u064e\u0643\u064f\u0645 \u0645\u0651\u064e\u0627 \u0643\u064e\u0633\u064e\u0628\u0652\u062a\u064f\u0645\u0652 \u06d6 \u0648\u064e\u0644\u064e\u0627 \u062a\u064f\u0633\u0652\u0640\u0654\u064e\u0644\u064f\u0648\u0646\u064e \u0639\u064e\u0645\u0651\u064e\u0627 \u0643\u064e\u0627\u0646\u064f\u0648\u0627\u06df \u064a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e", "num": 134}
{"line": "\u0648\u064e\u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0643\u064f\u0648\u0646\u064f\u0648\u0627\u06df \u0647\u064f\u0648\u062f\u064b\u0627 \u0623\u064e\u0648\u0652 \u0646\u064e\u0635\u064e\u0640\u0670\u0631\u064e\u0649\u0670 \u062a\u064e\u0647\u0652\u062a\u064e\u062f\u064f\u0648\u0627\u06df \u06d7 \u0642\u064f\u0644\u0652 \u0628\u064e\u0644\u0652 \u0645\u0650\u0644\u0651\u064e\u0629\u064e \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064e \u062d\u064e\u0646\u0650\u064a\u0641\u064b\u06ed\u0627 \u06d6 \u0648\u064e\u0645\u064e\u0627 \u0643\u064e\u0627\u0646\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0645\u064f\u0634\u0652\u0631\u0650\u0643\u0650\u064a\u0646\u064e", "num": 135}
{"line": "\u0642\u064f\u0648\u0644\u064f\u0648\u0653\u0627\u06df \u0621\u064e\u0627\u0645\u064e\u0646\u0651\u064e\u0627 \u0628\u0650\u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0645\u064e\u0627\u0653 \u0623\u064f\u0646\u0632\u0650\u0644\u064e \u0625\u0650\u0644\u064e\u064a\u0652\u0646\u064e\u0627 \u0648\u064e\u0645\u064e\u0627\u0653 \u0623\u064f\u0646\u0632\u0650\u0644\u064e \u0625\u0650\u0644\u064e\u0649\u0670\u0653 \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064e \u0648\u064e\u0625\u0650\u0633\u0652\u0645\u064e\u0640\u0670\u0639\u0650\u064a\u0644\u064e \u0648\u064e\u0625\u0650\u0633\u0652\u062d\u064e\u0640\u0670\u0642\u064e \u0648\u064e\u064a\u064e\u0639\u0652\u0642\u064f\u0648\u0628\u064e \u0648\u064e\u0671\u0644\u0652\u0623\u064e\u0633\u0652\u0628\u064e\u0627\u0637\u0650 \u0648\u064e\u0645\u064e\u0627\u0653 \u0623\u064f\u0648\u062a\u0650\u0649\u064e \u0645\u064f\u0648\u0633\u064e\u0649\u0670 \u0648\u064e\u0639\u0650\u064a\u0633\u064e\u0649\u0670 \u0648\u064e\u0645\u064e\u0627\u0653 \u0623\u064f\u0648\u062a\u0650\u0649\u064e \u0671\u0644\u0646\u0651\u064e\u0628\u0650\u064a\u0651\u064f\u0648\u0646\u064e \u0645\u0650\u0646 \u0631\u0651\u064e\u0628\u0651\u0650\u0647\u0650\u0645\u0652 \u0644\u064e\u0627 \u0646\u064f\u0641\u064e\u0631\u0651\u0650\u0642\u064f \u0628\u064e\u064a\u0652\u0646\u064e \u0623\u064e\u062d\u064e\u062f\u064d\u06e2 \u0645\u0651\u0650\u0646\u0652\u0647\u064f\u0645\u0652 \u0648\u064e\u0646\u064e\u062d\u0652\u0646\u064f \u0644\u064e\u0647\u064f\u06e5 \u0645\u064f\u0633\u0652\u0644\u0650\u0645\u064f\u0648\u0646\u064e", "num": 136}
{"line": "\u0641\u064e\u0625\u0650\u0646\u0652 \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0628\u0650\u0645\u0650\u062b\u0652\u0644\u0650 \u0645\u064e\u0627\u0653 \u0621\u064e\u0627\u0645\u064e\u0646\u062a\u064f\u0645 \u0628\u0650\u0647\u0650\u06e6 \u0641\u064e\u0642\u064e\u062f\u0650 \u0671\u0647\u0652\u062a\u064e\u062f\u064e\u0648\u0627\u06df \u06d6 \u0648\u0651\u064e\u0625\u0650\u0646 \u062a\u064e\u0648\u064e\u0644\u0651\u064e\u0648\u0652\u0627\u06df \u0641\u064e\u0625\u0650\u0646\u0651\u064e\u0645\u064e\u0627 \u0647\u064f\u0645\u0652 \u0641\u0650\u0649 \u0634\u0650\u0642\u064e\u0627\u0642\u064d\u06e2 \u06d6 \u0641\u064e\u0633\u064e\u064a\u064e\u0643\u0652\u0641\u0650\u064a\u0643\u064e\u0647\u064f\u0645\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u06da \u0648\u064e\u0647\u064f\u0648\u064e \u0671\u0644\u0633\u0651\u064e\u0645\u0650\u064a\u0639\u064f \u0671\u0644\u0652\u0639\u064e\u0644\u0650\u064a\u0645\u064f", "num": 137}
{"line": "\u0635\u0650\u0628\u0652\u063a\u064e\u0629\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d6 \u0648\u064e\u0645\u064e\u0646\u0652 \u0623\u064e\u062d\u0652\u0633\u064e\u0646\u064f \u0645\u0650\u0646\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0635\u0650\u0628\u0652\u063a\u064e\u0629\u064b\u06ed \u06d6 \u0648\u064e\u0646\u064e\u062d\u0652\u0646\u064f \u0644\u064e\u0647\u064f\u06e5 \u0639\u064e\u0640\u0670\u0628\u0650\u062f\u064f\u0648\u0646\u064e", "num": 138}
{"line": "\u0642\u064f\u0644\u0652 \u0623\u064e\u062a\u064f\u062d\u064e\u0627\u0653\u062c\u0651\u064f\u0648\u0646\u064e\u0646\u064e\u0627 \u0641\u0650\u0649 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0647\u064f\u0648\u064e \u0631\u064e\u0628\u0651\u064f\u0646\u064e\u0627 \u0648\u064e\u0631\u064e\u0628\u0651\u064f\u0643\u064f\u0645\u0652 \u0648\u064e\u0644\u064e\u0646\u064e\u0627\u0653 \u0623\u064e\u0639\u0652\u0645\u064e\u0640\u0670\u0644\u064f\u0646\u064e\u0627 \u0648\u064e\u0644\u064e\u0643\u064f\u0645\u0652 \u0623\u064e\u0639\u0652\u0645\u064e\u0640\u0670\u0644\u064f\u0643\u064f\u0645\u0652 \u0648\u064e\u0646\u064e\u062d\u0652\u0646\u064f \u0644\u064e\u0647\u064f\u06e5 \u0645\u064f\u062e\u0652\u0644\u0650\u0635\u064f\u0648\u0646\u064e", "num": 139}
{"line": "\u0623\u064e\u0645\u0652 \u062a\u064e\u0642\u064f\u0648\u0644\u064f\u0648\u0646\u064e \u0625\u0650\u0646\u0651\u064e \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064e \u0648\u064e\u0625\u0650\u0633\u0652\u0645\u064e\u0640\u0670\u0639\u0650\u064a\u0644\u064e \u0648\u064e\u0625\u0650\u0633\u0652\u062d\u064e\u0640\u0670\u0642\u064e \u0648\u064e\u064a\u064e\u0639\u0652\u0642\u064f\u0648\u0628\u064e \u0648\u064e\u0671\u0644\u0652\u0623\u064e\u0633\u0652\u0628\u064e\u0627\u0637\u064e \u0643\u064e\u0627\u0646\u064f\u0648\u0627\u06df \u0647\u064f\u0648\u062f\u064b\u0627 \u0623\u064e\u0648\u0652 \u0646\u064e\u0635\u064e\u0640\u0670\u0631\u064e\u0649\u0670 \u06d7 \u0642\u064f\u0644\u0652 \u0621\u064e\u0623\u064e\u0646\u062a\u064f\u0645\u0652 \u0623\u064e\u0639\u0652\u0644\u064e\u0645\u064f \u0623\u064e\u0645\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u06d7 \u0648\u064e\u0645\u064e\u0646\u0652 \u0623\u064e\u0638\u0652\u0644\u064e\u0645\u064f \u0645\u0650\u0645\u0651\u064e\u0646 \u0643\u064e\u062a\u064e\u0645\u064e \u0634\u064e\u0647\u064e\u0640\u0670\u062f\u064e\u0629\u064b \u0639\u0650\u0646\u062f\u064e\u0647\u064f\u06e5 \u0645\u0650\u0646\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d7 \u0648\u064e\u0645\u064e\u0627 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u063a\u064e\u0640\u0670\u0641\u0650\u0644\u064d \u0639\u064e\u0645\u0651\u064e\u0627 \u062a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e", "num": 140}
{"line": "\u062a\u0650\u0644\u0652\u0643\u064e \u0623\u064f\u0645\u0651\u064e\u0629\u064c\u06ed \u0642\u064e\u062f\u0652 \u062e\u064e\u0644\u064e\u062a\u0652 \u06d6 \u0644\u064e\u0647\u064e\u0627 \u0645\u064e\u0627 \u0643\u064e\u0633\u064e\u0628\u064e\u062a\u0652 \u0648\u064e\u0644\u064e\u0643\u064f\u0645 \u0645\u0651\u064e\u0627 \u0643\u064e\u0633\u064e\u0628\u0652\u062a\u064f\u0645\u0652 \u06d6 \u0648\u064e\u0644\u064e\u0627 \u062a\u064f\u0633\u0652\u0640\u0654\u064e\u0644\u064f\u0648\u0646\u064e \u0639\u064e\u0645\u0651\u064e\u0627 \u0643\u064e\u0627\u0646\u064f\u0648\u0627\u06df \u064a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e", "num": 141}
{"line": "\u06de \u0633\u064e\u064a\u064e\u0642\u064f\u0648\u0644\u064f \u0671\u0644\u0633\u0651\u064f\u0641\u064e\u0647\u064e\u0627\u0653\u0621\u064f \u0645\u0650\u0646\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0645\u064e\u0627 \u0648\u064e\u0644\u0651\u064e\u0649\u0670\u0647\u064f\u0645\u0652 \u0639\u064e\u0646 \u0642\u0650\u0628\u0652\u0644\u064e\u062a\u0650\u0647\u0650\u0645\u064f \u0671\u0644\u0651\u064e\u062a\u0650\u0649 \u0643\u064e\u0627\u0646\u064f\u0648\u0627\u06df \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u064e\u0627 \u06da \u0642\u064f\u0644 \u0644\u0651\u0650\u0644\u0651\u064e\u0647\u0650 \u0671\u0644\u0652\u0645\u064e\u0634\u0652\u0631\u0650\u0642\u064f \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u063a\u0652\u0631\u0650\u0628\u064f \u06da \u064a\u064e\u0647\u0652\u062f\u0650\u0649 \u0645\u064e\u0646 \u064a\u064e\u0634\u064e\u0627\u0653\u0621\u064f \u0625\u0650\u0644\u064e\u0649\u0670 \u0635\u0650\u0631\u064e\u0670\u0637\u064d\u06e2 \u0645\u0651\u064f\u0633\u0652\u062a\u064e\u0642\u0650\u064a\u0645\u064d\u06e2", "num": 142}
{"line": "\u0648\u064e\u0643\u064e\u0630\u064e\u0670\u0644\u0650\u0643\u064e \u062c\u064e\u0639\u064e\u0644\u0652\u0646\u064e\u0640\u0670\u0643\u064f\u0645\u0652 \u0623\u064f\u0645\u0651\u064e\u0629\u064b\u06ed \u0648\u064e\u0633\u064e\u0637\u064b\u06ed\u0627 \u0644\u0651\u0650\u062a\u064e\u0643\u064f\u0648\u0646\u064f\u0648\u0627\u06df \u0634\u064f\u0647\u064e\u062f\u064e\u0627\u0653\u0621\u064e \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0648\u064e\u064a\u064e\u0643\u064f\u0648\u0646\u064e \u0671\u0644\u0631\u0651\u064e\u0633\u064f\u0648\u0644\u064f \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0634\u064e\u0647\u0650\u064a\u062f\u064b\u06ed\u0627 \u06d7 \u0648\u064e\u0645\u064e\u0627 \u062c\u064e\u0639\u064e\u0644\u0652\u0646\u064e\u0627 \u0671\u0644\u0652\u0642\u0650\u0628\u0652\u0644\u064e\u0629\u064e \u0671\u0644\u0651\u064e\u062a\u0650\u0649 \u0643\u064f\u0646\u062a\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u064e\u0627\u0653 \u0625\u0650\u0644\u0651\u064e\u0627 \u0644\u0650\u0646\u064e\u0639\u0652\u0644\u064e\u0645\u064e \u0645\u064e\u0646 \u064a\u064e\u062a\u0651\u064e\u0628\u0650\u0639\u064f \u0671\u0644\u0631\u0651\u064e\u0633\u064f\u0648\u0644\u064e \u0645\u0650\u0645\u0651\u064e\u0646 \u064a\u064e\u0646\u0642\u064e\u0644\u0650\u0628\u064f \u0639\u064e\u0644\u064e\u0649\u0670 \u0639\u064e\u0642\u0650\u0628\u064e\u064a\u0652\u0647\u0650 \u06da \u0648\u064e\u0625\u0650\u0646 \u0643\u064e\u0627\u0646\u064e\u062a\u0652 \u0644\u064e\u0643\u064e\u0628\u0650\u064a\u0631\u064e\u0629\u064b \u0625\u0650\u0644\u0651\u064e\u0627 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0647\u064e\u062f\u064e\u0649 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u06d7 \u0648\u064e\u0645\u064e\u0627 \u0643\u064e\u0627\u0646\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0644\u0650\u064a\u064f\u0636\u0650\u064a\u0639\u064e \u0625\u0650\u064a\u0645\u064e\u0640\u0670\u0646\u064e\u0643\u064f\u0645\u0652 \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0628\u0650\u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0644\u064e\u0631\u064e\u0621\u064f\u0648\u0641\u064c\u06ed \u0631\u0651\u064e\u062d\u0650\u064a\u0645\u064c\u06ed", "num": 143}
{"line": "\u0642\u064e\u062f\u0652 \u0646\u064e\u0631\u064e\u0649\u0670 \u062a\u064e\u0642\u064e\u0644\u0651\u064f\u0628\u064e \u0648\u064e\u062c\u0652\u0647\u0650\u0643\u064e \u0641\u0650\u0649 \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0627\u0653\u0621\u0650 \u06d6 \u0641\u064e\u0644\u064e\u0646\u064f\u0648\u064e\u0644\u0651\u0650\u064a\u064e\u0646\u0651\u064e\u0643\u064e \u0642\u0650\u0628\u0652\u0644\u064e\u0629\u064b\u06ed \u062a\u064e\u0631\u0652\u0636\u064e\u0649\u0670\u0647\u064e\u0627 \u06da \u0641\u064e\u0648\u064e\u0644\u0651\u0650 \u0648\u064e\u062c\u0652\u0647\u064e\u0643\u064e \u0634\u064e\u0637\u0652\u0631\u064e \u0671\u0644\u0652\u0645\u064e\u0633\u0652\u062c\u0650\u062f\u0650 \u0671\u0644\u0652\u062d\u064e\u0631\u064e\u0627\u0645\u0650 \u06da \u0648\u064e\u062d\u064e\u064a\u0652\u062b\u064f \u0645\u064e\u0627 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u0641\u064e\u0648\u064e\u0644\u0651\u064f\u0648\u0627\u06df \u0648\u064f\u062c\u064f\u0648\u0647\u064e\u0643\u064f\u0645\u0652 \u0634\u064e\u0637\u0652\u0631\u064e\u0647\u064f\u06e5 \u06d7 \u0648\u064e\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0623\u064f\u0648\u062a\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u0644\u064e\u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e \u0623\u064e\u0646\u0651\u064e\u0647\u064f \u0671\u0644\u0652\u062d\u064e\u0642\u0651\u064f \u0645\u0650\u0646 \u0631\u0651\u064e\u0628\u0651\u0650\u0647\u0650\u0645\u0652 \u06d7 \u0648\u064e\u0645\u064e\u0627 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u063a\u064e\u0640\u0670\u0641\u0650\u0644\u064d \u0639\u064e\u0645\u0651\u064e\u0627 \u064a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e", "num": 144}
{"line": "\u0648\u064e\u0644\u064e\u0626\u0650\u0646\u0652 \u0623\u064e\u062a\u064e\u064a\u0652\u062a\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0623\u064f\u0648\u062a\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u0628\u0650\u0643\u064f\u0644\u0651\u0650 \u0621\u064e\u0627\u064a\u064e\u0629\u064d\u06e2 \u0645\u0651\u064e\u0627 \u062a\u064e\u0628\u0650\u0639\u064f\u0648\u0627\u06df \u0642\u0650\u0628\u0652\u0644\u064e\u062a\u064e\u0643\u064e \u06da \u0648\u064e\u0645\u064e\u0627\u0653 \u0623\u064e\u0646\u062a\u064e \u0628\u0650\u062a\u064e\u0627\u0628\u0650\u0639\u064d\u06e2 \u0642\u0650\u0628\u0652\u0644\u064e\u062a\u064e\u0647\u064f\u0645\u0652 \u06da \u0648\u064e\u0645\u064e\u0627 \u0628\u064e\u0639\u0652\u0636\u064f\u0647\u064f\u0645 \u0628\u0650\u062a\u064e\u0627\u0628\u0650\u0639\u064d\u06e2 \u0642\u0650\u0628\u0652\u0644\u064e\u0629\u064e \u0628\u064e\u0639\u0652\u0636\u064d\u06e2 \u06da \u0648\u064e\u0644\u064e\u0626\u0650\u0646\u0650 \u0671\u062a\u0651\u064e\u0628\u064e\u0639\u0652\u062a\u064e \u0623\u064e\u0647\u0652\u0648\u064e\u0627\u0653\u0621\u064e\u0647\u064f\u0645 \u0645\u0651\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0645\u064e\u0627 \u062c\u064e\u0627\u0653\u0621\u064e\u0643\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0639\u0650\u0644\u0652\u0645\u0650 \u06d9 \u0625\u0650\u0646\u0651\u064e\u0643\u064e \u0625\u0650\u0630\u064b\u06ed\u0627 \u0644\u0651\u064e\u0645\u0650\u0646\u064e \u0671\u0644\u0638\u0651\u064e\u0640\u0670\u0644\u0650\u0645\u0650\u064a\u0646\u064e", "num": 145}
{"line": "\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u062a\u064e\u064a\u0652\u0646\u064e\u0640\u0670\u0647\u064f\u0645\u064f \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u064a\u064e\u0639\u0652\u0631\u0650\u0641\u064f\u0648\u0646\u064e\u0647\u064f\u06e5 \u0643\u064e\u0645\u064e\u0627 \u064a\u064e\u0639\u0652\u0631\u0650\u0641\u064f\u0648\u0646\u064e \u0623\u064e\u0628\u0652\u0646\u064e\u0627\u0653\u0621\u064e\u0647\u064f\u0645\u0652 \u06d6 \u0648\u064e\u0625\u0650\u0646\u0651\u064e \u0641\u064e\u0631\u0650\u064a\u0642\u064b\u06ed\u0627 \u0645\u0651\u0650\u0646\u0652\u0647\u064f\u0645\u0652 \u0644\u064e\u064a\u064e\u0643\u0652\u062a\u064f\u0645\u064f\u0648\u0646\u064e \u0671\u0644\u0652\u062d\u064e\u0642\u0651\u064e \u0648\u064e\u0647\u064f\u0645\u0652 \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 146}
{"line": "\u0671\u0644\u0652\u062d\u064e\u0642\u0651\u064f \u0645\u0650\u0646 \u0631\u0651\u064e\u0628\u0651\u0650\u0643\u064e \u06d6 \u0641\u064e\u0644\u064e\u0627 \u062a\u064e\u0643\u064f\u0648\u0646\u064e\u0646\u0651\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0645\u064f\u0645\u0652\u062a\u064e\u0631\u0650\u064a\u0646\u064e", "num": 147}
{"line": "\u0648\u064e\u0644\u0650\u0643\u064f\u0644\u0651\u064d\u06e2 \u0648\u0650\u062c\u0652\u0647\u064e\u0629\u064c \u0647\u064f\u0648\u064e \u0645\u064f\u0648\u064e\u0644\u0651\u0650\u064a\u0647\u064e\u0627 \u06d6 \u0641\u064e\u0671\u0633\u0652\u062a\u064e\u0628\u0650\u0642\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u062e\u064e\u064a\u0652\u0631\u064e\u0670\u062a\u0650 \u06da \u0623\u064e\u064a\u0652\u0646\u064e \u0645\u064e\u0627 \u062a\u064e\u0643\u064f\u0648\u0646\u064f\u0648\u0627\u06df \u064a\u064e\u0623\u0652\u062a\u0650 \u0628\u0650\u0643\u064f\u0645\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u062c\u064e\u0645\u0650\u064a\u0639\u064b\u0627 \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u064e\u0644\u064e\u0649\u0670 \u0643\u064f\u0644\u0651\u0650 \u0634\u064e\u0649\u0652\u0621\u064d\u06e2 \u0642\u064e\u062f\u0650\u064a\u0631\u064c\u06ed", "num": 148}
{"line": "\u0648\u064e\u0645\u0650\u0646\u0652 \u062d\u064e\u064a\u0652\u062b\u064f \u062e\u064e\u0631\u064e\u062c\u0652\u062a\u064e \u0641\u064e\u0648\u064e\u0644\u0651\u0650 \u0648\u064e\u062c\u0652\u0647\u064e\u0643\u064e \u0634\u064e\u0637\u0652\u0631\u064e \u0671\u0644\u0652\u0645\u064e\u0633\u0652\u062c\u0650\u062f\u0650 \u0671\u0644\u0652\u062d\u064e\u0631\u064e\u0627\u0645\u0650 \u06d6 \u0648\u064e\u0625\u0650\u0646\u0651\u064e\u0647\u064f\u06e5 \u0644\u064e\u0644\u0652\u062d\u064e\u0642\u0651\u064f \u0645\u0650\u0646 \u0631\u0651\u064e\u0628\u0651\u0650\u0643\u064e \u06d7 \u0648\u064e\u0645\u064e\u0627 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u063a\u064e\u0640\u0670\u0641\u0650\u0644\u064d \u0639\u064e\u0645\u0651\u064e\u0627 \u062a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e", "num": 149}
{"line": "\u0648\u064e\u0645\u0650\u0646\u0652 \u062d\u064e\u064a\u0652\u062b\u064f \u062e\u064e\u0631\u064e\u062c\u0652\u062a\u064e \u0641\u064e\u0648\u064e\u0644\u0651\u0650 \u0648\u064e\u062c\u0652\u0647\u064e\u0643\u064e \u0634\u064e\u0637\u0652\u0631\u064e \u0671\u0644\u0652\u0645\u064e\u0633\u0652\u062c\u0650\u062f\u0650 \u0671\u0644\u0652\u062d\u064e\u0631\u064e\u0627\u0645\u0650 \u06da \u0648\u064e\u062d\u064e\u064a\u0652\u062b\u064f \u0645\u064e\u0627 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u0641\u064e\u0648\u064e\u0644\u0651\u064f\u0648\u0627\u06df \u0648\u064f\u062c\u064f\u0648\u0647\u064e\u0643\u064f\u0645\u0652 \u0634\u064e\u0637\u0652\u0631\u064e\u0647\u064f\u06e5 \u0644\u0650\u0626\u064e\u0644\u0651\u064e\u0627 \u064a\u064e\u0643\u064f\u0648\u0646\u064e \u0644\u0650\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u062d\u064f\u062c\u0651\u064e\u0629\u064c \u0625\u0650\u0644\u0651\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0638\u064e\u0644\u064e\u0645\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u0652\u0647\u064f\u0645\u0652 \u0641\u064e\u0644\u064e\u0627 \u062a\u064e\u062e\u0652\u0634\u064e\u0648\u0652\u0647\u064f\u0645\u0652 \u0648\u064e\u0671\u062e\u0652\u0634\u064e\u0648\u0652\u0646\u0650\u0649 \u0648\u064e\u0644\u0650\u0623\u064f\u062a\u0650\u0645\u0651\u064e \u0646\u0650\u0639\u0652\u0645\u064e\u062a\u0650\u0649 \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0648\u064e\u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u062a\u064e\u0647\u0652\u062a\u064e\u062f\u064f\u0648\u0646\u064e", "num": 150}
{"line": "\u0643\u064e\u0645\u064e\u0627\u0653 \u0623\u064e\u0631\u0652\u0633\u064e\u0644\u0652\u0646\u064e\u0627 \u0641\u0650\u064a\u0643\u064f\u0645\u0652 \u0631\u064e\u0633\u064f\u0648\u0644\u064b\u06ed\u0627 \u0645\u0651\u0650\u0646\u0643\u064f\u0645\u0652 \u064a\u064e\u062a\u0652\u0644\u064f\u0648\u0627\u06df \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0621\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u0650\u0646\u064e\u0627 \u0648\u064e\u064a\u064f\u0632\u064e\u0643\u0651\u0650\u064a\u0643\u064f\u0645\u0652 \u0648\u064e\u064a\u064f\u0639\u064e\u0644\u0651\u0650\u0645\u064f\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u0648\u064e\u0671\u0644\u0652\u062d\u0650\u0643\u0652\u0645\u064e\u0629\u064e \u0648\u064e\u064a\u064f\u0639\u064e\u0644\u0651\u0650\u0645\u064f\u0643\u064f\u0645 \u0645\u0651\u064e\u0627 \u0644\u064e\u0645\u0652 \u062a\u064e\u0643\u064f\u0648\u0646\u064f\u0648\u0627\u06df \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 151}
{"line": "\u0641\u064e\u0671\u0630\u0652\u0643\u064f\u0631\u064f\u0648\u0646\u0650\u0649\u0653 \u0623\u064e\u0630\u0652\u0643\u064f\u0631\u0652\u0643\u064f\u0645\u0652 \u0648\u064e\u0671\u0634\u0652\u0643\u064f\u0631\u064f\u0648\u0627\u06df \u0644\u0650\u0649 \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0643\u0652\u0641\u064f\u0631\u064f\u0648\u0646\u0650", "num": 152}
{"line": "\u064a\u064e\u0640\u0670\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0671\u0633\u0652\u062a\u064e\u0639\u0650\u064a\u0646\u064f\u0648\u0627\u06df \u0628\u0650\u0671\u0644\u0635\u0651\u064e\u0628\u0652\u0631\u0650 \u0648\u064e\u0671\u0644\u0635\u0651\u064e\u0644\u064e\u0648\u0670\u0629\u0650 \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0645\u064e\u0639\u064e \u0671\u0644\u0635\u0651\u064e\u0640\u0670\u0628\u0650\u0631\u0650\u064a\u0646\u064e", "num": 153}
{"line": "\u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0642\u064f\u0648\u0644\u064f\u0648\u0627\u06df \u0644\u0650\u0645\u064e\u0646 \u064a\u064f\u0642\u0652\u062a\u064e\u0644\u064f \u0641\u0650\u0649 \u0633\u064e\u0628\u0650\u064a\u0644\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0623\u064e\u0645\u0652\u0648\u064e\u0670\u062a\u064c\u06e2 \u06da \u0628\u064e\u0644\u0652 \u0623\u064e\u062d\u0652\u064a\u064e\u0627\u0653\u0621\u064c\u06ed \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646 \u0644\u0651\u064e\u0627 \u062a\u064e\u0634\u0652\u0639\u064f\u0631\u064f\u0648\u0646\u064e", "num": 154}
{"line": "\u0648\u064e\u0644\u064e\u0646\u064e\u0628\u0652\u0644\u064f\u0648\u064e\u0646\u0651\u064e\u0643\u064f\u0645 \u0628\u0650\u0634\u064e\u0649\u0652\u0621\u064d\u06e2 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0652\u062e\u064e\u0648\u0652\u0641\u0650 \u0648\u064e\u0671\u0644\u0652\u062c\u064f\u0648\u0639\u0650 \u0648\u064e\u0646\u064e\u0642\u0652\u0635\u064d\u06e2 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0652\u0623\u064e\u0645\u0652\u0648\u064e\u0670\u0644\u0650 \u0648\u064e\u0671\u0644\u0652\u0623\u064e\u0646\u0641\u064f\u0633\u0650 \u0648\u064e\u0671\u0644\u062b\u0651\u064e\u0645\u064e\u0631\u064e\u0670\u062a\u0650 \u06d7 \u0648\u064e\u0628\u064e\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u0635\u0651\u064e\u0640\u0670\u0628\u0650\u0631\u0650\u064a\u0646\u064e", "num": 155}
{"line": "\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0625\u0650\u0630\u064e\u0627\u0653 \u0623\u064e\u0635\u064e\u0640\u0670\u0628\u064e\u062a\u0652\u0647\u064f\u0645 \u0645\u0651\u064f\u0635\u0650\u064a\u0628\u064e\u0629\u064c\u06ed \u0642\u064e\u0627\u0644\u064f\u0648\u0653\u0627\u06df \u0625\u0650\u0646\u0651\u064e\u0627 \u0644\u0650\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0625\u0650\u0646\u0651\u064e\u0627\u0653 \u0625\u0650\u0644\u064e\u064a\u0652\u0647\u0650 \u0631\u064e\u0670\u062c\u0650\u0639\u064f\u0648\u0646\u064e", "num": 156}
{"line": "\u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u0635\u064e\u0644\u064e\u0648\u064e\u0670\u062a\u064c\u06ed \u0645\u0651\u0650\u0646 \u0631\u0651\u064e\u0628\u0651\u0650\u0647\u0650\u0645\u0652 \u0648\u064e\u0631\u064e\u062d\u0652\u0645\u064e\u0629\u064c\u06ed \u06d6 \u0648\u064e\u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0647\u064f\u0645\u064f \u0671\u0644\u0652\u0645\u064f\u0647\u0652\u062a\u064e\u062f\u064f\u0648\u0646\u064e", "num": 157}
{"line": "\u06de \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0635\u0651\u064e\u0641\u064e\u0627 \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u0631\u0652\u0648\u064e\u0629\u064e \u0645\u0650\u0646 \u0634\u064e\u0639\u064e\u0627\u0653\u0626\u0650\u0631\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d6 \u0641\u064e\u0645\u064e\u0646\u0652 \u062d\u064e\u062c\u0651\u064e \u0671\u0644\u0652\u0628\u064e\u064a\u0652\u062a\u064e \u0623\u064e\u0648\u0650 \u0671\u0639\u0652\u062a\u064e\u0645\u064e\u0631\u064e \u0641\u064e\u0644\u064e\u0627 \u062c\u064f\u0646\u064e\u0627\u062d\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0623\u064e\u0646 \u064a\u064e\u0637\u0651\u064e\u0648\u0651\u064e\u0641\u064e \u0628\u0650\u0647\u0650\u0645\u064e\u0627 \u06da \u0648\u064e\u0645\u064e\u0646 \u062a\u064e\u0637\u064e\u0648\u0651\u064e\u0639\u064e \u062e\u064e\u064a\u0652\u0631\u064b\u06ed\u0627 \u0641\u064e\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0634\u064e\u0627\u0643\u0650\u0631\u064c \u0639\u064e\u0644\u0650\u064a\u0645\u064c", "num": 158}
{"line": "\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064e\u0643\u0652\u062a\u064f\u0645\u064f\u0648\u0646\u064e \u0645\u064e\u0627\u0653 \u0623\u064e\u0646\u0632\u064e\u0644\u0652\u0646\u064e\u0627 \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0628\u064e\u064a\u0651\u0650\u0646\u064e\u0640\u0670\u062a\u0650 \u0648\u064e\u0671\u0644\u0652\u0647\u064f\u062f\u064e\u0649\u0670 \u0645\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0645\u064e\u0627 \u0628\u064e\u064a\u0651\u064e\u0646\u0651\u064e\u0640\u0670\u0647\u064f \u0644\u0650\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0641\u0650\u0649 \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u0650 \u06d9 \u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u064a\u064e\u0644\u0652\u0639\u064e\u0646\u064f\u0647\u064f\u0645\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0648\u064e\u064a\u064e\u0644\u0652\u0639\u064e\u0646\u064f\u0647\u064f\u0645\u064f \u0671\u0644\u0644\u0651\u064e\u0640\u0670\u0639\u0650\u0646\u064f\u0648\u0646\u064e", "num": 159}
{"line": "\u0625\u0650\u0644\u0651\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u062a\u064e\u0627\u0628\u064f\u0648\u0627\u06df \u0648\u064e\u0623\u064e\u0635\u0652\u0644\u064e\u062d\u064f\u0648\u0627\u06df \u0648\u064e\u0628\u064e\u064a\u0651\u064e\u0646\u064f\u0648\u0627\u06df \u0641\u064e\u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0623\u064e\u062a\u064f\u0648\u0628\u064f \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u06da \u0648\u064e\u0623\u064e\u0646\u064e\u0627 \u0671\u0644\u062a\u0651\u064e\u0648\u0651\u064e\u0627\u0628\u064f \u0671\u0644\u0631\u0651\u064e\u062d\u0650\u064a\u0645\u064f", "num": 160}
{"line": "\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0643\u064e\u0641\u064e\u0631\u064f\u0648\u0627\u06df \u0648\u064e\u0645\u064e\u0627\u062a\u064f\u0648\u0627\u06df \u0648\u064e\u0647\u064f\u0645\u0652 \u0643\u064f\u0641\u0651\u064e\u0627\u0631\u064c \u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u0644\u064e\u0639\u0652\u0646\u064e\u0629\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e\u0629\u0650 \u0648\u064e\u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0623\u064e\u062c\u0652\u0645\u064e\u0639\u0650\u064a\u0646\u064e", "num": 161}
{"line": "\u062e\u064e\u0640\u0670\u0644\u0650\u062f\u0650\u064a\u0646\u064e \u0641\u0650\u064a\u0647\u064e\u0627 \u06d6 \u0644\u064e\u0627 \u064a\u064f\u062e\u064e\u0641\u0651\u064e\u0641\u064f \u0639\u064e\u0646\u0652\u0647\u064f\u0645\u064f \u0671\u0644\u0652\u0639\u064e\u0630\u064e\u0627\u0628\u064f \u0648\u064e\u0644\u064e\u0627 \u0647\u064f\u0645\u0652 \u064a\u064f\u0646\u0638\u064e\u0631\u064f\u0648\u0646\u064e", "num": 162}
{"line": "\u0648\u064e\u0625\u0650\u0644\u064e\u0640\u0670\u0647\u064f\u0643\u064f\u0645\u0652 \u0625\u0650\u0644\u064e\u0640\u0670\u0647\u064c\u06ed \u0648\u064e\u0670\u062d\u0650\u062f\u064c\u06ed \u06d6 \u0644\u0651\u064e\u0627\u0653 \u0625\u0650\u0644\u064e\u0640\u0670\u0647\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0647\u064f\u0648\u064e \u0671\u0644\u0631\u0651\u064e\u062d\u0652\u0645\u064e\u0640\u0670\u0646\u064f \u0671\u0644\u0631\u0651\u064e\u062d\u0650\u064a\u0645\u064f", "num": 163}
{"line": "\u0625\u0650\u0646\u0651\u064e \u0641\u0650\u0649 \u062e\u064e\u0644\u0652\u0642\u0650 \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0640\u0670\u0648\u064e\u0670\u062a\u0650 \u0648\u064e\u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u0648\u064e\u0671\u062e\u0652\u062a\u0650\u0644\u064e\u0640\u0670\u0641\u0650 \u0671\u0644\u0651\u064e\u064a\u0652\u0644\u0650 \u0648\u064e\u0671\u0644\u0646\u0651\u064e\u0647\u064e\u0627\u0631\u0650 \u0648\u064e\u0671\u0644\u0652\u0641\u064f\u0644\u0652\u0643\u0650 \u0671\u0644\u0651\u064e\u062a\u0650\u0649 \u062a\u064e\u062c\u0652\u0631\u0650\u0649 \u0641\u0650\u0649 \u0671\u0644\u0652\u0628\u064e\u062d\u0652\u0631\u0650 \u0628\u0650\u0645\u064e\u0627 \u064a\u064e\u0646\u0641\u064e\u0639\u064f \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u064e \u0648\u064e\u0645\u064e\u0627\u0653 \u0623\u064e\u0646\u0632\u064e\u0644\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0645\u0650\u0646\u064e \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0627\u0653\u0621\u0650 \u0645\u0650\u0646 \u0645\u0651\u064e\u0627\u0653\u0621\u064d\u06e2 \u0641\u064e\u0623\u064e\u062d\u0652\u064a\u064e\u0627 \u0628\u0650\u0647\u0650 \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u064e \u0628\u064e\u0639\u0652\u062f\u064e \u0645\u064e\u0648\u0652\u062a\u0650\u0647\u064e\u0627 \u0648\u064e\u0628\u064e\u062b\u0651\u064e \u0641\u0650\u064a\u0647\u064e\u0627 \u0645\u0650\u0646 \u0643\u064f\u0644\u0651\u0650 \u062f\u064e\u0627\u0653\u0628\u0651\u064e\u0629\u064d\u06e2 \u0648\u064e\u062a\u064e\u0635\u0652\u0631\u0650\u064a\u0641\u0650 \u0671\u0644\u0631\u0651\u0650\u064a\u064e\u0640\u0670\u062d\u0650 \u0648\u064e\u0671\u0644\u0633\u0651\u064e\u062d\u064e\u0627\u0628\u0650 \u0671\u0644\u0652\u0645\u064f\u0633\u064e\u062e\u0651\u064e\u0631\u0650 \u0628\u064e\u064a\u0652\u0646\u064e \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0627\u0653\u0621\u0650 \u0648\u064e\u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u0644\u064e\u0640\u0654\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u064d\u06e2 \u0644\u0651\u0650\u0642\u064e\u0648\u0652\u0645\u064d\u06e2 \u064a\u064e\u0639\u0652\u0642\u0650\u0644\u064f\u0648\u0646\u064e", "num": 164}
{"line": "\u0648\u064e\u0645\u0650\u0646\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0645\u064e\u0646 \u064a\u064e\u062a\u0651\u064e\u062e\u0650\u0630\u064f \u0645\u0650\u0646 \u062f\u064f\u0648\u0646\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0623\u064e\u0646\u062f\u064e\u0627\u062f\u064b\u06ed\u0627 \u064a\u064f\u062d\u0650\u0628\u0651\u064f\u0648\u0646\u064e\u0647\u064f\u0645\u0652 \u0643\u064e\u062d\u064f\u0628\u0651\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d6 \u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0634\u064e\u062f\u0651\u064f \u062d\u064f\u0628\u0651\u064b\u06ed\u0627 \u0644\u0651\u0650\u0644\u0651\u064e\u0647\u0650 \u06d7 \u0648\u064e\u0644\u064e\u0648\u0652 \u064a\u064e\u0631\u064e\u0649 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0638\u064e\u0644\u064e\u0645\u064f\u0648\u0653\u0627\u06df \u0625\u0650\u0630\u0652 \u064a\u064e\u0631\u064e\u0648\u0652\u0646\u064e \u0671\u0644\u0652\u0639\u064e\u0630\u064e\u0627\u0628\u064e \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0652\u0642\u064f\u0648\u0651\u064e\u0629\u064e \u0644\u0650\u0644\u0651\u064e\u0647\u0650 \u062c\u064e\u0645\u0650\u064a\u0639\u064b\u06ed\u0627 \u0648\u064e\u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0634\u064e\u062f\u0650\u064a\u062f\u064f \u0671\u0644\u0652\u0639\u064e\u0630\u064e\u0627\u0628\u0650", "num": 165}
{"line": "\u0625\u0650\u0630\u0652 \u062a\u064e\u0628\u064e\u0631\u0651\u064e\u0623\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0671\u062a\u0651\u064f\u0628\u0650\u0639\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0671\u062a\u0651\u064e\u0628\u064e\u0639\u064f\u0648\u0627\u06df \u0648\u064e\u0631\u064e\u0623\u064e\u0648\u064f\u0627\u06df \u0671\u0644\u0652\u0639\u064e\u0630\u064e\u0627\u0628\u064e \u0648\u064e\u062a\u064e\u0642\u064e\u0637\u0651\u064e\u0639\u064e\u062a\u0652 \u0628\u0650\u0647\u0650\u0645\u064f \u0671\u0644\u0652\u0623\u064e\u0633\u0652\u0628\u064e\u0627\u0628\u064f", "num": 166}
{"line": "\u0648\u064e\u0642\u064e\u0627\u0644\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0671\u062a\u0651\u064e\u0628\u064e\u0639\u064f\u0648\u0627\u06df \u0644\u064e\u0648\u0652 \u0623\u064e\u0646\u0651\u064e \u0644\u064e\u0646\u064e\u0627 \u0643\u064e\u0631\u0651\u064e\u0629\u064b\u06ed \u0641\u064e\u0646\u064e\u062a\u064e\u0628\u064e\u0631\u0651\u064e\u0623\u064e \u0645\u0650\u0646\u0652\u0647\u064f\u0645\u0652 \u0643\u064e\u0645\u064e\u0627 \u062a\u064e\u0628\u064e\u0631\u0651\u064e\u0621\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u0651\u064e\u0627 \u06d7 \u0643\u064e\u0630\u064e\u0670\u0644\u0650\u0643\u064e \u064a\u064f\u0631\u0650\u064a\u0647\u0650\u0645\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0623\u064e\u0639\u0652\u0645\u064e\u0640\u0670\u0644\u064e\u0647\u064f\u0645\u0652 \u062d\u064e\u0633\u064e\u0631\u064e\u0670\u062a\u064d \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u06d6 \u0648\u064e\u0645\u064e\u0627 \u0647\u064f\u0645 \u0628\u0650\u062e\u064e\u0640\u0670\u0631\u0650\u062c\u0650\u064a\u0646\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u0650", "num": 167}
{"line": "\u064a\u064e\u0640\u0670\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u064f \u0643\u064f\u0644\u064f\u0648\u0627\u06df \u0645\u0650\u0645\u0651\u064e\u0627 \u0641\u0650\u0649 \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u062d\u064e\u0644\u064e\u0640\u0670\u0644\u064b\u06ed\u0627 \u0637\u064e\u064a\u0651\u0650\u0628\u064b\u06ed\u0627 \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u062a\u0651\u064e\u0628\u0650\u0639\u064f\u0648\u0627\u06df \u062e\u064f\u0637\u064f\u0648\u064e\u0670\u062a\u0650 \u0671\u0644\u0634\u0651\u064e\u064a\u0652\u0637\u064e\u0640\u0670\u0646\u0650 \u06da \u0625\u0650\u0646\u0651\u064e\u0647\u064f\u06e5 \u0644\u064e\u0643\u064f\u0645\u0652 \u0639\u064e\u062f\u064f\u0648\u0651\u064c\u06ed \u0645\u0651\u064f\u0628\u0650\u064a\u0646\u064c", "num": 168}
{"line": "\u0625\u0650\u0646\u0651\u064e\u0645\u064e\u0627 \u064a\u064e\u0623\u0652\u0645\u064f\u0631\u064f\u0643\u064f\u0645 \u0628\u0650\u0671\u0644\u0633\u0651\u064f\u0648\u0653\u0621\u0650 \u0648\u064e\u0671\u0644\u0652\u0641\u064e\u062d\u0652\u0634\u064e\u0627\u0653\u0621\u0650 \u0648\u064e\u0623\u064e\u0646 \u062a\u064e\u0642\u064f\u0648\u0644\u064f\u0648\u0627\u06df \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0645\u064e\u0627 \u0644\u064e\u0627 \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 169}
{"line": "\u0648\u064e\u0625\u0650\u0630\u064e\u0627 \u0642\u0650\u064a\u0644\u064e \u0644\u064e\u0647\u064f\u0645\u064f \u0671\u062a\u0651\u064e\u0628\u0650\u0639\u064f\u0648\u0627\u06df \u0645\u064e\u0627\u0653 \u0623\u064e\u0646\u0632\u064e\u0644\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0628\u064e\u0644\u0652 \u0646\u064e\u062a\u0651\u064e\u0628\u0650\u0639\u064f \u0645\u064e\u0627\u0653 \u0623\u064e\u0644\u0652\u0641\u064e\u064a\u0652\u0646\u064e\u0627 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0621\u064e\u0627\u0628\u064e\u0627\u0653\u0621\u064e\u0646\u064e\u0627\u0653 \u06d7 \u0623\u064e\u0648\u064e\u0644\u064e\u0648\u0652 \u0643\u064e\u0627\u0646\u064e \u0621\u064e\u0627\u0628\u064e\u0627\u0653\u0624\u064f\u0647\u064f\u0645\u0652 \u0644\u064e\u0627 \u064a\u064e\u0639\u0652\u0642\u0650\u0644\u064f\u0648\u0646\u064e \u0634\u064e\u064a\u0652\u0640\u0654\u064b\u06ed\u0627 \u0648\u064e\u0644\u064e\u0627 \u064a\u064e\u0647\u0652\u062a\u064e\u062f\u064f\u0648\u0646\u064e", "num": 170}
{"line": "\u0648\u064e\u0645\u064e\u062b\u064e\u0644\u064f \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0643\u064e\u0641\u064e\u0631\u064f\u0648\u0627\u06df \u0643\u064e\u0645\u064e\u062b\u064e\u0644\u0650 \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u064a\u064e\u0646\u0652\u0639\u0650\u0642\u064f \u0628\u0650\u0645\u064e\u0627 \u0644\u064e\u0627 \u064a\u064e\u0633\u0652\u0645\u064e\u0639\u064f \u0625\u0650\u0644\u0651\u064e\u0627 \u062f\u064f\u0639\u064e\u0627\u0653\u0621\u064b\u06ed \u0648\u064e\u0646\u0650\u062f\u064e\u0627\u0653\u0621\u064b\u06ed \u06da \u0635\u064f\u0645\u0651\u064c\u06e2 \u0628\u064f\u0643\u0652\u0645\u064c \u0639\u064f\u0645\u0652\u0649\u064c\u06ed \u0641\u064e\u0647\u064f\u0645\u0652 \u0644\u064e\u0627 \u064a\u064e\u0639\u0652\u0642\u0650\u0644\u064f\u0648\u0646\u064e", "num": 171}
{"line": "\u064a\u064e\u0640\u0670\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0643\u064f\u0644\u064f\u0648\u0627\u06df \u0645\u0650\u0646 \u0637\u064e\u064a\u0651\u0650\u0628\u064e\u0640\u0670\u062a\u0650 \u0645\u064e\u0627 \u0631\u064e\u0632\u064e\u0642\u0652\u0646\u064e\u0640\u0670\u0643\u064f\u0645\u0652 \u0648\u064e\u0671\u0634\u0652\u0643\u064f\u0631\u064f\u0648\u0627\u06df \u0644\u0650\u0644\u0651\u064e\u0647\u0650 \u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u0625\u0650\u064a\u0651\u064e\u0627\u0647\u064f \u062a\u064e\u0639\u0652\u0628\u064f\u062f\u064f\u0648\u0646\u064e", "num": 172}
{"line": "\u0625\u0650\u0646\u0651\u064e\u0645\u064e\u0627 \u062d\u064e\u0631\u0651\u064e\u0645\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u0645\u064e\u064a\u0652\u062a\u064e\u0629\u064e \u0648\u064e\u0671\u0644\u062f\u0651\u064e\u0645\u064e \u0648\u064e\u0644\u064e\u062d\u0652\u0645\u064e \u0671\u0644\u0652\u062e\u0650\u0646\u0632\u0650\u064a\u0631\u0650 \u0648\u064e\u0645\u064e\u0627\u0653 \u0623\u064f\u0647\u0650\u0644\u0651\u064e \u0628\u0650\u0647\u0650\u06e6 \u0644\u0650\u063a\u064e\u064a\u0652\u0631\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d6 \u0641\u064e\u0645\u064e\u0646\u0650 \u0671\u0636\u0652\u0637\u064f\u0631\u0651\u064e \u063a\u064e\u064a\u0652\u0631\u064e \u0628\u064e\u0627\u063a\u064d\u06e2 \u0648\u064e\u0644\u064e\u0627 \u0639\u064e\u0627\u062f\u064d\u06e2 \u0641\u064e\u0644\u064e\u0627\u0653 \u0625\u0650\u062b\u0652\u0645\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u063a\u064e\u0641\u064f\u0648\u0631\u064c\u06ed \u0631\u0651\u064e\u062d\u0650\u064a\u0645\u064c", "num": 173}
{"line": "\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064e\u0643\u0652\u062a\u064f\u0645\u064f\u0648\u0646\u064e \u0645\u064e\u0627\u0653 \u0623\u064e\u0646\u0632\u064e\u0644\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u0650 \u0648\u064e\u064a\u064e\u0634\u0652\u062a\u064e\u0631\u064f\u0648\u0646\u064e \u0628\u0650\u0647\u0650\u06e6 \u062b\u064e\u0645\u064e\u0646\u064b\u06ed\u0627 \u0642\u064e\u0644\u0650\u064a\u0644\u064b\u0627 \u06d9 \u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0645\u064e\u0627 \u064a\u064e\u0623\u0652\u0643\u064f\u0644\u064f\u0648\u0646\u064e \u0641\u0650\u0649 \u0628\u064f\u0637\u064f\u0648\u0646\u0650\u0647\u0650\u0645\u0652 \u0625\u0650\u0644\u0651\u064e\u0627 \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u064e \u0648\u064e\u0644\u064e\u0627 \u064a\u064f\u0643\u064e\u0644\u0651\u0650\u0645\u064f\u0647\u064f\u0645\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064e\u0648\u0652\u0645\u064e \u0671\u0644\u0652\u0642\u0650\u064a\u064e\u0640\u0670\u0645\u064e\u0629\u0650 \u0648\u064e\u0644\u064e\u0627 \u064a\u064f\u0632\u064e\u0643\u0651\u0650\u064a\u0647\u0650\u0645\u0652 \u0648\u064e\u0644\u064e\u0647\u064f\u0645\u0652 \u0639\u064e\u0630\u064e\u0627\u0628\u064c \u0623\u064e\u0644\u0650\u064a\u0645\u064c", "num": 174}
{"line": "\u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0671\u0634\u0652\u062a\u064e\u0631\u064e\u0648\u064f\u0627\u06df \u0671\u0644\u0636\u0651\u064e\u0644\u064e\u0640\u0670\u0644\u064e\u0629\u064e \u0628\u0650\u0671\u0644\u0652\u0647\u064f\u062f\u064e\u0649\u0670 \u0648\u064e\u0671\u0644\u0652\u0639\u064e\u0630\u064e\u0627\u0628\u064e \u0628\u0650\u0671\u0644\u0652\u0645\u064e\u063a\u0652\u0641\u0650\u0631\u064e\u0629\u0650 \u06da \u0641\u064e\u0645\u064e\u0627\u0653 \u0623\u064e\u0635\u0652\u0628\u064e\u0631\u064e\u0647\u064f\u0645\u0652 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u0650", "num": 175}
{"line": "\u0630\u064e\u0670\u0644\u0650\u0643\u064e \u0628\u0650\u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0646\u064e\u0632\u0651\u064e\u0644\u064e \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u0628\u0650\u0671\u0644\u0652\u062d\u064e\u0642\u0651\u0650 \u06d7 \u0648\u064e\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0671\u062e\u0652\u062a\u064e\u0644\u064e\u0641\u064f\u0648\u0627\u06df \u0641\u0650\u0649 \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u0650 \u0644\u064e\u0641\u0650\u0649 \u0634\u0650\u0642\u064e\u0627\u0642\u064d\u06ed \u0628\u064e\u0639\u0650\u064a\u062f\u064d\u06e2", "num": 176}
{"line": "\u06de \u0644\u0651\u064e\u064a\u0652\u0633\u064e \u0671\u0644\u0652\u0628\u0650\u0631\u0651\u064e \u0623\u064e\u0646 \u062a\u064f\u0648\u064e\u0644\u0651\u064f\u0648\u0627\u06df \u0648\u064f\u062c\u064f\u0648\u0647\u064e\u0643\u064f\u0645\u0652 \u0642\u0650\u0628\u064e\u0644\u064e \u0671\u0644\u0652\u0645\u064e\u0634\u0652\u0631\u0650\u0642\u0650 \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u063a\u0652\u0631\u0650\u0628\u0650 \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646\u0651\u064e \u0671\u0644\u0652\u0628\u0650\u0631\u0651\u064e \u0645\u064e\u0646\u0652 \u0621\u064e\u0627\u0645\u064e\u0646\u064e \u0628\u0650\u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0671\u0644\u0652\u064a\u064e\u0648\u0652\u0645\u0650 \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u0650 \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e\u0629\u0650 \u0648\u064e\u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u0650 \u0648\u064e\u0671\u0644\u0646\u0651\u064e\u0628\u0650\u064a\u0651\u0650\u0640\u06e7\u0646\u064e \u0648\u064e\u0621\u064e\u0627\u062a\u064e\u0649 \u0671\u0644\u0652\u0645\u064e\u0627\u0644\u064e \u0639\u064e\u0644\u064e\u0649\u0670 \u062d\u064f\u0628\u0651\u0650\u0647\u0650\u06e6 \u0630\u064e\u0648\u0650\u0649 \u0671\u0644\u0652\u0642\u064f\u0631\u0652\u0628\u064e\u0649\u0670 \u0648\u064e\u0671\u0644\u0652\u064a\u064e\u062a\u064e\u0640\u0670\u0645\u064e\u0649\u0670 \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u0633\u064e\u0640\u0670\u0643\u0650\u064a\u0646\u064e \u0648\u064e\u0671\u0628\u0652\u0646\u064e \u0671\u0644\u0633\u0651\u064e\u0628\u0650\u064a\u0644\u0650 \u0648\u064e\u0671\u0644\u0633\u0651\u064e\u0627\u0653\u0626\u0650\u0644\u0650\u064a\u0646\u064e \u0648\u064e\u0641\u0650\u0649 \u0671\u0644\u0631\u0651\u0650\u0642\u064e\u0627\u0628\u0650 \u0648\u064e\u0623\u064e\u0642\u064e\u0627\u0645\u064e \u0671\u0644\u0635\u0651\u064e\u0644\u064e\u0648\u0670\u0629\u064e \u0648\u064e\u0621\u064e\u0627\u062a\u064e\u0649 \u0671\u0644\u0632\u0651\u064e\u0643\u064e\u0648\u0670\u0629\u064e \u0648\u064e\u0671\u0644\u0652\u0645\u064f\u0648\u0641\u064f\u0648\u0646\u064e \u0628\u0650\u0639\u064e\u0647\u0652\u062f\u0650\u0647\u0650\u0645\u0652 \u0625\u0650\u0630\u064e\u0627 \u0639\u064e\u0640\u0670\u0647\u064e\u062f\u064f\u0648\u0627\u06df \u06d6 \u0648\u064e\u0671\u0644\u0635\u0651\u064e\u0640\u0670\u0628\u0650\u0631\u0650\u064a\u0646\u064e \u0641\u0650\u0649 \u0671\u0644\u0652\u0628\u064e\u0623\u0652\u0633\u064e\u0627\u0653\u0621\u0650 \u0648\u064e\u0671\u0644\u0636\u0651\u064e\u0631\u0651\u064e\u0627\u0653\u0621\u0650 \u0648\u064e\u062d\u0650\u064a\u0646\u064e \u0671\u0644\u0652\u0628\u064e\u0623\u0652\u0633\u0650 \u06d7 \u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0635\u064e\u062f\u064e\u0642\u064f\u0648\u0627\u06df \u06d6 \u0648\u064e\u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0647\u064f\u0645\u064f \u0671\u0644\u0652\u0645\u064f\u062a\u0651\u064e\u0642\u064f\u0648\u0646\u064e", "num": 177}
{"line": "\u064a\u064e\u0640\u0670\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0643\u064f\u062a\u0650\u0628\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u0642\u0650\u0635\u064e\u0627\u0635\u064f \u0641\u0650\u0649 \u0671\u0644\u0652\u0642\u064e\u062a\u0652\u0644\u064e\u0649 \u06d6 \u0671\u0644\u0652\u062d\u064f\u0631\u0651\u064f \u0628\u0650\u0671\u0644\u0652\u062d\u064f\u0631\u0651\u0650 \u0648\u064e\u0671\u0644\u0652\u0639\u064e\u0628\u0652\u062f\u064f \u0628\u0650\u0671\u0644\u0652\u0639\u064e\u0628\u0652\u062f\u0650 \u0648\u064e\u0671\u0644\u0652\u0623\u064f\u0646\u062b\u064e\u0649\u0670 \u0628\u0650\u0671\u0644\u0652\u0623\u064f\u0646\u062b\u064e\u0649\u0670 \u06da \u0641\u064e\u0645\u064e\u0646\u0652 \u0639\u064f\u0641\u0650\u0649\u064e \u0644\u064e\u0647\u064f\u06e5 \u0645\u0650\u0646\u0652 \u0623\u064e\u062e\u0650\u064a\u0647\u0650 \u0634\u064e\u0649\u0652\u0621\u064c\u06ed \u0641\u064e\u0671\u062a\u0651\u0650\u0628\u064e\u0627\u0639\u064c\u06e2 \u0628\u0650\u0671\u0644\u0652\u0645\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u0650 \u0648\u064e\u0623\u064e\u062f\u064e\u0627\u0653\u0621\u064c \u0625\u0650\u0644\u064e\u064a\u0652\u0647\u0650 \u0628\u0650\u0625\u0650\u062d\u0652\u0633\u064e\u0640\u0670\u0646\u064d\u06e2 \u06d7 \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u062a\u064e\u062e\u0652\u0641\u0650\u064a\u0641\u064c\u06ed \u0645\u0651\u0650\u0646 \u0631\u0651\u064e\u0628\u0651\u0650\u0643\u064f\u0645\u0652 \u0648\u064e\u0631\u064e\u062d\u0652\u0645\u064e\u0629\u064c\u06ed \u06d7 \u0641\u064e\u0645\u064e\u0646\u0650 \u0671\u0639\u0652\u062a\u064e\u062f\u064e\u0649\u0670 \u0628\u064e\u0639\u0652\u062f\u064e \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u0641\u064e\u0644\u064e\u0647\u064f\u06e5 \u0639\u064e\u0630\u064e\u0627\u0628\u064c \u0623\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 178}
{"line": "\u0648\u064e\u0644\u064e\u0643\u064f\u0645\u0652 \u0641\u0650\u0649 \u0671\u0644\u0652\u0642\u0650\u0635\u064e\u0627\u0635\u0650 \u062d\u064e\u064a\u064e\u0648\u0670\u0629\u064c\u06ed \u064a\u064e\u0640\u0670\u0653\u0623\u064f\u0648\u06df\u0644\u0650\u0649 \u0671\u0644\u0652\u0623\u064e\u0644\u0652\u0628\u064e\u0640\u0670\u0628\u0650 \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u062a\u064e\u062a\u0651\u064e\u0642\u064f\u0648\u0646\u064e", "num": 179}
{"line": "\u0643\u064f\u062a\u0650\u0628\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0625\u0650\u0630\u064e\u0627 \u062d\u064e\u0636\u064e\u0631\u064e \u0623\u064e\u062d\u064e\u062f\u064e\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u0645\u064e\u0648\u0652\u062a\u064f \u0625\u0650\u0646 \u062a\u064e\u0631\u064e\u0643\u064e \u062e\u064e\u064a\u0652\u0631\u064b\u0627 \u0671\u0644\u0652\u0648\u064e\u0635\u0650\u064a\u0651\u064e\u0629\u064f \u0644\u0650\u0644\u0652\u0648\u064e\u0670\u0644\u0650\u062f\u064e\u064a\u0652\u0646\u0650 \u0648\u064e\u0671\u0644\u0652\u0623\u064e\u0642\u0652\u0631\u064e\u0628\u0650\u064a\u0646\u064e \u0628\u0650\u0671\u0644\u0652\u0645\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u0650 \u06d6 \u062d\u064e\u0642\u0651\u064b\u0627 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0645\u064f\u062a\u0651\u064e\u0642\u0650\u064a\u0646\u064e", "num": 180}
{"line": "\u0641\u064e\u0645\u064e\u0646\u06e2 \u0628\u064e\u062f\u0651\u064e\u0644\u064e\u0647\u064f\u06e5 \u0628\u064e\u0639\u0652\u062f\u064e \u0645\u064e\u0627 \u0633\u064e\u0645\u0650\u0639\u064e\u0647\u064f\u06e5 \u0641\u064e\u0625\u0650\u0646\u0651\u064e\u0645\u064e\u0627\u0653 \u0625\u0650\u062b\u0652\u0645\u064f\u0647\u064f\u06e5 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064f\u0628\u064e\u062f\u0651\u0650\u0644\u064f\u0648\u0646\u064e\u0647\u064f\u06e5\u0653 \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0633\u064e\u0645\u0650\u064a\u0639\u064c \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 181}
{"line": "\u0641\u064e\u0645\u064e\u0646\u0652 \u062e\u064e\u0627\u0641\u064e \u0645\u0650\u0646 \u0645\u0651\u064f\u0648\u0635\u064d\u06e2 \u062c\u064e\u0646\u064e\u0641\u064b\u0627 \u0623\u064e\u0648\u0652 \u0625\u0650\u062b\u0652\u0645\u064b\u06ed\u0627 \u0641\u064e\u0623\u064e\u0635\u0652\u0644\u064e\u062d\u064e \u0628\u064e\u064a\u0652\u0646\u064e\u0647\u064f\u0645\u0652 \u0641\u064e\u0644\u064e\u0627\u0653 \u0625\u0650\u062b\u0652\u0645\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u063a\u064e\u0641\u064f\u0648\u0631\u064c\u06ed \u0631\u0651\u064e\u062d\u0650\u064a\u0645\u064c\u06ed", "num": 182}
{"line": "\u064a\u064e\u0640\u0670\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0643\u064f\u062a\u0650\u0628\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u064f \u0671\u0644\u0635\u0651\u0650\u064a\u064e\u0627\u0645\u064f \u0643\u064e\u0645\u064e\u0627 \u0643\u064f\u062a\u0650\u0628\u064e \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0645\u0650\u0646 \u0642\u064e\u0628\u0652\u0644\u0650\u0643\u064f\u0645\u0652 \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u062a\u064e\u062a\u0651\u064e\u0642\u064f\u0648\u0646\u064e", "num": 183}
{"line": "\u0623\u064e\u064a\u0651\u064e\u0627\u0645\u064b\u06ed\u0627 \u0645\u0651\u064e\u0639\u0652\u062f\u064f\u0648\u062f\u064e\u0670\u062a\u064d\u06e2 \u06da \u0641\u064e\u0645\u064e\u0646 \u0643\u064e\u0627\u0646\u064e \u0645\u0650\u0646\u0643\u064f\u0645 \u0645\u0651\u064e\u0631\u0650\u064a\u0636\u064b\u0627 \u0623\u064e\u0648\u0652 \u0639\u064e\u0644\u064e\u0649\u0670 \u0633\u064e\u0641\u064e\u0631\u064d\u06e2 \u0641\u064e\u0639\u0650\u062f\u0651\u064e\u0629\u064c\u06ed \u0645\u0651\u0650\u0646\u0652 \u0623\u064e\u064a\u0651\u064e\u0627\u0645\u064d \u0623\u064f\u062e\u064e\u0631\u064e \u06da \u0648\u064e\u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064f\u0637\u0650\u064a\u0642\u064f\u0648\u0646\u064e\u0647\u064f\u06e5 \u0641\u0650\u062f\u0652\u064a\u064e\u0629\u064c\u06ed \u0637\u064e\u0639\u064e\u0627\u0645\u064f \u0645\u0650\u0633\u0652\u0643\u0650\u064a\u0646\u064d\u06e2 \u06d6 \u0641\u064e\u0645\u064e\u0646 \u062a\u064e\u0637\u064e\u0648\u0651\u064e\u0639\u064e \u062e\u064e\u064a\u0652\u0631\u064b\u06ed\u0627 \u0641\u064e\u0647\u064f\u0648\u064e \u062e\u064e\u064a\u0652\u0631\u064c\u06ed \u0644\u0651\u064e\u0647\u064f\u06e5 \u06da \u0648\u064e\u0623\u064e\u0646 \u062a\u064e\u0635\u064f\u0648\u0645\u064f\u0648\u0627\u06df \u062e\u064e\u064a\u0652\u0631\u064c\u06ed \u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u06d6 \u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 184}
{"line": "\u0634\u064e\u0647\u0652\u0631\u064f \u0631\u064e\u0645\u064e\u0636\u064e\u0627\u0646\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u0649\u0653 \u0623\u064f\u0646\u0632\u0650\u0644\u064e \u0641\u0650\u064a\u0647\u0650 \u0671\u0644\u0652\u0642\u064f\u0631\u0652\u0621\u064e\u0627\u0646\u064f \u0647\u064f\u062f\u064b\u06ed\u0649 \u0644\u0651\u0650\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0648\u064e\u0628\u064e\u064a\u0651\u0650\u0646\u064e\u0640\u0670\u062a\u064d\u06e2 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0652\u0647\u064f\u062f\u064e\u0649\u0670 \u0648\u064e\u0671\u0644\u0652\u0641\u064f\u0631\u0652\u0642\u064e\u0627\u0646\u0650 \u06da \u0641\u064e\u0645\u064e\u0646 \u0634\u064e\u0647\u0650\u062f\u064e \u0645\u0650\u0646\u0643\u064f\u0645\u064f \u0671\u0644\u0634\u0651\u064e\u0647\u0652\u0631\u064e \u0641\u064e\u0644\u0652\u064a\u064e\u0635\u064f\u0645\u0652\u0647\u064f \u06d6 \u0648\u064e\u0645\u064e\u0646 \u0643\u064e\u0627\u0646\u064e \u0645\u064e\u0631\u0650\u064a\u0636\u064b\u0627 \u0623\u064e\u0648\u0652 \u0639\u064e\u0644\u064e\u0649\u0670 \u0633\u064e\u0641\u064e\u0631\u064d\u06e2 \u0641\u064e\u0639\u0650\u062f\u0651\u064e\u0629\u064c\u06ed \u0645\u0651\u0650\u0646\u0652 \u0623\u064e\u064a\u0651\u064e\u0627\u0645\u064d \u0623\u064f\u062e\u064e\u0631\u064e \u06d7 \u064a\u064f\u0631\u0650\u064a\u062f\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u064a\u064f\u0633\u0652\u0631\u064e \u0648\u064e\u0644\u064e\u0627 \u064a\u064f\u0631\u0650\u064a\u062f\u064f \u0628\u0650\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u0639\u064f\u0633\u0652\u0631\u064e \u0648\u064e\u0644\u0650\u062a\u064f\u0643\u0652\u0645\u0650\u0644\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u0639\u0650\u062f\u0651\u064e\u0629\u064e \u0648\u064e\u0644\u0650\u062a\u064f\u0643\u064e\u0628\u0651\u0650\u0631\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u064e\u0644\u064e\u0649\u0670 \u0645\u064e\u0627 \u0647\u064e\u062f\u064e\u0649\u0670\u0643\u064f\u0645\u0652 \u0648\u064e\u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u062a\u064e\u0634\u0652\u0643\u064f\u0631\u064f\u0648\u0646\u064e", "num": 185}
{"line": "\u0648\u064e\u0625\u0650\u0630\u064e\u0627 \u0633\u064e\u0623\u064e\u0644\u064e\u0643\u064e \u0639\u0650\u0628\u064e\u0627\u062f\u0650\u0649 \u0639\u064e\u0646\u0651\u0650\u0649 \u0641\u064e\u0625\u0650\u0646\u0651\u0650\u0649 \u0642\u064e\u0631\u0650\u064a\u0628\u064c \u06d6 \u0623\u064f\u062c\u0650\u064a\u0628\u064f \u062f\u064e\u0639\u0652\u0648\u064e\u0629\u064e \u0671\u0644\u062f\u0651\u064e\u0627\u0639\u0650 \u0625\u0650\u0630\u064e\u0627 \u062f\u064e\u0639\u064e\u0627\u0646\u0650 \u06d6 \u0641\u064e\u0644\u0652\u064a\u064e\u0633\u0652\u062a\u064e\u062c\u0650\u064a\u0628\u064f\u0648\u0627\u06df \u0644\u0650\u0649 \u0648\u064e\u0644\u0652\u064a\u064f\u0624\u0652\u0645\u0650\u0646\u064f\u0648\u0627\u06df \u0628\u0650\u0649 \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0647\u064f\u0645\u0652 \u064a\u064e\u0631\u0652\u0634\u064f\u062f\u064f\u0648\u0646\u064e", "num": 186}
{"line": "\u0623\u064f\u062d\u0650\u0644\u0651\u064e \u0644\u064e\u0643\u064f\u0645\u0652 \u0644\u064e\u064a\u0652\u0644\u064e\u0629\u064e \u0671\u0644\u0635\u0651\u0650\u064a\u064e\u0627\u0645\u0650 \u0671\u0644\u0631\u0651\u064e\u0641\u064e\u062b\u064f \u0625\u0650\u0644\u064e\u0649\u0670 \u0646\u0650\u0633\u064e\u0627\u0653\u0626\u0650\u0643\u064f\u0645\u0652 \u06da \u0647\u064f\u0646\u0651\u064e \u0644\u0650\u0628\u064e\u0627\u0633\u064c\u06ed \u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u0648\u064e\u0623\u064e\u0646\u062a\u064f\u0645\u0652 \u0644\u0650\u0628\u064e\u0627\u0633\u064c\u06ed \u0644\u0651\u064e\u0647\u064f\u0646\u0651\u064e \u06d7 \u0639\u064e\u0644\u0650\u0645\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0623\u064e\u0646\u0651\u064e\u0643\u064f\u0645\u0652 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u062a\u064e\u062e\u0652\u062a\u064e\u0627\u0646\u064f\u0648\u0646\u064e \u0623\u064e\u0646\u0641\u064f\u0633\u064e\u0643\u064f\u0645\u0652 \u0641\u064e\u062a\u064e\u0627\u0628\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0648\u064e\u0639\u064e\u0641\u064e\u0627 \u0639\u064e\u0646\u0643\u064f\u0645\u0652 \u06d6 \u0641\u064e\u0671\u0644\u0652\u0640\u0654\u064e\u0640\u0670\u0646\u064e \u0628\u064e\u0640\u0670\u0634\u0650\u0631\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u0648\u064e\u0671\u0628\u0652\u062a\u064e\u063a\u064f\u0648\u0627\u06df \u0645\u064e\u0627 \u0643\u064e\u062a\u064e\u0628\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0644\u064e\u0643\u064f\u0645\u0652 \u06da \u0648\u064e\u0643\u064f\u0644\u064f\u0648\u0627\u06df \u0648\u064e\u0671\u0634\u0652\u0631\u064e\u0628\u064f\u0648\u0627\u06df \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u064a\u064e\u062a\u064e\u0628\u064e\u064a\u0651\u064e\u0646\u064e \u0644\u064e\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u062e\u064e\u064a\u0652\u0637\u064f \u0671\u0644\u0652\u0623\u064e\u0628\u0652\u064a\u064e\u0636\u064f \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u062e\u064e\u064a\u0652\u0637\u0650 \u0671\u0644\u0652\u0623\u064e\u0633\u0652\u0648\u064e\u062f\u0650 \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0641\u064e\u062c\u0652\u0631\u0650 \u06d6 \u062b\u064f\u0645\u0651\u064e \u0623\u064e\u062a\u0650\u0645\u0651\u064f\u0648\u0627\u06df \u0671\u0644\u0635\u0651\u0650\u064a\u064e\u0627\u0645\u064e \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0651\u064e\u064a\u0652\u0644\u0650 \u06da \u0648\u064e\u0644\u064e\u0627 \u062a\u064f\u0628\u064e\u0640\u0670\u0634\u0650\u0631\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u0648\u064e\u0623\u064e\u0646\u062a\u064f\u0645\u0652 \u0639\u064e\u0640\u0670\u0643\u0650\u0641\u064f\u0648\u0646\u064e \u0641\u0650\u0649 \u0671\u0644\u0652\u0645\u064e\u0633\u064e\u0640\u0670\u062c\u0650\u062f\u0650 \u06d7 \u062a\u0650\u0644\u0652\u0643\u064e \u062d\u064f\u062f\u064f\u0648\u062f\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0641\u064e\u0644\u064e\u0627 \u062a\u064e\u0642\u0652\u0631\u064e\u0628\u064f\u0648\u0647\u064e\u0627 \u06d7 \u0643\u064e\u0630\u064e\u0670\u0644\u0650\u0643\u064e \u064a\u064f\u0628\u064e\u064a\u0651\u0650\u0646\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0621\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u0650\u0647\u0650\u06e6 \u0644\u0650\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0647\u064f\u0645\u0652 \u064a\u064e\u062a\u0651\u064e\u0642\u064f\u0648\u0646\u064e", "num": 187}
{"line": "\u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0623\u0652\u0643\u064f\u0644\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0645\u0652\u0648\u064e\u0670\u0644\u064e\u0643\u064f\u0645 \u0628\u064e\u064a\u0652\u0646\u064e\u0643\u064f\u0645 \u0628\u0650\u0671\u0644\u0652\u0628\u064e\u0640\u0670\u0637\u0650\u0644\u0650 \u0648\u064e\u062a\u064f\u062f\u0652\u0644\u064f\u0648\u0627\u06df \u0628\u0650\u0647\u064e\u0627\u0653 \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0652\u062d\u064f\u0643\u0651\u064e\u0627\u0645\u0650 \u0644\u0650\u062a\u064e\u0623\u0652\u0643\u064f\u0644\u064f\u0648\u0627\u06df \u0641\u064e\u0631\u0650\u064a\u0642\u064b\u06ed\u0627 \u0645\u0651\u0650\u0646\u0652 \u0623\u064e\u0645\u0652\u0648\u064e\u0670\u0644\u0650 \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0628\u0650\u0671\u0644\u0652\u0625\u0650\u062b\u0652\u0645\u0650 \u0648\u064e\u0623\u064e\u0646\u062a\u064f\u0645\u0652 \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 188}
{"line": "\u06de \u064a\u064e\u0633\u0652\u0640\u0654\u064e\u0644\u064f\u0648\u0646\u064e\u0643\u064e \u0639\u064e\u0646\u0650 \u0671\u0644\u0652\u0623\u064e\u0647\u0650\u0644\u0651\u064e\u0629\u0650 \u06d6 \u0642\u064f\u0644\u0652 \u0647\u0650\u0649\u064e \u0645\u064e\u0648\u064e\u0670\u0642\u0650\u064a\u062a\u064f \u0644\u0650\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0648\u064e\u0671\u0644\u0652\u062d\u064e\u062c\u0651\u0650 \u06d7 \u0648\u064e\u0644\u064e\u064a\u0652\u0633\u064e \u0671\u0644\u0652\u0628\u0650\u0631\u0651\u064f \u0628\u0650\u0623\u064e\u0646 \u062a\u064e\u0623\u0652\u062a\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u0628\u064f\u064a\u064f\u0648\u062a\u064e \u0645\u0650\u0646 \u0638\u064f\u0647\u064f\u0648\u0631\u0650\u0647\u064e\u0627 \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646\u0651\u064e \u0671\u0644\u0652\u0628\u0650\u0631\u0651\u064e \u0645\u064e\u0646\u0650 \u0671\u062a\u0651\u064e\u0642\u064e\u0649\u0670 \u06d7 \u0648\u064e\u0623\u0652\u062a\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u0628\u064f\u064a\u064f\u0648\u062a\u064e \u0645\u0650\u0646\u0652 \u0623\u064e\u0628\u0652\u0648\u064e\u0670\u0628\u0650\u0647\u064e\u0627 \u06da \u0648\u064e\u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u062a\u064f\u0641\u0652\u0644\u0650\u062d\u064f\u0648\u0646\u064e", "num": 189}
{"line": "\u0648\u064e\u0642\u064e\u0640\u0670\u062a\u0650\u0644\u064f\u0648\u0627\u06df \u0641\u0650\u0649 \u0633\u064e\u0628\u0650\u064a\u0644\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064f\u0642\u064e\u0640\u0670\u062a\u0650\u0644\u064f\u0648\u0646\u064e\u0643\u064f\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0639\u0652\u062a\u064e\u062f\u064f\u0648\u0653\u0627\u06df \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0644\u064e\u0627 \u064a\u064f\u062d\u0650\u0628\u0651\u064f \u0671\u0644\u0652\u0645\u064f\u0639\u0652\u062a\u064e\u062f\u0650\u064a\u0646\u064e", "num": 190}
{"line": "\u0648\u064e\u0671\u0642\u0652\u062a\u064f\u0644\u064f\u0648\u0647\u064f\u0645\u0652 \u062d\u064e\u064a\u0652\u062b\u064f \u062b\u064e\u0642\u0650\u0641\u0652\u062a\u064f\u0645\u064f\u0648\u0647\u064f\u0645\u0652 \u0648\u064e\u0623\u064e\u062e\u0652\u0631\u0650\u062c\u064f\u0648\u0647\u064f\u0645 \u0645\u0651\u0650\u0646\u0652 \u062d\u064e\u064a\u0652\u062b\u064f \u0623\u064e\u062e\u0652\u0631\u064e\u062c\u064f\u0648\u0643\u064f\u0645\u0652 \u06da \u0648\u064e\u0671\u0644\u0652\u0641\u0650\u062a\u0652\u0646\u064e\u0629\u064f \u0623\u064e\u0634\u064e\u062f\u0651\u064f \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0642\u064e\u062a\u0652\u0644\u0650 \u06da \u0648\u064e\u0644\u064e\u0627 \u062a\u064f\u0642\u064e\u0640\u0670\u062a\u0650\u0644\u064f\u0648\u0647\u064f\u0645\u0652 \u0639\u0650\u0646\u062f\u064e \u0671\u0644\u0652\u0645\u064e\u0633\u0652\u062c\u0650\u062f\u0650 \u0671\u0644\u0652\u062d\u064e\u0631\u064e\u0627\u0645\u0650 \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u064a\u064f\u0642\u064e\u0640\u0670\u062a\u0650\u0644\u064f\u0648\u0643\u064f\u0645\u0652 \u0641\u0650\u064a\u0647\u0650 \u06d6 \u0641\u064e\u0625\u0650\u0646 \u0642\u064e\u0640\u0670\u062a\u064e\u0644\u064f\u0648\u0643\u064f\u0645\u0652 \u0641\u064e\u0671\u0642\u0652\u062a\u064f\u0644\u064f\u0648\u0647\u064f\u0645\u0652 \u06d7 \u0643\u064e\u0630\u064e\u0670\u0644\u0650\u0643\u064e \u062c\u064e\u0632\u064e\u0627\u0653\u0621\u064f \u0671\u0644\u0652\u0643\u064e\u0640\u0670\u0641\u0650\u0631\u0650\u064a\u0646\u064e", "num": 191}
{"line": "\u0641\u064e\u0625\u0650\u0646\u0650 \u0671\u0646\u062a\u064e\u0647\u064e\u0648\u0652\u0627\u06df \u0641\u064e\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u063a\u064e\u0641\u064f\u0648\u0631\u064c\u06ed \u0631\u0651\u064e\u062d\u0650\u064a\u0645\u064c\u06ed", "num": 192}
{"line": "\u0648\u064e\u0642\u064e\u0640\u0670\u062a\u0650\u0644\u064f\u0648\u0647\u064f\u0645\u0652 \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u0644\u064e\u0627 \u062a\u064e\u0643\u064f\u0648\u0646\u064e \u0641\u0650\u062a\u0652\u0646\u064e\u0629\u064c\u06ed \u0648\u064e\u064a\u064e\u0643\u064f\u0648\u0646\u064e \u0671\u0644\u062f\u0651\u0650\u064a\u0646\u064f \u0644\u0650\u0644\u0651\u064e\u0647\u0650 \u06d6 \u0641\u064e\u0625\u0650\u0646\u0650 \u0671\u0646\u062a\u064e\u0647\u064e\u0648\u0652\u0627\u06df \u0641\u064e\u0644\u064e\u0627 \u0639\u064f\u062f\u0652\u0648\u064e\u0670\u0646\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0638\u0651\u064e\u0640\u0670\u0644\u0650\u0645\u0650\u064a\u0646\u064e", "num": 193}
{"line": "\u0671\u0644\u0634\u0651\u064e\u0647\u0652\u0631\u064f \u0671\u0644\u0652\u062d\u064e\u0631\u064e\u0627\u0645\u064f \u0628\u0650\u0671\u0644\u0634\u0651\u064e\u0647\u0652\u0631\u0650 \u0671\u0644\u0652\u062d\u064e\u0631\u064e\u0627\u0645\u0650 \u0648\u064e\u0671\u0644\u0652\u062d\u064f\u0631\u064f\u0645\u064e\u0640\u0670\u062a\u064f \u0642\u0650\u0635\u064e\u0627\u0635\u064c\u06ed \u06da \u0641\u064e\u0645\u064e\u0646\u0650 \u0671\u0639\u0652\u062a\u064e\u062f\u064e\u0649\u0670 \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0641\u064e\u0671\u0639\u0652\u062a\u064e\u062f\u064f\u0648\u0627\u06df \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0628\u0650\u0645\u0650\u062b\u0652\u0644\u0650 \u0645\u064e\u0627 \u0671\u0639\u0652\u062a\u064e\u062f\u064e\u0649\u0670 \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u06da \u0648\u064e\u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0648\u064e\u0671\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0645\u064e\u0639\u064e \u0671\u0644\u0652\u0645\u064f\u062a\u0651\u064e\u0642\u0650\u064a\u0646\u064e", "num": 194}
{"line": "\u0648\u064e\u0623\u064e\u0646\u0641\u0650\u0642\u064f\u0648\u0627\u06df \u0641\u0650\u0649 \u0633\u064e\u0628\u0650\u064a\u0644\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0644\u064e\u0627 \u062a\u064f\u0644\u0652\u0642\u064f\u0648\u0627\u06df \u0628\u0650\u0623\u064e\u064a\u0652\u062f\u0650\u064a\u0643\u064f\u0645\u0652 \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u062a\u0651\u064e\u0647\u0652\u0644\u064f\u0643\u064e\u0629\u0650 \u06db \u0648\u064e\u0623\u064e\u062d\u0652\u0633\u0650\u0646\u064f\u0648\u0653\u0627\u06df \u06db \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u064a\u064f\u062d\u0650\u0628\u0651\u064f \u0671\u0644\u0652\u0645\u064f\u062d\u0652\u0633\u0650\u0646\u0650\u064a\u0646\u064e", "num": 195}
{"line": "\u0648\u064e\u0623\u064e\u062a\u0650\u0645\u0651\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u062d\u064e\u062c\u0651\u064e \u0648\u064e\u0671\u0644\u0652\u0639\u064f\u0645\u0652\u0631\u064e\u0629\u064e \u0644\u0650\u0644\u0651\u064e\u0647\u0650 \u06da \u0641\u064e\u0625\u0650\u0646\u0652 \u0623\u064f\u062d\u0652\u0635\u0650\u0631\u0652\u062a\u064f\u0645\u0652 \u0641\u064e\u0645\u064e\u0627 \u0671\u0633\u0652\u062a\u064e\u064a\u0652\u0633\u064e\u0631\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0647\u064e\u062f\u0652\u0649\u0650 \u06d6 \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u062d\u0652\u0644\u0650\u0642\u064f\u0648\u0627\u06df \u0631\u064f\u0621\u064f\u0648\u0633\u064e\u0643\u064f\u0645\u0652 \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u064a\u064e\u0628\u0652\u0644\u064f\u063a\u064e \u0671\u0644\u0652\u0647\u064e\u062f\u0652\u0649\u064f \u0645\u064e\u062d\u0650\u0644\u0651\u064e\u0647\u064f\u06e5 \u06da \u0641\u064e\u0645\u064e\u0646 \u0643\u064e\u0627\u0646\u064e \u0645\u0650\u0646\u0643\u064f\u0645 \u0645\u0651\u064e\u0631\u0650\u064a\u0636\u064b\u0627 \u0623\u064e\u0648\u0652 \u0628\u0650\u0647\u0650\u06e6\u0653 \u0623\u064e\u0630\u064b\u06ed\u0649 \u0645\u0651\u0650\u0646 \u0631\u0651\u064e\u0623\u0652\u0633\u0650\u0647\u0650\u06e6 \u0641\u064e\u0641\u0650\u062f\u0652\u064a\u064e\u0629\u064c\u06ed \u0645\u0651\u0650\u0646 \u0635\u0650\u064a\u064e\u0627\u0645\u064d \u0623\u064e\u0648\u0652 \u0635\u064e\u062f\u064e\u0642\u064e\u0629\u064d \u0623\u064e\u0648\u0652 \u0646\u064f\u0633\u064f\u0643\u064d\u06e2 \u06da \u0641\u064e\u0625\u0650\u0630\u064e\u0627\u0653 \u0623\u064e\u0645\u0650\u0646\u062a\u064f\u0645\u0652 \u0641\u064e\u0645\u064e\u0646 \u062a\u064e\u0645\u064e\u062a\u0651\u064e\u0639\u064e \u0628\u0650\u0671\u0644\u0652\u0639\u064f\u0645\u0652\u0631\u064e\u0629\u0650 \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0652\u062d\u064e\u062c\u0651\u0650 \u0641\u064e\u0645\u064e\u0627 \u0671\u0633\u0652\u062a\u064e\u064a\u0652\u0633\u064e\u0631\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0647\u064e\u062f\u0652\u0649\u0650 \u06da \u0641\u064e\u0645\u064e\u0646 \u0644\u0651\u064e\u0645\u0652 \u064a\u064e\u062c\u0650\u062f\u0652 \u0641\u064e\u0635\u0650\u064a\u064e\u0627\u0645\u064f \u062b\u064e\u0644\u064e\u0640\u0670\u062b\u064e\u0629\u0650 \u0623\u064e\u064a\u0651\u064e\u0627\u0645\u064d\u06e2 \u0641\u0650\u0649 \u0671\u0644\u0652\u062d\u064e\u062c\u0651\u0650 \u0648\u064e\u0633\u064e\u0628\u0652\u0639\u064e\u0629\u064d \u0625\u0650\u0630\u064e\u0627 \u0631\u064e\u062c\u064e\u0639\u0652\u062a\u064f\u0645\u0652 \u06d7 \u062a\u0650\u0644\u0652\u0643\u064e \u0639\u064e\u0634\u064e\u0631\u064e\u0629\u064c\u06ed \u0643\u064e\u0627\u0645\u0650\u0644\u064e\u0629\u064c\u06ed \u06d7 \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u0644\u0650\u0645\u064e\u0646 \u0644\u0651\u064e\u0645\u0652 \u064a\u064e\u0643\u064f\u0646\u0652 \u0623\u064e\u0647\u0652\u0644\u064f\u0647\u064f\u06e5 \u062d\u064e\u0627\u0636\u0650\u0631\u0650\u0649 \u0671\u0644\u0652\u0645\u064e\u0633\u0652\u062c\u0650\u062f\u0650 \u0671\u0644\u0652\u062d\u064e\u0631\u064e\u0627\u0645\u0650 \u06da \u0648\u064e\u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0648\u064e\u0671\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0634\u064e\u062f\u0650\u064a\u062f\u064f \u0671\u0644\u0652\u0639\u0650\u0642\u064e\u0627\u0628\u0650", "num": 196}
{"line": "\u0671\u0644\u0652\u062d\u064e\u062c\u0651\u064f \u0623\u064e\u0634\u0652\u0647\u064f\u0631\u064c\u06ed \u0645\u0651\u064e\u0639\u0652\u0644\u064f\u0648\u0645\u064e\u0640\u0670\u062a\u064c\u06ed \u06da \u0641\u064e\u0645\u064e\u0646 \u0641\u064e\u0631\u064e\u0636\u064e \u0641\u0650\u064a\u0647\u0650\u0646\u0651\u064e \u0671\u0644\u0652\u062d\u064e\u062c\u0651\u064e \u0641\u064e\u0644\u064e\u0627 \u0631\u064e\u0641\u064e\u062b\u064e \u0648\u064e\u0644\u064e\u0627 \u0641\u064f\u0633\u064f\u0648\u0642\u064e \u0648\u064e\u0644\u064e\u0627 \u062c\u0650\u062f\u064e\u0627\u0644\u064e \u0641\u0650\u0649 \u0671\u0644\u0652\u062d\u064e\u062c\u0651\u0650 \u06d7 \u0648\u064e\u0645\u064e\u0627 \u062a\u064e\u0641\u0652\u0639\u064e\u0644\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u0652 \u062e\u064e\u064a\u0652\u0631\u064d\u06e2 \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u0652\u0647\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u06d7 \u0648\u064e\u062a\u064e\u0632\u064e\u0648\u0651\u064e\u062f\u064f\u0648\u0627\u06df \u0641\u064e\u0625\u0650\u0646\u0651\u064e \u062e\u064e\u064a\u0652\u0631\u064e \u0671\u0644\u0632\u0651\u064e\u0627\u062f\u0650 \u0671\u0644\u062a\u0651\u064e\u0642\u0652\u0648\u064e\u0649\u0670 \u06da \u0648\u064e\u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0646\u0650 \u064a\u064e\u0640\u0670\u0653\u0623\u064f\u0648\u06df\u0644\u0650\u0649 \u0671\u0644\u0652\u0623\u064e\u0644\u0652\u0628\u064e\u0640\u0670\u0628\u0650", "num": 197}
{"line": "\u0644\u064e\u064a\u0652\u0633\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u062c\u064f\u0646\u064e\u0627\u062d\u064c \u0623\u064e\u0646 \u062a\u064e\u0628\u0652\u062a\u064e\u063a\u064f\u0648\u0627\u06df \u0641\u064e\u0636\u0652\u0644\u064b\u06ed\u0627 \u0645\u0651\u0650\u0646 \u0631\u0651\u064e\u0628\u0651\u0650\u0643\u064f\u0645\u0652 \u06da \u0641\u064e\u0625\u0650\u0630\u064e\u0627\u0653 \u0623\u064e\u0641\u064e\u0636\u0652\u062a\u064f\u0645 \u0645\u0651\u0650\u0646\u0652 \u0639\u064e\u0631\u064e\u0641\u064e\u0640\u0670\u062a\u064d\u06e2 \u0641\u064e\u0671\u0630\u0652\u0643\u064f\u0631\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u0650\u0646\u062f\u064e \u0671\u0644\u0652\u0645\u064e\u0634\u0652\u0639\u064e\u0631\u0650 \u0671\u0644\u0652\u062d\u064e\u0631\u064e\u0627\u0645\u0650 \u06d6 \u0648\u064e\u0671\u0630\u0652\u0643\u064f\u0631\u064f\u0648\u0647\u064f \u0643\u064e\u0645\u064e\u0627 \u0647\u064e\u062f\u064e\u0649\u0670\u0643\u064f\u0645\u0652 \u0648\u064e\u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645 \u0645\u0651\u0650\u0646 \u0642\u064e\u0628\u0652\u0644\u0650\u0647\u0650\u06e6 \u0644\u064e\u0645\u0650\u0646\u064e \u0671\u0644\u0636\u0651\u064e\u0627\u0653\u0644\u0651\u0650\u064a\u0646\u064e", "num": 198}
{"line": "\u062b\u064f\u0645\u0651\u064e \u0623\u064e\u0641\u0650\u064a\u0636\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u0652 \u062d\u064e\u064a\u0652\u062b\u064f \u0623\u064e\u0641\u064e\u0627\u0636\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u064f \u0648\u064e\u0671\u0633\u0652\u062a\u064e\u063a\u0652\u0641\u0650\u0631\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u063a\u064e\u0641\u064f\u0648\u0631\u064c\u06ed \u0631\u0651\u064e\u062d\u0650\u064a\u0645\u064c\u06ed", "num": 199}
{"line": "\u0641\u064e\u0625\u0650\u0630\u064e\u0627 \u0642\u064e\u0636\u064e\u064a\u0652\u062a\u064f\u0645 \u0645\u0651\u064e\u0646\u064e\u0640\u0670\u0633\u0650\u0643\u064e\u0643\u064f\u0645\u0652 \u0641\u064e\u0671\u0630\u0652\u0643\u064f\u0631\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0643\u064e\u0630\u0650\u0643\u0652\u0631\u0650\u0643\u064f\u0645\u0652 \u0621\u064e\u0627\u0628\u064e\u0627\u0653\u0621\u064e\u0643\u064f\u0645\u0652 \u0623\u064e\u0648\u0652 \u0623\u064e\u0634\u064e\u062f\u0651\u064e \u0630\u0650\u0643\u0652\u0631\u064b\u06ed\u0627 \u06d7 \u0641\u064e\u0645\u0650\u0646\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0645\u064e\u0646 \u064a\u064e\u0642\u064f\u0648\u0644\u064f \u0631\u064e\u0628\u0651\u064e\u0646\u064e\u0627\u0653 \u0621\u064e\u0627\u062a\u0650\u0646\u064e\u0627 \u0641\u0650\u0649 \u0671\u0644\u062f\u0651\u064f\u0646\u0652\u064a\u064e\u0627 \u0648\u064e\u0645\u064e\u0627 \u0644\u064e\u0647\u064f\u06e5 \u0641\u0650\u0649 \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u064e\u0629\u0650 \u0645\u0650\u0646\u0652 \u062e\u064e\u0644\u064e\u0640\u0670\u0642\u064d\u06e2", "num": 200}
{"line": "\u0648\u064e\u0645\u0650\u0646\u0652\u0647\u064f\u0645 \u0645\u0651\u064e\u0646 \u064a\u064e\u0642\u064f\u0648\u0644\u064f \u0631\u064e\u0628\u0651\u064e\u0646\u064e\u0627\u0653 \u0621\u064e\u0627\u062a\u0650\u0646\u064e\u0627 \u0641\u0650\u0649 \u0671\u0644\u062f\u0651\u064f\u0646\u0652\u064a\u064e\u0627 \u062d\u064e\u0633\u064e\u0646\u064e\u0629\u064b\u06ed \u0648\u064e\u0641\u0650\u0649 \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u064e\u0629\u0650 \u062d\u064e\u0633\u064e\u0646\u064e\u0629\u064b\u06ed \u0648\u064e\u0642\u0650\u0646\u064e\u0627 \u0639\u064e\u0630\u064e\u0627\u0628\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u0650", "num": 201}
{"line": "\u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0644\u064e\u0647\u064f\u0645\u0652 \u0646\u064e\u0635\u0650\u064a\u0628\u064c\u06ed \u0645\u0651\u0650\u0645\u0651\u064e\u0627 \u0643\u064e\u0633\u064e\u0628\u064f\u0648\u0627\u06df \u06da \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0633\u064e\u0631\u0650\u064a\u0639\u064f \u0671\u0644\u0652\u062d\u0650\u0633\u064e\u0627\u0628\u0650", "num": 202}
{"line": "\u06de \u0648\u064e\u0671\u0630\u0652\u0643\u064f\u0631\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0641\u0650\u0649\u0653 \u0623\u064e\u064a\u0651\u064e\u0627\u0645\u064d\u06e2 \u0645\u0651\u064e\u0639\u0652\u062f\u064f\u0648\u062f\u064e\u0670\u062a\u064d\u06e2 \u06da \u0641\u064e\u0645\u064e\u0646 \u062a\u064e\u0639\u064e\u062c\u0651\u064e\u0644\u064e \u0641\u0650\u0649 \u064a\u064e\u0648\u0652\u0645\u064e\u064a\u0652\u0646\u0650 \u0641\u064e\u0644\u064e\u0627\u0653 \u0625\u0650\u062b\u0652\u0645\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0648\u064e\u0645\u064e\u0646 \u062a\u064e\u0623\u064e\u062e\u0651\u064e\u0631\u064e \u0641\u064e\u0644\u064e\u0627\u0653 \u0625\u0650\u062b\u0652\u0645\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u06da \u0644\u0650\u0645\u064e\u0646\u0650 \u0671\u062a\u0651\u064e\u0642\u064e\u0649\u0670 \u06d7 \u0648\u064e\u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0648\u064e\u0671\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0651\u064e\u0643\u064f\u0645\u0652 \u0625\u0650\u0644\u064e\u064a\u0652\u0647\u0650 \u062a\u064f\u062d\u0652\u0634\u064e\u0631\u064f\u0648\u0646\u064e", "num": 203}
{"line": "\u0648\u064e\u0645\u0650\u0646\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0645\u064e\u0646 \u064a\u064f\u0639\u0652\u062c\u0650\u0628\u064f\u0643\u064e \u0642\u064e\u0648\u0652\u0644\u064f\u0647\u064f\u06e5 \u0641\u0650\u0649 \u0671\u0644\u0652\u062d\u064e\u064a\u064e\u0648\u0670\u0629\u0650 \u0671\u0644\u062f\u0651\u064f\u0646\u0652\u064a\u064e\u0627 \u0648\u064e\u064a\u064f\u0634\u0652\u0647\u0650\u062f\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u064e\u0644\u064e\u0649\u0670 \u0645\u064e\u0627 \u0641\u0650\u0649 \u0642\u064e\u0644\u0652\u0628\u0650\u0647\u0650\u06e6 \u0648\u064e\u0647\u064f\u0648\u064e \u0623\u064e\u0644\u064e\u062f\u0651\u064f \u0671\u0644\u0652\u062e\u0650\u0635\u064e\u0627\u0645\u0650", "num": 204}
{"line": "\u0648\u064e\u0625\u0650\u0630\u064e\u0627 \u062a\u064e\u0648\u064e\u0644\u0651\u064e\u0649\u0670 \u0633\u064e\u0639\u064e\u0649\u0670 \u0641\u0650\u0649 \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u0644\u0650\u064a\u064f\u0641\u0652\u0633\u0650\u062f\u064e \u0641\u0650\u064a\u0647\u064e\u0627 \u0648\u064e\u064a\u064f\u0647\u0652\u0644\u0650\u0643\u064e \u0671\u0644\u0652\u062d\u064e\u0631\u0652\u062b\u064e \u0648\u064e\u0671\u0644\u0646\u0651\u064e\u0633\u0652\u0644\u064e \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0644\u064e\u0627 \u064a\u064f\u062d\u0650\u0628\u0651\u064f \u0671\u0644\u0652\u0641\u064e\u0633\u064e\u0627\u062f\u064e", "num": 205}
{"line": "\u0648\u064e\u0625\u0650\u0630\u064e\u0627 \u0642\u0650\u064a\u0644\u064e \u0644\u064e\u0647\u064f \u0671\u062a\u0651\u064e\u0642\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0623\u064e\u062e\u064e\u0630\u064e\u062a\u0652\u0647\u064f \u0671\u0644\u0652\u0639\u0650\u0632\u0651\u064e\u0629\u064f \u0628\u0650\u0671\u0644\u0652\u0625\u0650\u062b\u0652\u0645\u0650 \u06da \u0641\u064e\u062d\u064e\u0633\u0652\u0628\u064f\u0647\u064f\u06e5 \u062c\u064e\u0647\u064e\u0646\u0651\u064e\u0645\u064f \u06da \u0648\u064e\u0644\u064e\u0628\u0650\u0626\u0652\u0633\u064e \u0671\u0644\u0652\u0645\u0650\u0647\u064e\u0627\u062f\u064f", "num": 206}
{"line": "\u0648\u064e\u0645\u0650\u0646\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0645\u064e\u0646 \u064a\u064e\u0634\u0652\u0631\u0650\u0649 \u0646\u064e\u0641\u0652\u0633\u064e\u0647\u064f \u0671\u0628\u0652\u062a\u0650\u063a\u064e\u0627\u0653\u0621\u064e \u0645\u064e\u0631\u0652\u0636\u064e\u0627\u062a\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0631\u064e\u0621\u064f\u0648\u0641\u064c\u06e2 \u0628\u0650\u0671\u0644\u0652\u0639\u0650\u0628\u064e\u0627\u062f\u0650", "num": 207}
{"line": "\u064a\u064e\u0640\u0670\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0671\u062f\u0652\u062e\u064f\u0644\u064f\u0648\u0627\u06df \u0641\u0650\u0649 \u0671\u0644\u0633\u0651\u0650\u0644\u0652\u0645\u0650 \u0643\u064e\u0627\u0653\u0641\u0651\u064e\u0629\u064b\u06ed \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u062a\u0651\u064e\u0628\u0650\u0639\u064f\u0648\u0627\u06df \u062e\u064f\u0637\u064f\u0648\u064e\u0670\u062a\u0650 \u0671\u0644\u0634\u0651\u064e\u064a\u0652\u0637\u064e\u0640\u0670\u0646\u0650 \u06da \u0625\u0650\u0646\u0651\u064e\u0647\u064f\u06e5 \u0644\u064e\u0643\u064f\u0645\u0652 \u0639\u064e\u062f\u064f\u0648\u0651\u064c\u06ed \u0645\u0651\u064f\u0628\u0650\u064a\u0646\u064c\u06ed", "num": 208}
{"line": "\u0641\u064e\u0625\u0650\u0646 \u0632\u064e\u0644\u064e\u0644\u0652\u062a\u064f\u0645 \u0645\u0651\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0645\u064e\u0627 \u062c\u064e\u0627\u0653\u0621\u064e\u062a\u0652\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u0628\u064e\u064a\u0651\u0650\u0646\u064e\u0640\u0670\u062a\u064f \u0641\u064e\u0671\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u064e\u0632\u0650\u064a\u0632\u064c \u062d\u064e\u0643\u0650\u064a\u0645\u064c", "num": 209}
{"line": "\u0647\u064e\u0644\u0652 \u064a\u064e\u0646\u0638\u064f\u0631\u064f\u0648\u0646\u064e \u0625\u0650\u0644\u0651\u064e\u0627\u0653 \u0623\u064e\u0646 \u064a\u064e\u0623\u0652\u062a\u0650\u064a\u064e\u0647\u064f\u0645\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0641\u0650\u0649 \u0638\u064f\u0644\u064e\u0644\u064d\u06e2 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0652\u063a\u064e\u0645\u064e\u0627\u0645\u0650 \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e\u0629\u064f \u0648\u064e\u0642\u064f\u0636\u0650\u0649\u064e \u0671\u0644\u0652\u0623\u064e\u0645\u0652\u0631\u064f \u06da \u0648\u064e\u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u062a\u064f\u0631\u0652\u062c\u064e\u0639\u064f \u0671\u0644\u0652\u0623\u064f\u0645\u064f\u0648\u0631\u064f", "num": 210}
{"line": "\u0633\u064e\u0644\u0652 \u0628\u064e\u0646\u0650\u0649\u0653 \u0625\u0650\u0633\u0652\u0631\u064e\u0670\u0653\u0621\u0650\u064a\u0644\u064e \u0643\u064e\u0645\u0652 \u0621\u064e\u0627\u062a\u064e\u064a\u0652\u0646\u064e\u0640\u0670\u0647\u064f\u0645 \u0645\u0651\u0650\u0646\u0652 \u0621\u064e\u0627\u064a\u064e\u0629\u064d\u06ed \u0628\u064e\u064a\u0651\u0650\u0646\u064e\u0629\u064d\u06e2 \u06d7 \u0648\u064e\u0645\u064e\u0646 \u064a\u064f\u0628\u064e\u062f\u0651\u0650\u0644\u0652 \u0646\u0650\u0639\u0652\u0645\u064e\u0629\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0645\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0645\u064e\u0627 \u062c\u064e\u0627\u0653\u0621\u064e\u062a\u0652\u0647\u064f \u0641\u064e\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0634\u064e\u062f\u0650\u064a\u062f\u064f \u0671\u0644\u0652\u0639\u0650\u0642\u064e\u0627\u0628\u0650", "num": 211}
{"line": "\u0632\u064f\u064a\u0651\u0650\u0646\u064e \u0644\u0650\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0643\u064e\u0641\u064e\u0631\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u062d\u064e\u064a\u064e\u0648\u0670\u0629\u064f \u0671\u0644\u062f\u0651\u064f\u0646\u0652\u064a\u064e\u0627 \u0648\u064e\u064a\u064e\u0633\u0652\u062e\u064e\u0631\u064f\u0648\u0646\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u06d8 \u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0671\u062a\u0651\u064e\u0642\u064e\u0648\u0652\u0627\u06df \u0641\u064e\u0648\u0652\u0642\u064e\u0647\u064f\u0645\u0652 \u064a\u064e\u0648\u0652\u0645\u064e \u0671\u0644\u0652\u0642\u0650\u064a\u064e\u0640\u0670\u0645\u064e\u0629\u0650 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064e\u0631\u0652\u0632\u064f\u0642\u064f \u0645\u064e\u0646 \u064a\u064e\u0634\u064e\u0627\u0653\u0621\u064f \u0628\u0650\u063a\u064e\u064a\u0652\u0631\u0650 \u062d\u0650\u0633\u064e\u0627\u0628\u064d\u06e2", "num": 212}
{"line": "\u0643\u064e\u0627\u0646\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u064f \u0623\u064f\u0645\u0651\u064e\u0629\u064b\u06ed \u0648\u064e\u0670\u062d\u0650\u062f\u064e\u0629\u064b\u06ed \u0641\u064e\u0628\u064e\u0639\u064e\u062b\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0671\u0644\u0646\u0651\u064e\u0628\u0650\u064a\u0651\u0650\u0640\u06e7\u0646\u064e \u0645\u064f\u0628\u064e\u0634\u0651\u0650\u0631\u0650\u064a\u0646\u064e \u0648\u064e\u0645\u064f\u0646\u0630\u0650\u0631\u0650\u064a\u0646\u064e \u0648\u064e\u0623\u064e\u0646\u0632\u064e\u0644\u064e \u0645\u064e\u0639\u064e\u0647\u064f\u0645\u064f \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064e \u0628\u0650\u0671\u0644\u0652\u062d\u064e\u0642\u0651\u0650 \u0644\u0650\u064a\u064e\u062d\u0652\u0643\u064f\u0645\u064e \u0628\u064e\u064a\u0652\u0646\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0641\u0650\u064a\u0645\u064e\u0627 \u0671\u062e\u0652\u062a\u064e\u0644\u064e\u0641\u064f\u0648\u0627\u06df \u0641\u0650\u064a\u0647\u0650 \u06da \u0648\u064e\u0645\u064e\u0627 \u0671\u062e\u0652\u062a\u064e\u0644\u064e\u0641\u064e \u0641\u0650\u064a\u0647\u0650 \u0625\u0650\u0644\u0651\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0623\u064f\u0648\u062a\u064f\u0648\u0647\u064f \u0645\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0645\u064e\u0627 \u062c\u064e\u0627\u0653\u0621\u064e\u062a\u0652\u0647\u064f\u0645\u064f \u0671\u0644\u0652\u0628\u064e\u064a\u0651\u0650\u0646\u064e\u0640\u0670\u062a\u064f \u0628\u064e\u063a\u0652\u064a\u064b\u06e2\u0627 \u0628\u064e\u064a\u0652\u0646\u064e\u0647\u064f\u0645\u0652 \u06d6 \u0641\u064e\u0647\u064e\u062f\u064e\u0649 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0644\u0650\u0645\u064e\u0627 \u0671\u062e\u0652\u062a\u064e\u0644\u064e\u0641\u064f\u0648\u0627\u06df \u0641\u0650\u064a\u0647\u0650 \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u062d\u064e\u0642\u0651\u0650 \u0628\u0650\u0625\u0650\u0630\u0652\u0646\u0650\u0647\u0650\u06e6 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064e\u0647\u0652\u062f\u0650\u0649 \u0645\u064e\u0646 \u064a\u064e\u0634\u064e\u0627\u0653\u0621\u064f \u0625\u0650\u0644\u064e\u0649\u0670 \u0635\u0650\u0631\u064e\u0670\u0637\u064d\u06e2 \u0645\u0651\u064f\u0633\u0652\u062a\u064e\u0642\u0650\u064a\u0645\u064d", "num": 213}
{"line": "\u0623\u064e\u0645\u0652 \u062d\u064e\u0633\u0650\u0628\u0652\u062a\u064f\u0645\u0652 \u0623\u064e\u0646 \u062a\u064e\u062f\u0652\u062e\u064f\u0644\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u062c\u064e\u0646\u0651\u064e\u0629\u064e \u0648\u064e\u0644\u064e\u0645\u0651\u064e\u0627 \u064a\u064e\u0623\u0652\u062a\u0650\u0643\u064f\u0645 \u0645\u0651\u064e\u062b\u064e\u0644\u064f \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u062e\u064e\u0644\u064e\u0648\u0652\u0627\u06df \u0645\u0650\u0646 \u0642\u064e\u0628\u0652\u0644\u0650\u0643\u064f\u0645 \u06d6 \u0645\u0651\u064e\u0633\u0651\u064e\u062a\u0652\u0647\u064f\u0645\u064f \u0671\u0644\u0652\u0628\u064e\u0623\u0652\u0633\u064e\u0627\u0653\u0621\u064f \u0648\u064e\u0671\u0644\u0636\u0651\u064e\u0631\u0651\u064e\u0627\u0653\u0621\u064f \u0648\u064e\u0632\u064f\u0644\u0652\u0632\u0650\u0644\u064f\u0648\u0627\u06df \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u064a\u064e\u0642\u064f\u0648\u0644\u064e \u0671\u0644\u0631\u0651\u064e\u0633\u064f\u0648\u0644\u064f \u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0645\u064e\u0639\u064e\u0647\u064f\u06e5 \u0645\u064e\u062a\u064e\u0649\u0670 \u0646\u064e\u0635\u0652\u0631\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d7 \u0623\u064e\u0644\u064e\u0627\u0653 \u0625\u0650\u0646\u0651\u064e \u0646\u064e\u0635\u0652\u0631\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0642\u064e\u0631\u0650\u064a\u0628\u064c\u06ed", "num": 214}
{"line": "\u064a\u064e\u0633\u0652\u0640\u0654\u064e\u0644\u064f\u0648\u0646\u064e\u0643\u064e \u0645\u064e\u0627\u0630\u064e\u0627 \u064a\u064f\u0646\u0641\u0650\u0642\u064f\u0648\u0646\u064e \u06d6 \u0642\u064f\u0644\u0652 \u0645\u064e\u0627\u0653 \u0623\u064e\u0646\u0641\u064e\u0642\u0652\u062a\u064f\u0645 \u0645\u0651\u0650\u0646\u0652 \u062e\u064e\u064a\u0652\u0631\u064d\u06e2 \u0641\u064e\u0644\u0650\u0644\u0652\u0648\u064e\u0670\u0644\u0650\u062f\u064e\u064a\u0652\u0646\u0650 \u0648\u064e\u0671\u0644\u0652\u0623\u064e\u0642\u0652\u0631\u064e\u0628\u0650\u064a\u0646\u064e \u0648\u064e\u0671\u0644\u0652\u064a\u064e\u062a\u064e\u0640\u0670\u0645\u064e\u0649\u0670 \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u0633\u064e\u0640\u0670\u0643\u0650\u064a\u0646\u0650 \u0648\u064e\u0671\u0628\u0652\u0646\u0650 \u0671\u0644\u0633\u0651\u064e\u0628\u0650\u064a\u0644\u0650 \u06d7 \u0648\u064e\u0645\u064e\u0627 \u062a\u064e\u0641\u0652\u0639\u064e\u0644\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u0652 \u062e\u064e\u064a\u0652\u0631\u064d\u06e2 \u0641\u064e\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0628\u0650\u0647\u0650\u06e6 \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 215}
{"line": "\u0643\u064f\u062a\u0650\u0628\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u0642\u0650\u062a\u064e\u0627\u0644\u064f \u0648\u064e\u0647\u064f\u0648\u064e \u0643\u064f\u0631\u0652\u0647\u064c\u06ed \u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u06d6 \u0648\u064e\u0639\u064e\u0633\u064e\u0649\u0670\u0653 \u0623\u064e\u0646 \u062a\u064e\u0643\u0652\u0631\u064e\u0647\u064f\u0648\u0627\u06df \u0634\u064e\u064a\u0652\u0640\u0654\u064b\u06ed\u0627 \u0648\u064e\u0647\u064f\u0648\u064e \u062e\u064e\u064a\u0652\u0631\u064c\u06ed \u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u06d6 \u0648\u064e\u0639\u064e\u0633\u064e\u0649\u0670\u0653 \u0623\u064e\u0646 \u062a\u064f\u062d\u0650\u0628\u0651\u064f\u0648\u0627\u06df \u0634\u064e\u064a\u0652\u0640\u0654\u064b\u06ed\u0627 \u0648\u064e\u0647\u064f\u0648\u064e \u0634\u064e\u0631\u0651\u064c\u06ed \u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f \u0648\u064e\u0623\u064e\u0646\u062a\u064f\u0645\u0652 \u0644\u064e\u0627 \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 216}
{"line": "\u064a\u064e\u0633\u0652\u0640\u0654\u064e\u0644\u064f\u0648\u0646\u064e\u0643\u064e \u0639\u064e\u0646\u0650 \u0671\u0644\u0634\u0651\u064e\u0647\u0652\u0631\u0650 \u0671\u0644\u0652\u062d\u064e\u0631\u064e\u0627\u0645\u0650 \u0642\u0650\u062a\u064e\u0627\u0644\u064d\u06e2 \u0641\u0650\u064a\u0647\u0650 \u06d6 \u0642\u064f\u0644\u0652 \u0642\u0650\u062a\u064e\u0627\u0644\u064c\u06ed \u0641\u0650\u064a\u0647\u0650 \u0643\u064e\u0628\u0650\u064a\u0631\u064c\u06ed \u06d6 \u0648\u064e\u0635\u064e\u062f\u0651\u064c \u0639\u064e\u0646 \u0633\u064e\u0628\u0650\u064a\u0644\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0643\u064f\u0641\u0652\u0631\u064c\u06e2 \u0628\u0650\u0647\u0650\u06e6 \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u0633\u0652\u062c\u0650\u062f\u0650 \u0671\u0644\u0652\u062d\u064e\u0631\u064e\u0627\u0645\u0650 \u0648\u064e\u0625\u0650\u062e\u0652\u0631\u064e\u0627\u062c\u064f \u0623\u064e\u0647\u0652\u0644\u0650\u0647\u0650\u06e6 \u0645\u0650\u0646\u0652\u0647\u064f \u0623\u064e\u0643\u0652\u0628\u064e\u0631\u064f \u0639\u0650\u0646\u062f\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06da \u0648\u064e\u0671\u0644\u0652\u0641\u0650\u062a\u0652\u0646\u064e\u0629\u064f \u0623\u064e\u0643\u0652\u0628\u064e\u0631\u064f \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0642\u064e\u062a\u0652\u0644\u0650 \u06d7 \u0648\u064e\u0644\u064e\u0627 \u064a\u064e\u0632\u064e\u0627\u0644\u064f\u0648\u0646\u064e \u064a\u064f\u0642\u064e\u0640\u0670\u062a\u0650\u0644\u064f\u0648\u0646\u064e\u0643\u064f\u0645\u0652 \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u064a\u064e\u0631\u064f\u062f\u0651\u064f\u0648\u0643\u064f\u0645\u0652 \u0639\u064e\u0646 \u062f\u0650\u064a\u0646\u0650\u0643\u064f\u0645\u0652 \u0625\u0650\u0646\u0650 \u0671\u0633\u0652\u062a\u064e\u0637\u064e\u0640\u0670\u0639\u064f\u0648\u0627\u06df \u06da \u0648\u064e\u0645\u064e\u0646 \u064a\u064e\u0631\u0652\u062a\u064e\u062f\u0650\u062f\u0652 \u0645\u0650\u0646\u0643\u064f\u0645\u0652 \u0639\u064e\u0646 \u062f\u0650\u064a\u0646\u0650\u0647\u0650\u06e6 \u0641\u064e\u064a\u064e\u0645\u064f\u062a\u0652 \u0648\u064e\u0647\u064f\u0648\u064e \u0643\u064e\u0627\u0641\u0650\u0631\u064c\u06ed \u0641\u064e\u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u062d\u064e\u0628\u0650\u0637\u064e\u062a\u0652 \u0623\u064e\u0639\u0652\u0645\u064e\u0640\u0670\u0644\u064f\u0647\u064f\u0645\u0652 \u0641\u0650\u0649 \u0671\u0644\u062f\u0651\u064f\u0646\u0652\u064a\u064e\u0627 \u0648\u064e\u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u064e\u0629\u0650 \u06d6 \u0648\u064e\u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0623\u064e\u0635\u0652\u062d\u064e\u0640\u0670\u0628\u064f \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u0650 \u06d6 \u0647\u064f\u0645\u0652 \u0641\u0650\u064a\u0647\u064e\u0627 \u062e\u064e\u0640\u0670\u0644\u0650\u062f\u064f\u0648\u0646\u064e", "num": 217}
{"line": "\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0647\u064e\u0627\u062c\u064e\u0631\u064f\u0648\u0627\u06df \u0648\u064e\u062c\u064e\u0640\u0670\u0647\u064e\u062f\u064f\u0648\u0627\u06df \u0641\u0650\u0649 \u0633\u064e\u0628\u0650\u064a\u0644\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u064a\u064e\u0631\u0652\u062c\u064f\u0648\u0646\u064e \u0631\u064e\u062d\u0652\u0645\u064e\u062a\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06da \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u063a\u064e\u0641\u064f\u0648\u0631\u064c\u06ed \u0631\u0651\u064e\u062d\u0650\u064a\u0645\u064c\u06ed", "num": 218}
{"line": "\u06de \u064a\u064e\u0633\u0652\u0640\u0654\u064e\u0644\u064f\u0648\u0646\u064e\u0643\u064e \u0639\u064e\u0646\u0650 \u0671\u0644\u0652\u062e\u064e\u0645\u0652\u0631\u0650 \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u064a\u0652\u0633\u0650\u0631\u0650 \u06d6 \u0642\u064f\u0644\u0652 \u0641\u0650\u064a\u0647\u0650\u0645\u064e\u0627\u0653 \u0625\u0650\u062b\u0652\u0645\u064c\u06ed \u0643\u064e\u0628\u0650\u064a\u0631\u064c\u06ed \u0648\u064e\u0645\u064e\u0646\u064e\u0640\u0670\u0641\u0650\u0639\u064f \u0644\u0650\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0648\u064e\u0625\u0650\u062b\u0652\u0645\u064f\u0647\u064f\u0645\u064e\u0627\u0653 \u0623\u064e\u0643\u0652\u0628\u064e\u0631\u064f \u0645\u0650\u0646 \u0646\u0651\u064e\u0641\u0652\u0639\u0650\u0647\u0650\u0645\u064e\u0627 \u06d7 \u0648\u064e\u064a\u064e\u0633\u0652\u0640\u0654\u064e\u0644\u064f\u0648\u0646\u064e\u0643\u064e \u0645\u064e\u0627\u0630\u064e\u0627 \u064a\u064f\u0646\u0641\u0650\u0642\u064f\u0648\u0646\u064e \u0642\u064f\u0644\u0650 \u0671\u0644\u0652\u0639\u064e\u0641\u0652\u0648\u064e \u06d7 \u0643\u064e\u0630\u064e\u0670\u0644\u0650\u0643\u064e \u064a\u064f\u0628\u064e\u064a\u0651\u0650\u0646\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0644\u064e\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u0650 \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u062a\u064e\u062a\u064e\u0641\u064e\u0643\u0651\u064e\u0631\u064f\u0648\u0646\u064e", "num": 219}
{"line": "\u0641\u0650\u0649 \u0671\u0644\u062f\u0651\u064f\u0646\u0652\u064a\u064e\u0627 \u0648\u064e\u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u064e\u0629\u0650 \u06d7 \u0648\u064e\u064a\u064e\u0633\u0652\u0640\u0654\u064e\u0644\u064f\u0648\u0646\u064e\u0643\u064e \u0639\u064e\u0646\u0650 \u0671\u0644\u0652\u064a\u064e\u062a\u064e\u0640\u0670\u0645\u064e\u0649\u0670 \u06d6 \u0642\u064f\u0644\u0652 \u0625\u0650\u0635\u0652\u0644\u064e\u0627\u062d\u064c\u06ed \u0644\u0651\u064e\u0647\u064f\u0645\u0652 \u062e\u064e\u064a\u0652\u0631\u064c\u06ed \u06d6 \u0648\u064e\u0625\u0650\u0646 \u062a\u064f\u062e\u064e\u0627\u0644\u0650\u0637\u064f\u0648\u0647\u064f\u0645\u0652 \u0641\u064e\u0625\u0650\u062e\u0652\u0648\u064e\u0670\u0646\u064f\u0643\u064f\u0645\u0652 \u06da \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f \u0671\u0644\u0652\u0645\u064f\u0641\u0652\u0633\u0650\u062f\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0645\u064f\u0635\u0652\u0644\u0650\u062d\u0650 \u06da \u0648\u064e\u0644\u064e\u0648\u0652 \u0634\u064e\u0627\u0653\u0621\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0644\u064e\u0623\u064e\u0639\u0652\u0646\u064e\u062a\u064e\u0643\u064f\u0645\u0652 \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u064e\u0632\u0650\u064a\u0632\u064c \u062d\u064e\u0643\u0650\u064a\u0645\u064c\u06ed", "num": 220}
{"line": "\u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0646\u0643\u0650\u062d\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u0645\u064f\u0634\u0652\u0631\u0650\u0643\u064e\u0640\u0670\u062a\u0650 \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u064a\u064f\u0624\u0652\u0645\u0650\u0646\u0651\u064e \u06da \u0648\u064e\u0644\u064e\u0623\u064e\u0645\u064e\u0629\u064c\u06ed \u0645\u0651\u064f\u0624\u0652\u0645\u0650\u0646\u064e\u0629\u064c \u062e\u064e\u064a\u0652\u0631\u064c\u06ed \u0645\u0651\u0650\u0646 \u0645\u0651\u064f\u0634\u0652\u0631\u0650\u0643\u064e\u0629\u064d\u06e2 \u0648\u064e\u0644\u064e\u0648\u0652 \u0623\u064e\u0639\u0652\u062c\u064e\u0628\u064e\u062a\u0652\u0643\u064f\u0645\u0652 \u06d7 \u0648\u064e\u0644\u064e\u0627 \u062a\u064f\u0646\u0643\u0650\u062d\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u0645\u064f\u0634\u0652\u0631\u0650\u0643\u0650\u064a\u0646\u064e \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u064a\u064f\u0624\u0652\u0645\u0650\u0646\u064f\u0648\u0627\u06df \u06da \u0648\u064e\u0644\u064e\u0639\u064e\u0628\u0652\u062f\u064c\u06ed \u0645\u0651\u064f\u0624\u0652\u0645\u0650\u0646\u064c \u062e\u064e\u064a\u0652\u0631\u064c\u06ed \u0645\u0651\u0650\u0646 \u0645\u0651\u064f\u0634\u0652\u0631\u0650\u0643\u064d\u06e2 \u0648\u064e\u0644\u064e\u0648\u0652 \u0623\u064e\u0639\u0652\u062c\u064e\u0628\u064e\u0643\u064f\u0645\u0652 \u06d7 \u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u064a\u064e\u062f\u0652\u0639\u064f\u0648\u0646\u064e \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u0650 \u06d6 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064e\u062f\u0652\u0639\u064f\u0648\u0653\u0627\u06df \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0652\u062c\u064e\u0646\u0651\u064e\u0629\u0650 \u0648\u064e\u0671\u0644\u0652\u0645\u064e\u063a\u0652\u0641\u0650\u0631\u064e\u0629\u0650 \u0628\u0650\u0625\u0650\u0630\u0652\u0646\u0650\u0647\u0650\u06e6 \u06d6 \u0648\u064e\u064a\u064f\u0628\u064e\u064a\u0651\u0650\u0646\u064f \u0621\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u0650\u0647\u0650\u06e6 \u0644\u0650\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0647\u064f\u0645\u0652 \u064a\u064e\u062a\u064e\u0630\u064e\u0643\u0651\u064e\u0631\u064f\u0648\u0646\u064e", "num": 221}
{"line": "\u0648\u064e\u064a\u064e\u0633\u0652\u0640\u0654\u064e\u0644\u064f\u0648\u0646\u064e\u0643\u064e \u0639\u064e\u0646\u0650 \u0671\u0644\u0652\u0645\u064e\u062d\u0650\u064a\u0636\u0650 \u06d6 \u0642\u064f\u0644\u0652 \u0647\u064f\u0648\u064e \u0623\u064e\u0630\u064b\u06ed\u0649 \u0641\u064e\u0671\u0639\u0652\u062a\u064e\u0632\u0650\u0644\u064f\u0648\u0627\u06df \u0671\u0644\u0646\u0651\u0650\u0633\u064e\u0627\u0653\u0621\u064e \u0641\u0650\u0649 \u0671\u0644\u0652\u0645\u064e\u062d\u0650\u064a\u0636\u0650 \u06d6 \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0642\u0652\u0631\u064e\u0628\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u064a\u064e\u0637\u0652\u0647\u064f\u0631\u0652\u0646\u064e \u06d6 \u0641\u064e\u0625\u0650\u0630\u064e\u0627 \u062a\u064e\u0637\u064e\u0647\u0651\u064e\u0631\u0652\u0646\u064e \u0641\u064e\u0623\u0652\u062a\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u0645\u0650\u0646\u0652 \u062d\u064e\u064a\u0652\u062b\u064f \u0623\u064e\u0645\u064e\u0631\u064e\u0643\u064f\u0645\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u064a\u064f\u062d\u0650\u0628\u0651\u064f \u0671\u0644\u062a\u0651\u064e\u0648\u0651\u064e\u0670\u0628\u0650\u064a\u0646\u064e \u0648\u064e\u064a\u064f\u062d\u0650\u0628\u0651\u064f \u0671\u0644\u0652\u0645\u064f\u062a\u064e\u0637\u064e\u0647\u0651\u0650\u0631\u0650\u064a\u0646\u064e", "num": 222}
{"line": "\u0646\u0650\u0633\u064e\u0627\u0653\u0624\u064f\u0643\u064f\u0645\u0652 \u062d\u064e\u0631\u0652\u062b\u064c\u06ed \u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u0641\u064e\u0623\u0652\u062a\u064f\u0648\u0627\u06df \u062d\u064e\u0631\u0652\u062b\u064e\u0643\u064f\u0645\u0652 \u0623\u064e\u0646\u0651\u064e\u0649\u0670 \u0634\u0650\u0626\u0652\u062a\u064f\u0645\u0652 \u06d6 \u0648\u064e\u0642\u064e\u062f\u0651\u0650\u0645\u064f\u0648\u0627\u06df \u0644\u0650\u0623\u064e\u0646\u0641\u064f\u0633\u0650\u0643\u064f\u0645\u0652 \u06da \u0648\u064e\u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0648\u064e\u0671\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0651\u064e\u0643\u064f\u0645 \u0645\u0651\u064f\u0644\u064e\u0640\u0670\u0642\u064f\u0648\u0647\u064f \u06d7 \u0648\u064e\u0628\u064e\u0634\u0651\u0650\u0631\u0650 \u0671\u0644\u0652\u0645\u064f\u0624\u0652\u0645\u0650\u0646\u0650\u064a\u0646\u064e", "num": 223}
{"line": "\u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u062c\u0652\u0639\u064e\u0644\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u064f\u0631\u0652\u0636\u064e\u0629\u064b\u06ed \u0644\u0651\u0650\u0623\u064e\u064a\u0652\u0645\u064e\u0640\u0670\u0646\u0650\u0643\u064f\u0645\u0652 \u0623\u064e\u0646 \u062a\u064e\u0628\u064e\u0631\u0651\u064f\u0648\u0627\u06df \u0648\u064e\u062a\u064e\u062a\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u0648\u064e\u062a\u064f\u0635\u0652\u0644\u0650\u062d\u064f\u0648\u0627\u06df \u0628\u064e\u064a\u0652\u0646\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0633\u064e\u0645\u0650\u064a\u0639\u064c \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 224}
{"line": "\u0644\u0651\u064e\u0627 \u064a\u064f\u0624\u064e\u0627\u062e\u0650\u0630\u064f\u0643\u064f\u0645\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u0671\u0644\u0644\u0651\u064e\u063a\u0652\u0648\u0650 \u0641\u0650\u0649\u0653 \u0623\u064e\u064a\u0652\u0645\u064e\u0640\u0670\u0646\u0650\u0643\u064f\u0645\u0652 \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646 \u064a\u064f\u0624\u064e\u0627\u062e\u0650\u0630\u064f\u0643\u064f\u0645 \u0628\u0650\u0645\u064e\u0627 \u0643\u064e\u0633\u064e\u0628\u064e\u062a\u0652 \u0642\u064f\u0644\u064f\u0648\u0628\u064f\u0643\u064f\u0645\u0652 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u063a\u064e\u0641\u064f\u0648\u0631\u064c \u062d\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 225}
{"line": "\u0644\u0651\u0650\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064f\u0624\u0652\u0644\u064f\u0648\u0646\u064e \u0645\u0650\u0646 \u0646\u0651\u0650\u0633\u064e\u0627\u0653\u0626\u0650\u0647\u0650\u0645\u0652 \u062a\u064e\u0631\u064e\u0628\u0651\u064f\u0635\u064f \u0623\u064e\u0631\u0652\u0628\u064e\u0639\u064e\u0629\u0650 \u0623\u064e\u0634\u0652\u0647\u064f\u0631\u064d\u06e2 \u06d6 \u0641\u064e\u0625\u0650\u0646 \u0641\u064e\u0627\u0653\u0621\u064f\u0648 \u0641\u064e\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u063a\u064e\u0641\u064f\u0648\u0631\u064c\u06ed \u0631\u0651\u064e\u062d\u0650\u064a\u0645\u064c\u06ed", "num": 226}
{"line": "\u0648\u064e\u0625\u0650\u0646\u0652 \u0639\u064e\u0632\u064e\u0645\u064f\u0648\u0627\u06df \u0671\u0644\u0637\u0651\u064e\u0644\u064e\u0640\u0670\u0642\u064e \u0641\u064e\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0633\u064e\u0645\u0650\u064a\u0639\u064c \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 227}
{"line": "\u0648\u064e\u0671\u0644\u0652\u0645\u064f\u0637\u064e\u0644\u0651\u064e\u0642\u064e\u0640\u0670\u062a\u064f \u064a\u064e\u062a\u064e\u0631\u064e\u0628\u0651\u064e\u0635\u0652\u0646\u064e \u0628\u0650\u0623\u064e\u0646\u0641\u064f\u0633\u0650\u0647\u0650\u0646\u0651\u064e \u062b\u064e\u0644\u064e\u0640\u0670\u062b\u064e\u0629\u064e \u0642\u064f\u0631\u064f\u0648\u0653\u0621\u064d\u06e2 \u06da \u0648\u064e\u0644\u064e\u0627 \u064a\u064e\u062d\u0650\u0644\u0651\u064f \u0644\u064e\u0647\u064f\u0646\u0651\u064e \u0623\u064e\u0646 \u064a\u064e\u0643\u0652\u062a\u064f\u0645\u0652\u0646\u064e \u0645\u064e\u0627 \u062e\u064e\u0644\u064e\u0642\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0641\u0650\u0649\u0653 \u0623\u064e\u0631\u0652\u062d\u064e\u0627\u0645\u0650\u0647\u0650\u0646\u0651\u064e \u0625\u0650\u0646 \u0643\u064f\u0646\u0651\u064e \u064a\u064f\u0624\u0652\u0645\u0650\u0646\u0651\u064e \u0628\u0650\u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0671\u0644\u0652\u064a\u064e\u0648\u0652\u0645\u0650 \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u0650 \u06da \u0648\u064e\u0628\u064f\u0639\u064f\u0648\u0644\u064e\u062a\u064f\u0647\u064f\u0646\u0651\u064e \u0623\u064e\u062d\u064e\u0642\u0651\u064f \u0628\u0650\u0631\u064e\u062f\u0651\u0650\u0647\u0650\u0646\u0651\u064e \u0641\u0650\u0649 \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u0625\u0650\u0646\u0652 \u0623\u064e\u0631\u064e\u0627\u062f\u064f\u0648\u0653\u0627\u06df \u0625\u0650\u0635\u0652\u0644\u064e\u0640\u0670\u062d\u064b\u06ed\u0627 \u06da \u0648\u064e\u0644\u064e\u0647\u064f\u0646\u0651\u064e \u0645\u0650\u062b\u0652\u0644\u064f \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0646\u0651\u064e \u0628\u0650\u0671\u0644\u0652\u0645\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u0650 \u06da \u0648\u064e\u0644\u0650\u0644\u0631\u0651\u0650\u062c\u064e\u0627\u0644\u0650 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0646\u0651\u064e \u062f\u064e\u0631\u064e\u062c\u064e\u0629\u064c\u06ed \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0632\u0650\u064a\u0632\u064c \u062d\u064e\u0643\u0650\u064a\u0645\u064c", "num": 228}
{"line": "\u0671\u0644\u0637\u0651\u064e\u0644\u064e\u0640\u0670\u0642\u064f \u0645\u064e\u0631\u0651\u064e\u062a\u064e\u0627\u0646\u0650 \u06d6 \u0641\u064e\u0625\u0650\u0645\u0652\u0633\u064e\u0627\u0643\u064c\u06e2 \u0628\u0650\u0645\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u064d \u0623\u064e\u0648\u0652 \u062a\u064e\u0633\u0652\u0631\u0650\u064a\u062d\u064c\u06e2 \u0628\u0650\u0625\u0650\u062d\u0652\u0633\u064e\u0640\u0670\u0646\u064d\u06e2 \u06d7 \u0648\u064e\u0644\u064e\u0627 \u064a\u064e\u062d\u0650\u0644\u0651\u064f \u0644\u064e\u0643\u064f\u0645\u0652 \u0623\u064e\u0646 \u062a\u064e\u0623\u0652\u062e\u064f\u0630\u064f\u0648\u0627\u06df \u0645\u0650\u0645\u0651\u064e\u0627\u0653 \u0621\u064e\u0627\u062a\u064e\u064a\u0652\u062a\u064f\u0645\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u0634\u064e\u064a\u0652\u0640\u0654\u064b\u0627 \u0625\u0650\u0644\u0651\u064e\u0627\u0653 \u0623\u064e\u0646 \u064a\u064e\u062e\u064e\u0627\u0641\u064e\u0627\u0653 \u0623\u064e\u0644\u0651\u064e\u0627 \u064a\u064f\u0642\u0650\u064a\u0645\u064e\u0627 \u062d\u064f\u062f\u064f\u0648\u062f\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d6 \u0641\u064e\u0625\u0650\u0646\u0652 \u062e\u0650\u0641\u0652\u062a\u064f\u0645\u0652 \u0623\u064e\u0644\u0651\u064e\u0627 \u064a\u064f\u0642\u0650\u064a\u0645\u064e\u0627 \u062d\u064f\u062f\u064f\u0648\u062f\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0641\u064e\u0644\u064e\u0627 \u062c\u064f\u0646\u064e\u0627\u062d\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u064e\u0627 \u0641\u0650\u064a\u0645\u064e\u0627 \u0671\u0641\u0652\u062a\u064e\u062f\u064e\u062a\u0652 \u0628\u0650\u0647\u0650\u06e6 \u06d7 \u062a\u0650\u0644\u0652\u0643\u064e \u062d\u064f\u062f\u064f\u0648\u062f\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0641\u064e\u0644\u064e\u0627 \u062a\u064e\u0639\u0652\u062a\u064e\u062f\u064f\u0648\u0647\u064e\u0627 \u06da \u0648\u064e\u0645\u064e\u0646 \u064a\u064e\u062a\u064e\u0639\u064e\u062f\u0651\u064e \u062d\u064f\u062f\u064f\u0648\u062f\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0641\u064e\u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0647\u064f\u0645\u064f \u0671\u0644\u0638\u0651\u064e\u0640\u0670\u0644\u0650\u0645\u064f\u0648\u0646\u064e", "num": 229}
{"line": "\u0641\u064e\u0625\u0650\u0646 \u0637\u064e\u0644\u0651\u064e\u0642\u064e\u0647\u064e\u0627 \u0641\u064e\u0644\u064e\u0627 \u062a\u064e\u062d\u0650\u0644\u0651\u064f \u0644\u064e\u0647\u064f\u06e5 \u0645\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u064f \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u062a\u064e\u0646\u0643\u0650\u062d\u064e \u0632\u064e\u0648\u0652\u062c\u064b\u0627 \u063a\u064e\u064a\u0652\u0631\u064e\u0647\u064f\u06e5 \u06d7 \u0641\u064e\u0625\u0650\u0646 \u0637\u064e\u0644\u0651\u064e\u0642\u064e\u0647\u064e\u0627 \u0641\u064e\u0644\u064e\u0627 \u062c\u064f\u0646\u064e\u0627\u062d\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u064e\u0627\u0653 \u0623\u064e\u0646 \u064a\u064e\u062a\u064e\u0631\u064e\u0627\u062c\u064e\u0639\u064e\u0627\u0653 \u0625\u0650\u0646 \u0638\u064e\u0646\u0651\u064e\u0627\u0653 \u0623\u064e\u0646 \u064a\u064f\u0642\u0650\u064a\u0645\u064e\u0627 \u062d\u064f\u062f\u064f\u0648\u062f\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d7 \u0648\u064e\u062a\u0650\u0644\u0652\u0643\u064e \u062d\u064f\u062f\u064f\u0648\u062f\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u064a\u064f\u0628\u064e\u064a\u0651\u0650\u0646\u064f\u0647\u064e\u0627 \u0644\u0650\u0642\u064e\u0648\u0652\u0645\u064d\u06e2 \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 230}
{"line": "\u0648\u064e\u0625\u0650\u0630\u064e\u0627 \u0637\u064e\u0644\u0651\u064e\u0642\u0652\u062a\u064f\u0645\u064f \u0671\u0644\u0646\u0651\u0650\u0633\u064e\u0627\u0653\u0621\u064e \u0641\u064e\u0628\u064e\u0644\u064e\u063a\u0652\u0646\u064e \u0623\u064e\u062c\u064e\u0644\u064e\u0647\u064f\u0646\u0651\u064e \u0641\u064e\u0623\u064e\u0645\u0652\u0633\u0650\u0643\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u0628\u0650\u0645\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u064d \u0623\u064e\u0648\u0652 \u0633\u064e\u0631\u0651\u0650\u062d\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u0628\u0650\u0645\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u064d\u06e2 \u06da \u0648\u064e\u0644\u064e\u0627 \u062a\u064f\u0645\u0652\u0633\u0650\u0643\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u0636\u0650\u0631\u064e\u0627\u0631\u064b\u06ed\u0627 \u0644\u0651\u0650\u062a\u064e\u0639\u0652\u062a\u064e\u062f\u064f\u0648\u0627\u06df \u06da \u0648\u064e\u0645\u064e\u0646 \u064a\u064e\u0641\u0652\u0639\u064e\u0644\u0652 \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u0641\u064e\u0642\u064e\u062f\u0652 \u0638\u064e\u0644\u064e\u0645\u064e \u0646\u064e\u0641\u0652\u0633\u064e\u0647\u064f\u06e5 \u06da \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u062a\u0651\u064e\u062e\u0650\u0630\u064f\u0648\u0653\u0627\u06df \u0621\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0647\u064f\u0632\u064f\u0648\u064b\u06ed\u0627 \u06da \u0648\u064e\u0671\u0630\u0652\u0643\u064f\u0631\u064f\u0648\u0627\u06df \u0646\u0650\u0639\u0652\u0645\u064e\u062a\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0648\u064e\u0645\u064e\u0627\u0653 \u0623\u064e\u0646\u0632\u064e\u0644\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u0650 \u0648\u064e\u0671\u0644\u0652\u062d\u0650\u0643\u0652\u0645\u064e\u0629\u0650 \u064a\u064e\u0639\u0650\u0638\u064f\u0643\u064f\u0645 \u0628\u0650\u0647\u0650\u06e6 \u06da \u0648\u064e\u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0648\u064e\u0671\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0628\u0650\u0643\u064f\u0644\u0651\u0650 \u0634\u064e\u0649\u0652\u0621\u064d \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 231}
{"line": "\u0648\u064e\u0625\u0650\u0630\u064e\u0627 \u0637\u064e\u0644\u0651\u064e\u0642\u0652\u062a\u064f\u0645\u064f \u0671\u0644\u0646\u0651\u0650\u0633\u064e\u0627\u0653\u0621\u064e \u0641\u064e\u0628\u064e\u0644\u064e\u063a\u0652\u0646\u064e \u0623\u064e\u062c\u064e\u0644\u064e\u0647\u064f\u0646\u0651\u064e \u0641\u064e\u0644\u064e\u0627 \u062a\u064e\u0639\u0652\u0636\u064f\u0644\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u0623\u064e\u0646 \u064a\u064e\u0646\u0643\u0650\u062d\u0652\u0646\u064e \u0623\u064e\u0632\u0652\u0648\u064e\u0670\u062c\u064e\u0647\u064f\u0646\u0651\u064e \u0625\u0650\u0630\u064e\u0627 \u062a\u064e\u0631\u064e\u0670\u0636\u064e\u0648\u0652\u0627\u06df \u0628\u064e\u064a\u0652\u0646\u064e\u0647\u064f\u0645 \u0628\u0650\u0671\u0644\u0652\u0645\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u0650 \u06d7 \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u064a\u064f\u0648\u0639\u064e\u0638\u064f \u0628\u0650\u0647\u0650\u06e6 \u0645\u064e\u0646 \u0643\u064e\u0627\u0646\u064e \u0645\u0650\u0646\u0643\u064f\u0645\u0652 \u064a\u064f\u0624\u0652\u0645\u0650\u0646\u064f \u0628\u0650\u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0671\u0644\u0652\u064a\u064e\u0648\u0652\u0645\u0650 \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u0650 \u06d7 \u0630\u064e\u0670\u0644\u0650\u0643\u064f\u0645\u0652 \u0623\u064e\u0632\u0652\u0643\u064e\u0649\u0670 \u0644\u064e\u0643\u064f\u0645\u0652 \u0648\u064e\u0623\u064e\u0637\u0652\u0647\u064e\u0631\u064f \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f \u0648\u064e\u0623\u064e\u0646\u062a\u064f\u0645\u0652 \u0644\u064e\u0627 \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 232}
{"line": "\u06de \u0648\u064e\u0671\u0644\u0652\u0648\u064e\u0670\u0644\u0650\u062f\u064e\u0670\u062a\u064f \u064a\u064f\u0631\u0652\u0636\u0650\u0639\u0652\u0646\u064e \u0623\u064e\u0648\u0652\u0644\u064e\u0640\u0670\u062f\u064e\u0647\u064f\u0646\u0651\u064e \u062d\u064e\u0648\u0652\u0644\u064e\u064a\u0652\u0646\u0650 \u0643\u064e\u0627\u0645\u0650\u0644\u064e\u064a\u0652\u0646\u0650 \u06d6 \u0644\u0650\u0645\u064e\u0646\u0652 \u0623\u064e\u0631\u064e\u0627\u062f\u064e \u0623\u064e\u0646 \u064a\u064f\u062a\u0650\u0645\u0651\u064e \u0671\u0644\u0631\u0651\u064e\u0636\u064e\u0627\u0639\u064e\u0629\u064e \u06da \u0648\u064e\u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0645\u064e\u0648\u0652\u0644\u064f\u0648\u062f\u0650 \u0644\u064e\u0647\u064f\u06e5 \u0631\u0650\u0632\u0652\u0642\u064f\u0647\u064f\u0646\u0651\u064e \u0648\u064e\u0643\u0650\u0633\u0652\u0648\u064e\u062a\u064f\u0647\u064f\u0646\u0651\u064e \u0628\u0650\u0671\u0644\u0652\u0645\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u0650 \u06da \u0644\u064e\u0627 \u062a\u064f\u0643\u064e\u0644\u0651\u064e\u0641\u064f \u0646\u064e\u0641\u0652\u0633\u064c \u0625\u0650\u0644\u0651\u064e\u0627 \u0648\u064f\u0633\u0652\u0639\u064e\u0647\u064e\u0627 \u06da \u0644\u064e\u0627 \u062a\u064f\u0636\u064e\u0627\u0653\u0631\u0651\u064e \u0648\u064e\u0670\u0644\u0650\u062f\u064e\u0629\u064c\u06e2 \u0628\u0650\u0648\u064e\u0644\u064e\u062f\u0650\u0647\u064e\u0627 \u0648\u064e\u0644\u064e\u0627 \u0645\u064e\u0648\u0652\u0644\u064f\u0648\u062f\u064c\u06ed \u0644\u0651\u064e\u0647\u064f\u06e5 \u0628\u0650\u0648\u064e\u0644\u064e\u062f\u0650\u0647\u0650\u06e6 \u06da \u0648\u064e\u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0648\u064e\u0627\u0631\u0650\u062b\u0650 \u0645\u0650\u062b\u0652\u0644\u064f \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u06d7 \u0641\u064e\u0625\u0650\u0646\u0652 \u0623\u064e\u0631\u064e\u0627\u062f\u064e\u0627 \u0641\u0650\u0635\u064e\u0627\u0644\u064b\u0627 \u0639\u064e\u0646 \u062a\u064e\u0631\u064e\u0627\u0636\u064d\u06e2 \u0645\u0651\u0650\u0646\u0652\u0647\u064f\u0645\u064e\u0627 \u0648\u064e\u062a\u064e\u0634\u064e\u0627\u0648\u064f\u0631\u064d\u06e2 \u0641\u064e\u0644\u064e\u0627 \u062c\u064f\u0646\u064e\u0627\u062d\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u064e\u0627 \u06d7 \u0648\u064e\u0625\u0650\u0646\u0652 \u0623\u064e\u0631\u064e\u062f\u062a\u0651\u064f\u0645\u0652 \u0623\u064e\u0646 \u062a\u064e\u0633\u0652\u062a\u064e\u0631\u0652\u0636\u0650\u0639\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0648\u0652\u0644\u064e\u0640\u0670\u062f\u064e\u0643\u064f\u0645\u0652 \u0641\u064e\u0644\u064e\u0627 \u062c\u064f\u0646\u064e\u0627\u062d\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0625\u0650\u0630\u064e\u0627 \u0633\u064e\u0644\u0651\u064e\u0645\u0652\u062a\u064f\u0645 \u0645\u0651\u064e\u0627\u0653 \u0621\u064e\u0627\u062a\u064e\u064a\u0652\u062a\u064f\u0645 \u0628\u0650\u0671\u0644\u0652\u0645\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u0650 \u06d7 \u0648\u064e\u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0648\u064e\u0671\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0628\u0650\u0645\u064e\u0627 \u062a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e \u0628\u064e\u0635\u0650\u064a\u0631\u064c\u06ed", "num": 233}
{"line": "\u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064f\u062a\u064e\u0648\u064e\u0641\u0651\u064e\u0648\u0652\u0646\u064e \u0645\u0650\u0646\u0643\u064f\u0645\u0652 \u0648\u064e\u064a\u064e\u0630\u064e\u0631\u064f\u0648\u0646\u064e \u0623\u064e\u0632\u0652\u0648\u064e\u0670\u062c\u064b\u06ed\u0627 \u064a\u064e\u062a\u064e\u0631\u064e\u0628\u0651\u064e\u0635\u0652\u0646\u064e \u0628\u0650\u0623\u064e\u0646\u0641\u064f\u0633\u0650\u0647\u0650\u0646\u0651\u064e \u0623\u064e\u0631\u0652\u0628\u064e\u0639\u064e\u0629\u064e \u0623\u064e\u0634\u0652\u0647\u064f\u0631\u064d\u06e2 \u0648\u064e\u0639\u064e\u0634\u0652\u0631\u064b\u06ed\u0627 \u06d6 \u0641\u064e\u0625\u0650\u0630\u064e\u0627 \u0628\u064e\u0644\u064e\u063a\u0652\u0646\u064e \u0623\u064e\u062c\u064e\u0644\u064e\u0647\u064f\u0646\u0651\u064e \u0641\u064e\u0644\u064e\u0627 \u062c\u064f\u0646\u064e\u0627\u062d\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0641\u0650\u064a\u0645\u064e\u0627 \u0641\u064e\u0639\u064e\u0644\u0652\u0646\u064e \u0641\u0650\u0649\u0653 \u0623\u064e\u0646\u0641\u064f\u0633\u0650\u0647\u0650\u0646\u0651\u064e \u0628\u0650\u0671\u0644\u0652\u0645\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u0650 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u0645\u064e\u0627 \u062a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e \u062e\u064e\u0628\u0650\u064a\u0631\u064c\u06ed", "num": 234}
{"line": "\u0648\u064e\u0644\u064e\u0627 \u062c\u064f\u0646\u064e\u0627\u062d\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0641\u0650\u064a\u0645\u064e\u0627 \u0639\u064e\u0631\u0651\u064e\u0636\u0652\u062a\u064f\u0645 \u0628\u0650\u0647\u0650\u06e6 \u0645\u0650\u0646\u0652 \u062e\u0650\u0637\u0652\u0628\u064e\u0629\u0650 \u0671\u0644\u0646\u0651\u0650\u0633\u064e\u0627\u0653\u0621\u0650 \u0623\u064e\u0648\u0652 \u0623\u064e\u0643\u0652\u0646\u064e\u0646\u062a\u064f\u0645\u0652 \u0641\u0650\u0649\u0653 \u0623\u064e\u0646\u0641\u064f\u0633\u0650\u0643\u064f\u0645\u0652 \u06da \u0639\u064e\u0644\u0650\u0645\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0623\u064e\u0646\u0651\u064e\u0643\u064f\u0645\u0652 \u0633\u064e\u062a\u064e\u0630\u0652\u0643\u064f\u0631\u064f\u0648\u0646\u064e\u0647\u064f\u0646\u0651\u064e \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646 \u0644\u0651\u064e\u0627 \u062a\u064f\u0648\u064e\u0627\u0639\u0650\u062f\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u0633\u0650\u0631\u0651\u064b\u0627 \u0625\u0650\u0644\u0651\u064e\u0627\u0653 \u0623\u064e\u0646 \u062a\u064e\u0642\u064f\u0648\u0644\u064f\u0648\u0627\u06df \u0642\u064e\u0648\u0652\u0644\u064b\u06ed\u0627 \u0645\u0651\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u064b\u06ed\u0627 \u06da \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0639\u0652\u0632\u0650\u0645\u064f\u0648\u0627\u06df \u0639\u064f\u0642\u0652\u062f\u064e\u0629\u064e \u0671\u0644\u0646\u0651\u0650\u0643\u064e\u0627\u062d\u0650 \u062d\u064e\u062a\u0651\u064e\u0649\u0670 \u064a\u064e\u0628\u0652\u0644\u064f\u063a\u064e \u0671\u0644\u0652\u0643\u0650\u062a\u064e\u0640\u0670\u0628\u064f \u0623\u064e\u062c\u064e\u0644\u064e\u0647\u064f\u06e5 \u06da \u0648\u064e\u0671\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f \u0645\u064e\u0627 \u0641\u0650\u0649\u0653 \u0623\u064e\u0646\u0641\u064f\u0633\u0650\u0643\u064f\u0645\u0652 \u0641\u064e\u0671\u062d\u0652\u0630\u064e\u0631\u064f\u0648\u0647\u064f \u06da \u0648\u064e\u0671\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u063a\u064e\u0641\u064f\u0648\u0631\u064c \u062d\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 235}
{"line": "\u0644\u0651\u064e\u0627 \u062c\u064f\u0646\u064e\u0627\u062d\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0625\u0650\u0646 \u0637\u064e\u0644\u0651\u064e\u0642\u0652\u062a\u064f\u0645\u064f \u0671\u0644\u0646\u0651\u0650\u0633\u064e\u0627\u0653\u0621\u064e \u0645\u064e\u0627 \u0644\u064e\u0645\u0652 \u062a\u064e\u0645\u064e\u0633\u0651\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u0623\u064e\u0648\u0652 \u062a\u064e\u0641\u0652\u0631\u0650\u0636\u064f\u0648\u0627\u06df \u0644\u064e\u0647\u064f\u0646\u0651\u064e \u0641\u064e\u0631\u0650\u064a\u0636\u064e\u0629\u064b\u06ed \u06da \u0648\u064e\u0645\u064e\u062a\u0651\u0650\u0639\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0645\u064f\u0648\u0633\u0650\u0639\u0650 \u0642\u064e\u062f\u064e\u0631\u064f\u0647\u064f\u06e5 \u0648\u064e\u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0645\u064f\u0642\u0652\u062a\u0650\u0631\u0650 \u0642\u064e\u062f\u064e\u0631\u064f\u0647\u064f\u06e5 \u0645\u064e\u062a\u064e\u0640\u0670\u0639\u064b\u06e2\u0627 \u0628\u0650\u0671\u0644\u0652\u0645\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u0650 \u06d6 \u062d\u064e\u0642\u0651\u064b\u0627 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0645\u064f\u062d\u0652\u0633\u0650\u0646\u0650\u064a\u0646\u064e", "num": 236}
{"line": "\u0648\u064e\u0625\u0650\u0646 \u0637\u064e\u0644\u0651\u064e\u0642\u0652\u062a\u064f\u0645\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u0645\u0650\u0646 \u0642\u064e\u0628\u0652\u0644\u0650 \u0623\u064e\u0646 \u062a\u064e\u0645\u064e\u0633\u0651\u064f\u0648\u0647\u064f\u0646\u0651\u064e \u0648\u064e\u0642\u064e\u062f\u0652 \u0641\u064e\u0631\u064e\u0636\u0652\u062a\u064f\u0645\u0652 \u0644\u064e\u0647\u064f\u0646\u0651\u064e \u0641\u064e\u0631\u0650\u064a\u0636\u064e\u0629\u064b\u06ed \u0641\u064e\u0646\u0650\u0635\u0652\u0641\u064f \u0645\u064e\u0627 \u0641\u064e\u0631\u064e\u0636\u0652\u062a\u064f\u0645\u0652 \u0625\u0650\u0644\u0651\u064e\u0627\u0653 \u0623\u064e\u0646 \u064a\u064e\u0639\u0652\u0641\u064f\u0648\u0646\u064e \u0623\u064e\u0648\u0652 \u064a\u064e\u0639\u0652\u0641\u064f\u0648\u064e\u0627\u06df \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u0628\u0650\u064a\u064e\u062f\u0650\u0647\u0650\u06e6 \u0639\u064f\u0642\u0652\u062f\u064e\u0629\u064f \u0671\u0644\u0646\u0651\u0650\u0643\u064e\u0627\u062d\u0650 \u06da \u0648\u064e\u0623\u064e\u0646 \u062a\u064e\u0639\u0652\u0641\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0642\u0652\u0631\u064e\u0628\u064f \u0644\u0650\u0644\u062a\u0651\u064e\u0642\u0652\u0648\u064e\u0649\u0670 \u06da \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0646\u0633\u064e\u0648\u064f\u0627\u06df \u0671\u0644\u0652\u0641\u064e\u0636\u0652\u0644\u064e \u0628\u064e\u064a\u0652\u0646\u064e\u0643\u064f\u0645\u0652 \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0628\u0650\u0645\u064e\u0627 \u062a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e \u0628\u064e\u0635\u0650\u064a\u0631\u064c", "num": 237}
{"line": "\u062d\u064e\u0640\u0670\u0641\u0650\u0638\u064f\u0648\u0627\u06df \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0635\u0651\u064e\u0644\u064e\u0648\u064e\u0670\u062a\u0650 \u0648\u064e\u0671\u0644\u0635\u0651\u064e\u0644\u064e\u0648\u0670\u0629\u0650 \u0671\u0644\u0652\u0648\u064f\u0633\u0652\u0637\u064e\u0649\u0670 \u0648\u064e\u0642\u064f\u0648\u0645\u064f\u0648\u0627\u06df \u0644\u0650\u0644\u0651\u064e\u0647\u0650 \u0642\u064e\u0640\u0670\u0646\u0650\u062a\u0650\u064a\u0646\u064e", "num": 238}
{"line": "\u0641\u064e\u0625\u0650\u0646\u0652 \u062e\u0650\u0641\u0652\u062a\u064f\u0645\u0652 \u0641\u064e\u0631\u0650\u062c\u064e\u0627\u0644\u064b\u0627 \u0623\u064e\u0648\u0652 \u0631\u064f\u0643\u0652\u0628\u064e\u0627\u0646\u064b\u06ed\u0627 \u06d6 \u0641\u064e\u0625\u0650\u0630\u064e\u0627\u0653 \u0623\u064e\u0645\u0650\u0646\u062a\u064f\u0645\u0652 \u0641\u064e\u0671\u0630\u0652\u0643\u064f\u0631\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0643\u064e\u0645\u064e\u0627 \u0639\u064e\u0644\u0651\u064e\u0645\u064e\u0643\u064f\u0645 \u0645\u0651\u064e\u0627 \u0644\u064e\u0645\u0652 \u062a\u064e\u0643\u064f\u0648\u0646\u064f\u0648\u0627\u06df \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 239}
{"line": "\u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064f\u062a\u064e\u0648\u064e\u0641\u0651\u064e\u0648\u0652\u0646\u064e \u0645\u0650\u0646\u0643\u064f\u0645\u0652 \u0648\u064e\u064a\u064e\u0630\u064e\u0631\u064f\u0648\u0646\u064e \u0623\u064e\u0632\u0652\u0648\u064e\u0670\u062c\u064b\u06ed\u0627 \u0648\u064e\u0635\u0650\u064a\u0651\u064e\u0629\u064b\u06ed \u0644\u0651\u0650\u0623\u064e\u0632\u0652\u0648\u064e\u0670\u062c\u0650\u0647\u0650\u0645 \u0645\u0651\u064e\u062a\u064e\u0640\u0670\u0639\u064b\u0627 \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0652\u062d\u064e\u0648\u0652\u0644\u0650 \u063a\u064e\u064a\u0652\u0631\u064e \u0625\u0650\u062e\u0652\u0631\u064e\u0627\u062c\u064d\u06e2 \u06da \u0641\u064e\u0625\u0650\u0646\u0652 \u062e\u064e\u0631\u064e\u062c\u0652\u0646\u064e \u0641\u064e\u0644\u064e\u0627 \u062c\u064f\u0646\u064e\u0627\u062d\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0641\u0650\u0649 \u0645\u064e\u0627 \u0641\u064e\u0639\u064e\u0644\u0652\u0646\u064e \u0641\u0650\u0649\u0653 \u0623\u064e\u0646\u0641\u064f\u0633\u0650\u0647\u0650\u0646\u0651\u064e \u0645\u0650\u0646 \u0645\u0651\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u064d\u06e2 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0632\u0650\u064a\u0632\u064c \u062d\u064e\u0643\u0650\u064a\u0645\u064c\u06ed", "num": 240}
{"line": "\u0648\u064e\u0644\u0650\u0644\u0652\u0645\u064f\u0637\u064e\u0644\u0651\u064e\u0642\u064e\u0640\u0670\u062a\u0650 \u0645\u064e\u062a\u064e\u0640\u0670\u0639\u064c\u06e2 \u0628\u0650\u0671\u0644\u0652\u0645\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u0650 \u06d6 \u062d\u064e\u0642\u0651\u064b\u0627 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0645\u064f\u062a\u0651\u064e\u0642\u0650\u064a\u0646\u064e", "num": 241}
{"line": "\u0643\u064e\u0630\u064e\u0670\u0644\u0650\u0643\u064e \u064a\u064f\u0628\u064e\u064a\u0651\u0650\u0646\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0644\u064e\u0643\u064f\u0645\u0652 \u0621\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u0650\u0647\u0650\u06e6 \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u062a\u064e\u0639\u0652\u0642\u0650\u0644\u064f\u0648\u0646\u064e", "num": 242}
{"line": "\u06de \u0623\u064e\u0644\u064e\u0645\u0652 \u062a\u064e\u0631\u064e \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u062e\u064e\u0631\u064e\u062c\u064f\u0648\u0627\u06df \u0645\u0650\u0646 \u062f\u0650\u064a\u064e\u0640\u0670\u0631\u0650\u0647\u0650\u0645\u0652 \u0648\u064e\u0647\u064f\u0645\u0652 \u0623\u064f\u0644\u064f\u0648\u0641\u064c \u062d\u064e\u0630\u064e\u0631\u064e \u0671\u0644\u0652\u0645\u064e\u0648\u0652\u062a\u0650 \u0641\u064e\u0642\u064e\u0627\u0644\u064e \u0644\u064e\u0647\u064f\u0645\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0645\u064f\u0648\u062a\u064f\u0648\u0627\u06df \u062b\u064f\u0645\u0651\u064e \u0623\u064e\u062d\u0652\u064a\u064e\u0640\u0670\u0647\u064f\u0645\u0652 \u06da \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0644\u064e\u0630\u064f\u0648 \u0641\u064e\u0636\u0652\u0644\u064d \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646\u0651\u064e \u0623\u064e\u0643\u0652\u062b\u064e\u0631\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0644\u064e\u0627 \u064a\u064e\u0634\u0652\u0643\u064f\u0631\u064f\u0648\u0646\u064e", "num": 243}
{"line": "\u0648\u064e\u0642\u064e\u0640\u0670\u062a\u0650\u0644\u064f\u0648\u0627\u06df \u0641\u0650\u0649 \u0633\u064e\u0628\u0650\u064a\u0644\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0671\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0633\u064e\u0645\u0650\u064a\u0639\u064c \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 244}
{"line": "\u0645\u0651\u064e\u0646 \u0630\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u064a\u064f\u0642\u0652\u0631\u0650\u0636\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0642\u064e\u0631\u0652\u0636\u064b\u0627 \u062d\u064e\u0633\u064e\u0646\u064b\u06ed\u0627 \u0641\u064e\u064a\u064f\u0636\u064e\u0640\u0670\u0639\u0650\u0641\u064e\u0647\u064f\u06e5 \u0644\u064e\u0647\u064f\u06e5\u0653 \u0623\u064e\u0636\u0652\u0639\u064e\u0627\u0641\u064b\u06ed\u0627 \u0643\u064e\u062b\u0650\u064a\u0631\u064e\u0629\u064b\u06ed \u06da \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064e\u0642\u0652\u0628\u0650\u0636\u064f \u0648\u064e\u064a\u064e\u0628\u0652\u0635\u06dc\u064f\u0637\u064f \u0648\u064e\u0625\u0650\u0644\u064e\u064a\u0652\u0647\u0650 \u062a\u064f\u0631\u0652\u062c\u064e\u0639\u064f\u0648\u0646\u064e", "num": 245}
{"line": "\u0623\u064e\u0644\u064e\u0645\u0652 \u062a\u064e\u0631\u064e \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0652\u0645\u064e\u0644\u064e\u0625\u0650 \u0645\u0650\u0646\u06e2 \u0628\u064e\u0646\u0650\u0649\u0653 \u0625\u0650\u0633\u0652\u0631\u064e\u0670\u0653\u0621\u0650\u064a\u0644\u064e \u0645\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0645\u064f\u0648\u0633\u064e\u0649\u0670\u0653 \u0625\u0650\u0630\u0652 \u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0644\u0650\u0646\u064e\u0628\u0650\u0649\u0651\u064d\u06e2 \u0644\u0651\u064e\u0647\u064f\u0645\u064f \u0671\u0628\u0652\u0639\u064e\u062b\u0652 \u0644\u064e\u0646\u064e\u0627 \u0645\u064e\u0644\u0650\u0643\u064b\u06ed\u0627 \u0646\u0651\u064f\u0642\u064e\u0640\u0670\u062a\u0650\u0644\u0652 \u0641\u0650\u0649 \u0633\u064e\u0628\u0650\u064a\u0644\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d6 \u0642\u064e\u0627\u0644\u064e \u0647\u064e\u0644\u0652 \u0639\u064e\u0633\u064e\u064a\u0652\u062a\u064f\u0645\u0652 \u0625\u0650\u0646 \u0643\u064f\u062a\u0650\u0628\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u0642\u0650\u062a\u064e\u0627\u0644\u064f \u0623\u064e\u0644\u0651\u064e\u0627 \u062a\u064f\u0642\u064e\u0640\u0670\u062a\u0650\u0644\u064f\u0648\u0627\u06df \u06d6 \u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0648\u064e\u0645\u064e\u0627 \u0644\u064e\u0646\u064e\u0627\u0653 \u0623\u064e\u0644\u0651\u064e\u0627 \u0646\u064f\u0642\u064e\u0640\u0670\u062a\u0650\u0644\u064e \u0641\u0650\u0649 \u0633\u064e\u0628\u0650\u064a\u0644\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0642\u064e\u062f\u0652 \u0623\u064f\u062e\u0652\u0631\u0650\u062c\u0652\u0646\u064e\u0627 \u0645\u0650\u0646 \u062f\u0650\u064a\u064e\u0640\u0670\u0631\u0650\u0646\u064e\u0627 \u0648\u064e\u0623\u064e\u0628\u0652\u0646\u064e\u0627\u0653\u0626\u0650\u0646\u064e\u0627 \u06d6 \u0641\u064e\u0644\u064e\u0645\u0651\u064e\u0627 \u0643\u064f\u062a\u0650\u0628\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u064f \u0671\u0644\u0652\u0642\u0650\u062a\u064e\u0627\u0644\u064f \u062a\u064e\u0648\u064e\u0644\u0651\u064e\u0648\u0652\u0627\u06df \u0625\u0650\u0644\u0651\u064e\u0627 \u0642\u064e\u0644\u0650\u064a\u0644\u064b\u06ed\u0627 \u0645\u0651\u0650\u0646\u0652\u0647\u064f\u0645\u0652 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06e2 \u0628\u0650\u0671\u0644\u0638\u0651\u064e\u0640\u0670\u0644\u0650\u0645\u0650\u064a\u0646\u064e", "num": 246}
{"line": "\u0648\u064e\u0642\u064e\u0627\u0644\u064e \u0644\u064e\u0647\u064f\u0645\u0652 \u0646\u064e\u0628\u0650\u064a\u0651\u064f\u0647\u064f\u0645\u0652 \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0642\u064e\u062f\u0652 \u0628\u064e\u0639\u064e\u062b\u064e \u0644\u064e\u0643\u064f\u0645\u0652 \u0637\u064e\u0627\u0644\u064f\u0648\u062a\u064e \u0645\u064e\u0644\u0650\u0643\u064b\u06ed\u0627 \u06da \u0642\u064e\u0627\u0644\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0651\u064e\u0649\u0670 \u064a\u064e\u0643\u064f\u0648\u0646\u064f \u0644\u064e\u0647\u064f \u0671\u0644\u0652\u0645\u064f\u0644\u0652\u0643\u064f \u0639\u064e\u0644\u064e\u064a\u0652\u0646\u064e\u0627 \u0648\u064e\u0646\u064e\u062d\u0652\u0646\u064f \u0623\u064e\u062d\u064e\u0642\u0651\u064f \u0628\u0650\u0671\u0644\u0652\u0645\u064f\u0644\u0652\u0643\u0650 \u0645\u0650\u0646\u0652\u0647\u064f \u0648\u064e\u0644\u064e\u0645\u0652 \u064a\u064f\u0624\u0652\u062a\u064e \u0633\u064e\u0639\u064e\u0629\u064b\u06ed \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0652\u0645\u064e\u0627\u0644\u0650 \u06da \u0642\u064e\u0627\u0644\u064e \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0671\u0635\u0652\u0637\u064e\u0641\u064e\u0649\u0670\u0647\u064f \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0648\u064e\u0632\u064e\u0627\u062f\u064e\u0647\u064f\u06e5 \u0628\u064e\u0633\u0652\u0637\u064e\u0629\u064b\u06ed \u0641\u0650\u0649 \u0671\u0644\u0652\u0639\u0650\u0644\u0652\u0645\u0650 \u0648\u064e\u0671\u0644\u0652\u062c\u0650\u0633\u0652\u0645\u0650 \u06d6 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064f\u0624\u0652\u062a\u0650\u0649 \u0645\u064f\u0644\u0652\u0643\u064e\u0647\u064f\u06e5 \u0645\u064e\u0646 \u064a\u064e\u0634\u064e\u0627\u0653\u0621\u064f \u06da \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0648\u064e\u0670\u0633\u0650\u0639\u064c \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 247}
{"line": "\u0648\u064e\u0642\u064e\u0627\u0644\u064e \u0644\u064e\u0647\u064f\u0645\u0652 \u0646\u064e\u0628\u0650\u064a\u0651\u064f\u0647\u064f\u0645\u0652 \u0625\u0650\u0646\u0651\u064e \u0621\u064e\u0627\u064a\u064e\u0629\u064e \u0645\u064f\u0644\u0652\u0643\u0650\u0647\u0650\u06e6\u0653 \u0623\u064e\u0646 \u064a\u064e\u0623\u0652\u062a\u0650\u064a\u064e\u0643\u064f\u0645\u064f \u0671\u0644\u062a\u0651\u064e\u0627\u0628\u064f\u0648\u062a\u064f \u0641\u0650\u064a\u0647\u0650 \u0633\u064e\u0643\u0650\u064a\u0646\u064e\u0629\u064c\u06ed \u0645\u0651\u0650\u0646 \u0631\u0651\u064e\u0628\u0651\u0650\u0643\u064f\u0645\u0652 \u0648\u064e\u0628\u064e\u0642\u0650\u064a\u0651\u064e\u0629\u064c\u06ed \u0645\u0651\u0650\u0645\u0651\u064e\u0627 \u062a\u064e\u0631\u064e\u0643\u064e \u0621\u064e\u0627\u0644\u064f \u0645\u064f\u0648\u0633\u064e\u0649\u0670 \u0648\u064e\u0621\u064e\u0627\u0644\u064f \u0647\u064e\u0640\u0670\u0631\u064f\u0648\u0646\u064e \u062a\u064e\u062d\u0652\u0645\u0650\u0644\u064f\u0647\u064f \u0671\u0644\u0652\u0645\u064e\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e\u0629\u064f \u06da \u0625\u0650\u0646\u0651\u064e \u0641\u0650\u0649 \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u0644\u064e\u0640\u0654\u064e\u0627\u064a\u064e\u0629\u064b\u06ed \u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645 \u0645\u0651\u064f\u0624\u0652\u0645\u0650\u0646\u0650\u064a\u0646\u064e", "num": 248}
{"line": "\u0641\u064e\u0644\u064e\u0645\u0651\u064e\u0627 \u0641\u064e\u0635\u064e\u0644\u064e \u0637\u064e\u0627\u0644\u064f\u0648\u062a\u064f \u0628\u0650\u0671\u0644\u0652\u062c\u064f\u0646\u064f\u0648\u062f\u0650 \u0642\u064e\u0627\u0644\u064e \u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0645\u064f\u0628\u0652\u062a\u064e\u0644\u0650\u064a\u0643\u064f\u0645 \u0628\u0650\u0646\u064e\u0647\u064e\u0631\u064d\u06e2 \u0641\u064e\u0645\u064e\u0646 \u0634\u064e\u0631\u0650\u0628\u064e \u0645\u0650\u0646\u0652\u0647\u064f \u0641\u064e\u0644\u064e\u064a\u0652\u0633\u064e \u0645\u0650\u0646\u0651\u0650\u0649 \u0648\u064e\u0645\u064e\u0646 \u0644\u0651\u064e\u0645\u0652 \u064a\u064e\u0637\u0652\u0639\u064e\u0645\u0652\u0647\u064f \u0641\u064e\u0625\u0650\u0646\u0651\u064e\u0647\u064f\u06e5 \u0645\u0650\u0646\u0651\u0650\u0649\u0653 \u0625\u0650\u0644\u0651\u064e\u0627 \u0645\u064e\u0646\u0650 \u0671\u063a\u0652\u062a\u064e\u0631\u064e\u0641\u064e \u063a\u064f\u0631\u0652\u0641\u064e\u0629\u064b\u06e2 \u0628\u0650\u064a\u064e\u062f\u0650\u0647\u0650\u06e6 \u06da \u0641\u064e\u0634\u064e\u0631\u0650\u0628\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u0652\u0647\u064f \u0625\u0650\u0644\u0651\u064e\u0627 \u0642\u064e\u0644\u0650\u064a\u0644\u064b\u06ed\u0627 \u0645\u0651\u0650\u0646\u0652\u0647\u064f\u0645\u0652 \u06da \u0641\u064e\u0644\u064e\u0645\u0651\u064e\u0627 \u062c\u064e\u0627\u0648\u064e\u0632\u064e\u0647\u064f\u06e5 \u0647\u064f\u0648\u064e \u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0645\u064e\u0639\u064e\u0647\u064f\u06e5 \u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0644\u064e\u0627 \u0637\u064e\u0627\u0642\u064e\u0629\u064e \u0644\u064e\u0646\u064e\u0627 \u0671\u0644\u0652\u064a\u064e\u0648\u0652\u0645\u064e \u0628\u0650\u062c\u064e\u0627\u0644\u064f\u0648\u062a\u064e \u0648\u064e\u062c\u064f\u0646\u064f\u0648\u062f\u0650\u0647\u0650\u06e6 \u06da \u0642\u064e\u0627\u0644\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064e\u0638\u064f\u0646\u0651\u064f\u0648\u0646\u064e \u0623\u064e\u0646\u0651\u064e\u0647\u064f\u0645 \u0645\u0651\u064f\u0644\u064e\u0640\u0670\u0642\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0643\u064e\u0645 \u0645\u0651\u0650\u0646 \u0641\u0650\u0626\u064e\u0629\u064d\u06e2 \u0642\u064e\u0644\u0650\u064a\u0644\u064e\u0629\u064d \u063a\u064e\u0644\u064e\u0628\u064e\u062a\u0652 \u0641\u0650\u0626\u064e\u0629\u064b\u06ed \u0643\u064e\u062b\u0650\u064a\u0631\u064e\u0629\u064b\u06e2 \u0628\u0650\u0625\u0650\u0630\u0652\u0646\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0645\u064e\u0639\u064e \u0671\u0644\u0635\u0651\u064e\u0640\u0670\u0628\u0650\u0631\u0650\u064a\u0646\u064e", "num": 249}
{"line": "\u0648\u064e\u0644\u064e\u0645\u0651\u064e\u0627 \u0628\u064e\u0631\u064e\u0632\u064f\u0648\u0627\u06df \u0644\u0650\u062c\u064e\u0627\u0644\u064f\u0648\u062a\u064e \u0648\u064e\u062c\u064f\u0646\u064f\u0648\u062f\u0650\u0647\u0650\u06e6 \u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0631\u064e\u0628\u0651\u064e\u0646\u064e\u0627\u0653 \u0623\u064e\u0641\u0652\u0631\u0650\u063a\u0652 \u0639\u064e\u0644\u064e\u064a\u0652\u0646\u064e\u0627 \u0635\u064e\u0628\u0652\u0631\u064b\u06ed\u0627 \u0648\u064e\u062b\u064e\u0628\u0651\u0650\u062a\u0652 \u0623\u064e\u0642\u0652\u062f\u064e\u0627\u0645\u064e\u0646\u064e\u0627 \u0648\u064e\u0671\u0646\u0635\u064f\u0631\u0652\u0646\u064e\u0627 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0642\u064e\u0648\u0652\u0645\u0650 \u0671\u0644\u0652\u0643\u064e\u0640\u0670\u0641\u0650\u0631\u0650\u064a\u0646\u064e", "num": 250}
{"line": "\u0641\u064e\u0647\u064e\u0632\u064e\u0645\u064f\u0648\u0647\u064f\u0645 \u0628\u0650\u0625\u0650\u0630\u0652\u0646\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0642\u064e\u062a\u064e\u0644\u064e \u062f\u064e\u0627\u0648\u064f\u06e5\u062f\u064f \u062c\u064e\u0627\u0644\u064f\u0648\u062a\u064e \u0648\u064e\u0621\u064e\u0627\u062a\u064e\u0649\u0670\u0647\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0671\u0644\u0652\u0645\u064f\u0644\u0652\u0643\u064e \u0648\u064e\u0671\u0644\u0652\u062d\u0650\u0643\u0652\u0645\u064e\u0629\u064e \u0648\u064e\u0639\u064e\u0644\u0651\u064e\u0645\u064e\u0647\u064f\u06e5 \u0645\u0650\u0645\u0651\u064e\u0627 \u064a\u064e\u0634\u064e\u0627\u0653\u0621\u064f \u06d7 \u0648\u064e\u0644\u064e\u0648\u0652\u0644\u064e\u0627 \u062f\u064e\u0641\u0652\u0639\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u064e \u0628\u064e\u0639\u0652\u0636\u064e\u0647\u064f\u0645 \u0628\u0650\u0628\u064e\u0639\u0652\u0636\u064d\u06e2 \u0644\u0651\u064e\u0641\u064e\u0633\u064e\u062f\u064e\u062a\u0650 \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u064f \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0630\u064f\u0648 \u0641\u064e\u0636\u0652\u0644\u064d \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0639\u064e\u0640\u0670\u0644\u064e\u0645\u0650\u064a\u0646\u064e", "num": 251}
{"line": "\u062a\u0650\u0644\u0652\u0643\u064e \u0621\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0646\u064e\u062a\u0652\u0644\u064f\u0648\u0647\u064e\u0627 \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064e \u0628\u0650\u0671\u0644\u0652\u062d\u064e\u0642\u0651\u0650 \u06da \u0648\u064e\u0625\u0650\u0646\u0651\u064e\u0643\u064e \u0644\u064e\u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0645\u064f\u0631\u0652\u0633\u064e\u0644\u0650\u064a\u0646\u064e", "num": 252}
{"line": "\u06de \u062a\u0650\u0644\u0652\u0643\u064e \u0671\u0644\u0631\u0651\u064f\u0633\u064f\u0644\u064f \u0641\u064e\u0636\u0651\u064e\u0644\u0652\u0646\u064e\u0627 \u0628\u064e\u0639\u0652\u0636\u064e\u0647\u064f\u0645\u0652 \u0639\u064e\u0644\u064e\u0649\u0670 \u0628\u064e\u0639\u0652\u0636\u064d\u06e2 \u06d8 \u0645\u0651\u0650\u0646\u0652\u0647\u064f\u0645 \u0645\u0651\u064e\u0646 \u0643\u064e\u0644\u0651\u064e\u0645\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u06d6 \u0648\u064e\u0631\u064e\u0641\u064e\u0639\u064e \u0628\u064e\u0639\u0652\u0636\u064e\u0647\u064f\u0645\u0652 \u062f\u064e\u0631\u064e\u062c\u064e\u0640\u0670\u062a\u064d\u06e2 \u06da \u0648\u064e\u0621\u064e\u0627\u062a\u064e\u064a\u0652\u0646\u064e\u0627 \u0639\u0650\u064a\u0633\u064e\u0649 \u0671\u0628\u0652\u0646\u064e \u0645\u064e\u0631\u0652\u064a\u064e\u0645\u064e \u0671\u0644\u0652\u0628\u064e\u064a\u0651\u0650\u0646\u064e\u0640\u0670\u062a\u0650 \u0648\u064e\u0623\u064e\u064a\u0651\u064e\u062f\u0652\u0646\u064e\u0640\u0670\u0647\u064f \u0628\u0650\u0631\u064f\u0648\u062d\u0650 \u0671\u0644\u0652\u0642\u064f\u062f\u064f\u0633\u0650 \u06d7 \u0648\u064e\u0644\u064e\u0648\u0652 \u0634\u064e\u0627\u0653\u0621\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0645\u064e\u0627 \u0671\u0642\u0652\u062a\u064e\u062a\u064e\u0644\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0645\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650\u0647\u0650\u0645 \u0645\u0651\u0650\u0646\u06e2 \u0628\u064e\u0639\u0652\u062f\u0650 \u0645\u064e\u0627 \u062c\u064e\u0627\u0653\u0621\u064e\u062a\u0652\u0647\u064f\u0645\u064f \u0671\u0644\u0652\u0628\u064e\u064a\u0651\u0650\u0646\u064e\u0640\u0670\u062a\u064f \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646\u0650 \u0671\u062e\u0652\u062a\u064e\u0644\u064e\u0641\u064f\u0648\u0627\u06df \u0641\u064e\u0645\u0650\u0646\u0652\u0647\u064f\u0645 \u0645\u0651\u064e\u0646\u0652 \u0621\u064e\u0627\u0645\u064e\u0646\u064e \u0648\u064e\u0645\u0650\u0646\u0652\u0647\u064f\u0645 \u0645\u0651\u064e\u0646 \u0643\u064e\u0641\u064e\u0631\u064e \u06da \u0648\u064e\u0644\u064e\u0648\u0652 \u0634\u064e\u0627\u0653\u0621\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0645\u064e\u0627 \u0671\u0642\u0652\u062a\u064e\u062a\u064e\u0644\u064f\u0648\u0627\u06df \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u064a\u064e\u0641\u0652\u0639\u064e\u0644\u064f \u0645\u064e\u0627 \u064a\u064f\u0631\u0650\u064a\u062f\u064f", "num": 253}
{"line": "\u064a\u064e\u0640\u0670\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0641\u0650\u0642\u064f\u0648\u0627\u06df \u0645\u0650\u0645\u0651\u064e\u0627 \u0631\u064e\u0632\u064e\u0642\u0652\u0646\u064e\u0640\u0670\u0643\u064f\u0645 \u0645\u0651\u0650\u0646 \u0642\u064e\u0628\u0652\u0644\u0650 \u0623\u064e\u0646 \u064a\u064e\u0623\u0652\u062a\u0650\u0649\u064e \u064a\u064e\u0648\u0652\u0645\u064c\u06ed \u0644\u0651\u064e\u0627 \u0628\u064e\u064a\u0652\u0639\u064c\u06ed \u0641\u0650\u064a\u0647\u0650 \u0648\u064e\u0644\u064e\u0627 \u062e\u064f\u0644\u0651\u064e\u0629\u064c\u06ed \u0648\u064e\u0644\u064e\u0627 \u0634\u064e\u0641\u064e\u0640\u0670\u0639\u064e\u0629\u064c\u06ed \u06d7 \u0648\u064e\u0671\u0644\u0652\u0643\u064e\u0640\u0670\u0641\u0650\u0631\u064f\u0648\u0646\u064e \u0647\u064f\u0645\u064f \u0671\u0644\u0638\u0651\u064e\u0640\u0670\u0644\u0650\u0645\u064f\u0648\u0646\u064e", "num": 254}
{"line": "\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0644\u064e\u0627\u0653 \u0625\u0650\u0644\u064e\u0640\u0670\u0647\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0647\u064f\u0648\u064e \u0671\u0644\u0652\u062d\u064e\u0649\u0651\u064f \u0671\u0644\u0652\u0642\u064e\u064a\u0651\u064f\u0648\u0645\u064f \u06da \u0644\u064e\u0627 \u062a\u064e\u0623\u0652\u062e\u064f\u0630\u064f\u0647\u064f\u06e5 \u0633\u0650\u0646\u064e\u0629\u064c\u06ed \u0648\u064e\u0644\u064e\u0627 \u0646\u064e\u0648\u0652\u0645\u064c\u06ed \u06da \u0644\u0651\u064e\u0647\u064f\u06e5 \u0645\u064e\u0627 \u0641\u0650\u0649 \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0640\u0670\u0648\u064e\u0670\u062a\u0650 \u0648\u064e\u0645\u064e\u0627 \u0641\u0650\u0649 \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u06d7 \u0645\u064e\u0646 \u0630\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u064a\u064e\u0634\u0652\u0641\u064e\u0639\u064f \u0639\u0650\u0646\u062f\u064e\u0647\u064f\u06e5\u0653 \u0625\u0650\u0644\u0651\u064e\u0627 \u0628\u0650\u0625\u0650\u0630\u0652\u0646\u0650\u0647\u0650\u06e6 \u06da \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f \u0645\u064e\u0627 \u0628\u064e\u064a\u0652\u0646\u064e \u0623\u064e\u064a\u0652\u062f\u0650\u064a\u0647\u0650\u0645\u0652 \u0648\u064e\u0645\u064e\u0627 \u062e\u064e\u0644\u0652\u0641\u064e\u0647\u064f\u0645\u0652 \u06d6 \u0648\u064e\u0644\u064e\u0627 \u064a\u064f\u062d\u0650\u064a\u0637\u064f\u0648\u0646\u064e \u0628\u0650\u0634\u064e\u0649\u0652\u0621\u064d\u06e2 \u0645\u0651\u0650\u0646\u0652 \u0639\u0650\u0644\u0652\u0645\u0650\u0647\u0650\u06e6\u0653 \u0625\u0650\u0644\u0651\u064e\u0627 \u0628\u0650\u0645\u064e\u0627 \u0634\u064e\u0627\u0653\u0621\u064e \u06da \u0648\u064e\u0633\u0650\u0639\u064e \u0643\u064f\u0631\u0652\u0633\u0650\u064a\u0651\u064f\u0647\u064f \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0640\u0670\u0648\u064e\u0670\u062a\u0650 \u0648\u064e\u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u064e \u06d6 \u0648\u064e\u0644\u064e\u0627 \u064a\u064e\u0640\u0654\u064f\u0648\u062f\u064f\u0647\u064f\u06e5 \u062d\u0650\u0641\u0652\u0638\u064f\u0647\u064f\u0645\u064e\u0627 \u06da \u0648\u064e\u0647\u064f\u0648\u064e \u0671\u0644\u0652\u0639\u064e\u0644\u0650\u0649\u0651\u064f \u0671\u0644\u0652\u0639\u064e\u0638\u0650\u064a\u0645\u064f", "num": 255}
{"line": "\u0644\u064e\u0627\u0653 \u0625\u0650\u0643\u0652\u0631\u064e\u0627\u0647\u064e \u0641\u0650\u0649 \u0671\u0644\u062f\u0651\u0650\u064a\u0646\u0650 \u06d6 \u0642\u064e\u062f \u062a\u0651\u064e\u0628\u064e\u064a\u0651\u064e\u0646\u064e \u0671\u0644\u0631\u0651\u064f\u0634\u0652\u062f\u064f \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u063a\u064e\u0649\u0651\u0650 \u06da \u0641\u064e\u0645\u064e\u0646 \u064a\u064e\u0643\u0652\u0641\u064f\u0631\u0652 \u0628\u0650\u0671\u0644\u0637\u0651\u064e\u0640\u0670\u063a\u064f\u0648\u062a\u0650 \u0648\u064e\u064a\u064f\u0624\u0652\u0645\u0650\u0646\u06e2 \u0628\u0650\u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0641\u064e\u0642\u064e\u062f\u0650 \u0671\u0633\u0652\u062a\u064e\u0645\u0652\u0633\u064e\u0643\u064e \u0628\u0650\u0671\u0644\u0652\u0639\u064f\u0631\u0652\u0648\u064e\u0629\u0650 \u0671\u0644\u0652\u0648\u064f\u062b\u0652\u0642\u064e\u0649\u0670 \u0644\u064e\u0627 \u0671\u0646\u0641\u0650\u0635\u064e\u0627\u0645\u064e \u0644\u064e\u0647\u064e\u0627 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0633\u064e\u0645\u0650\u064a\u0639\u064c \u0639\u064e\u0644\u0650\u064a\u0645\u064c", "num": 256}
{"line": "\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0648\u064e\u0644\u0650\u0649\u0651\u064f \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u064a\u064f\u062e\u0652\u0631\u0650\u062c\u064f\u0647\u064f\u0645 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0638\u0651\u064f\u0644\u064f\u0645\u064e\u0640\u0670\u062a\u0650 \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0646\u0651\u064f\u0648\u0631\u0650 \u06d6 \u0648\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0643\u064e\u0641\u064e\u0631\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0648\u0652\u0644\u0650\u064a\u064e\u0627\u0653\u0624\u064f\u0647\u064f\u0645\u064f \u0671\u0644\u0637\u0651\u064e\u0640\u0670\u063a\u064f\u0648\u062a\u064f \u064a\u064f\u062e\u0652\u0631\u0650\u062c\u064f\u0648\u0646\u064e\u0647\u064f\u0645 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0646\u0651\u064f\u0648\u0631\u0650 \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0638\u0651\u064f\u0644\u064f\u0645\u064e\u0640\u0670\u062a\u0650 \u06d7 \u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0623\u064e\u0635\u0652\u062d\u064e\u0640\u0670\u0628\u064f \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u0650 \u06d6 \u0647\u064f\u0645\u0652 \u0641\u0650\u064a\u0647\u064e\u0627 \u062e\u064e\u0640\u0670\u0644\u0650\u062f\u064f\u0648\u0646\u064e", "num": 257}
{"line": "\u0623\u064e\u0644\u064e\u0645\u0652 \u062a\u064e\u0631\u064e \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u062d\u064e\u0627\u0653\u062c\u0651\u064e \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064e \u0641\u0650\u0649 \u0631\u064e\u0628\u0651\u0650\u0647\u0650\u06e6\u0653 \u0623\u064e\u0646\u0652 \u0621\u064e\u0627\u062a\u064e\u0649\u0670\u0647\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0671\u0644\u0652\u0645\u064f\u0644\u0652\u0643\u064e \u0625\u0650\u0630\u0652 \u0642\u064e\u0627\u0644\u064e \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064f \u0631\u064e\u0628\u0651\u0650\u0649\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u064a\u064f\u062d\u0652\u0649\u0650\u06e6 \u0648\u064e\u064a\u064f\u0645\u0650\u064a\u062a\u064f \u0642\u064e\u0627\u0644\u064e \u0623\u064e\u0646\u064e\u0627\u06e0 \u0623\u064f\u062d\u0652\u0649\u0650\u06e6 \u0648\u064e\u0623\u064f\u0645\u0650\u064a\u062a\u064f \u06d6 \u0642\u064e\u0627\u0644\u064e \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064f \u0641\u064e\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u064a\u064e\u0623\u0652\u062a\u0650\u0649 \u0628\u0650\u0671\u0644\u0634\u0651\u064e\u0645\u0652\u0633\u0650 \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0645\u064e\u0634\u0652\u0631\u0650\u0642\u0650 \u0641\u064e\u0623\u0652\u062a\u0650 \u0628\u0650\u0647\u064e\u0627 \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0645\u064e\u063a\u0652\u0631\u0650\u0628\u0650 \u0641\u064e\u0628\u064f\u0647\u0650\u062a\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u0643\u064e\u0641\u064e\u0631\u064e \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0644\u064e\u0627 \u064a\u064e\u0647\u0652\u062f\u0650\u0649 \u0671\u0644\u0652\u0642\u064e\u0648\u0652\u0645\u064e \u0671\u0644\u0638\u0651\u064e\u0640\u0670\u0644\u0650\u0645\u0650\u064a\u0646\u064e", "num": 258}
{"line": "\u0623\u064e\u0648\u0652 \u0643\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u0645\u064e\u0631\u0651\u064e \u0639\u064e\u0644\u064e\u0649\u0670 \u0642\u064e\u0631\u0652\u064a\u064e\u0629\u064d\u06e2 \u0648\u064e\u0647\u0650\u0649\u064e \u062e\u064e\u0627\u0648\u0650\u064a\u064e\u0629\u064c \u0639\u064e\u0644\u064e\u0649\u0670 \u0639\u064f\u0631\u064f\u0648\u0634\u0650\u0647\u064e\u0627 \u0642\u064e\u0627\u0644\u064e \u0623\u064e\u0646\u0651\u064e\u0649\u0670 \u064a\u064f\u062d\u0652\u0649\u0650\u06e6 \u0647\u064e\u0640\u0670\u0630\u0650\u0647\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u064e\u0639\u0652\u062f\u064e \u0645\u064e\u0648\u0652\u062a\u0650\u0647\u064e\u0627 \u06d6 \u0641\u064e\u0623\u064e\u0645\u064e\u0627\u062a\u064e\u0647\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0645\u0650\u0627\u06df\u0626\u064e\u0629\u064e \u0639\u064e\u0627\u0645\u064d\u06e2 \u062b\u064f\u0645\u0651\u064e \u0628\u064e\u0639\u064e\u062b\u064e\u0647\u064f\u06e5 \u06d6 \u0642\u064e\u0627\u0644\u064e \u0643\u064e\u0645\u0652 \u0644\u064e\u0628\u0650\u062b\u0652\u062a\u064e \u06d6 \u0642\u064e\u0627\u0644\u064e \u0644\u064e\u0628\u0650\u062b\u0652\u062a\u064f \u064a\u064e\u0648\u0652\u0645\u064b\u0627 \u0623\u064e\u0648\u0652 \u0628\u064e\u0639\u0652\u0636\u064e \u064a\u064e\u0648\u0652\u0645\u064d\u06e2 \u06d6 \u0642\u064e\u0627\u0644\u064e \u0628\u064e\u0644 \u0644\u0651\u064e\u0628\u0650\u062b\u0652\u062a\u064e \u0645\u0650\u0627\u06df\u0626\u064e\u0629\u064e \u0639\u064e\u0627\u0645\u064d\u06e2 \u0641\u064e\u0671\u0646\u0638\u064f\u0631\u0652 \u0625\u0650\u0644\u064e\u0649\u0670 \u0637\u064e\u0639\u064e\u0627\u0645\u0650\u0643\u064e \u0648\u064e\u0634\u064e\u0631\u064e\u0627\u0628\u0650\u0643\u064e \u0644\u064e\u0645\u0652 \u064a\u064e\u062a\u064e\u0633\u064e\u0646\u0651\u064e\u0647\u0652 \u06d6 \u0648\u064e\u0671\u0646\u0638\u064f\u0631\u0652 \u0625\u0650\u0644\u064e\u0649\u0670 \u062d\u0650\u0645\u064e\u0627\u0631\u0650\u0643\u064e \u0648\u064e\u0644\u0650\u0646\u064e\u062c\u0652\u0639\u064e\u0644\u064e\u0643\u064e \u0621\u064e\u0627\u064a\u064e\u0629\u064b\u06ed \u0644\u0651\u0650\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u06d6 \u0648\u064e\u0671\u0646\u0638\u064f\u0631\u0652 \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0652\u0639\u0650\u0638\u064e\u0627\u0645\u0650 \u0643\u064e\u064a\u0652\u0641\u064e \u0646\u064f\u0646\u0634\u0650\u0632\u064f\u0647\u064e\u0627 \u062b\u064f\u0645\u0651\u064e \u0646\u064e\u0643\u0652\u0633\u064f\u0648\u0647\u064e\u0627 \u0644\u064e\u062d\u0652\u0645\u064b\u06ed\u0627 \u06da \u0641\u064e\u0644\u064e\u0645\u0651\u064e\u0627 \u062a\u064e\u0628\u064e\u064a\u0651\u064e\u0646\u064e \u0644\u064e\u0647\u064f\u06e5 \u0642\u064e\u0627\u0644\u064e \u0623\u064e\u0639\u0652\u0644\u064e\u0645\u064f \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u064e\u0644\u064e\u0649\u0670 \u0643\u064f\u0644\u0651\u0650 \u0634\u064e\u0649\u0652\u0621\u064d\u06e2 \u0642\u064e\u062f\u0650\u064a\u0631\u064c\u06ed", "num": 259}
{"line": "\u0648\u064e\u0625\u0650\u0630\u0652 \u0642\u064e\u0627\u0644\u064e \u0625\u0650\u0628\u0652\u0631\u064e\u0670\u0647\u0650\u0640\u06e7\u0645\u064f \u0631\u064e\u0628\u0651\u0650 \u0623\u064e\u0631\u0650\u0646\u0650\u0649 \u0643\u064e\u064a\u0652\u0641\u064e \u062a\u064f\u062d\u0652\u0649\u0650 \u0671\u0644\u0652\u0645\u064e\u0648\u0652\u062a\u064e\u0649\u0670 \u06d6 \u0642\u064e\u0627\u0644\u064e \u0623\u064e\u0648\u064e\u0644\u064e\u0645\u0652 \u062a\u064f\u0624\u0652\u0645\u0650\u0646 \u06d6 \u0642\u064e\u0627\u0644\u064e \u0628\u064e\u0644\u064e\u0649\u0670 \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646 \u0644\u0651\u0650\u064a\u064e\u0637\u0652\u0645\u064e\u0626\u0650\u0646\u0651\u064e \u0642\u064e\u0644\u0652\u0628\u0650\u0649 \u06d6 \u0642\u064e\u0627\u0644\u064e \u0641\u064e\u062e\u064f\u0630\u0652 \u0623\u064e\u0631\u0652\u0628\u064e\u0639\u064e\u0629\u064b\u06ed \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0637\u0651\u064e\u064a\u0652\u0631\u0650 \u0641\u064e\u0635\u064f\u0631\u0652\u0647\u064f\u0646\u0651\u064e \u0625\u0650\u0644\u064e\u064a\u0652\u0643\u064e \u062b\u064f\u0645\u0651\u064e \u0671\u062c\u0652\u0639\u064e\u0644\u0652 \u0639\u064e\u0644\u064e\u0649\u0670 \u0643\u064f\u0644\u0651\u0650 \u062c\u064e\u0628\u064e\u0644\u064d\u06e2 \u0645\u0651\u0650\u0646\u0652\u0647\u064f\u0646\u0651\u064e \u062c\u064f\u0632\u0652\u0621\u064b\u06ed\u0627 \u062b\u064f\u0645\u0651\u064e \u0671\u062f\u0652\u0639\u064f\u0647\u064f\u0646\u0651\u064e \u064a\u064e\u0623\u0652\u062a\u0650\u064a\u0646\u064e\u0643\u064e \u0633\u064e\u0639\u0652\u064a\u064b\u06ed\u0627 \u06da \u0648\u064e\u0671\u0639\u0652\u0644\u064e\u0645\u0652 \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0639\u064e\u0632\u0650\u064a\u0632\u064c \u062d\u064e\u0643\u0650\u064a\u0645\u064c\u06ed", "num": 260}
{"line": "\u0645\u0651\u064e\u062b\u064e\u0644\u064f \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064f\u0646\u0641\u0650\u0642\u064f\u0648\u0646\u064e \u0623\u064e\u0645\u0652\u0648\u064e\u0670\u0644\u064e\u0647\u064f\u0645\u0652 \u0641\u0650\u0649 \u0633\u064e\u0628\u0650\u064a\u0644\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0643\u064e\u0645\u064e\u062b\u064e\u0644\u0650 \u062d\u064e\u0628\u0651\u064e\u0629\u064d \u0623\u064e\u0646\u06e2\u0628\u064e\u062a\u064e\u062a\u0652 \u0633\u064e\u0628\u0652\u0639\u064e \u0633\u064e\u0646\u064e\u0627\u0628\u0650\u0644\u064e \u0641\u0650\u0649 \u0643\u064f\u0644\u0651\u0650 \u0633\u064f\u0646\u06e2\u0628\u064f\u0644\u064e\u0629\u064d\u06e2 \u0645\u0651\u0650\u0627\u06df\u0626\u064e\u0629\u064f \u062d\u064e\u0628\u0651\u064e\u0629\u064d\u06e2 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064f\u0636\u064e\u0640\u0670\u0639\u0650\u0641\u064f \u0644\u0650\u0645\u064e\u0646 \u064a\u064e\u0634\u064e\u0627\u0653\u0621\u064f \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0648\u064e\u0670\u0633\u0650\u0639\u064c \u0639\u064e\u0644\u0650\u064a\u0645\u064c", "num": 261}
{"line": "\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064f\u0646\u0641\u0650\u0642\u064f\u0648\u0646\u064e \u0623\u064e\u0645\u0652\u0648\u064e\u0670\u0644\u064e\u0647\u064f\u0645\u0652 \u0641\u0650\u0649 \u0633\u064e\u0628\u0650\u064a\u0644\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u062b\u064f\u0645\u0651\u064e \u0644\u064e\u0627 \u064a\u064f\u062a\u0652\u0628\u0650\u0639\u064f\u0648\u0646\u064e \u0645\u064e\u0627\u0653 \u0623\u064e\u0646\u0641\u064e\u0642\u064f\u0648\u0627\u06df \u0645\u064e\u0646\u0651\u064b\u06ed\u0627 \u0648\u064e\u0644\u064e\u0627\u0653 \u0623\u064e\u0630\u064b\u06ed\u0649 \u06d9 \u0644\u0651\u064e\u0647\u064f\u0645\u0652 \u0623\u064e\u062c\u0652\u0631\u064f\u0647\u064f\u0645\u0652 \u0639\u0650\u0646\u062f\u064e \u0631\u064e\u0628\u0651\u0650\u0647\u0650\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u062e\u064e\u0648\u0652\u0641\u064c \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u0647\u064f\u0645\u0652 \u064a\u064e\u062d\u0652\u0632\u064e\u0646\u064f\u0648\u0646\u064e", "num": 262}
{"line": "\u06de \u0642\u064e\u0648\u0652\u0644\u064c\u06ed \u0645\u0651\u064e\u0639\u0652\u0631\u064f\u0648\u0641\u064c\u06ed \u0648\u064e\u0645\u064e\u063a\u0652\u0641\u0650\u0631\u064e\u0629\u064c \u062e\u064e\u064a\u0652\u0631\u064c\u06ed \u0645\u0651\u0650\u0646 \u0635\u064e\u062f\u064e\u0642\u064e\u0629\u064d\u06e2 \u064a\u064e\u062a\u0652\u0628\u064e\u0639\u064f\u0647\u064e\u0627\u0653 \u0623\u064e\u0630\u064b\u06ed\u0649 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u063a\u064e\u0646\u0650\u0649\u0651\u064c \u062d\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 263}
{"line": "\u064a\u064e\u0640\u0670\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0644\u064e\u0627 \u062a\u064f\u0628\u0652\u0637\u0650\u0644\u064f\u0648\u0627\u06df \u0635\u064e\u062f\u064e\u0642\u064e\u0640\u0670\u062a\u0650\u0643\u064f\u0645 \u0628\u0650\u0671\u0644\u0652\u0645\u064e\u0646\u0651\u0650 \u0648\u064e\u0671\u0644\u0652\u0623\u064e\u0630\u064e\u0649\u0670 \u0643\u064e\u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u064a\u064f\u0646\u0641\u0650\u0642\u064f \u0645\u064e\u0627\u0644\u064e\u0647\u064f\u06e5 \u0631\u0650\u0626\u064e\u0627\u0653\u0621\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u0650 \u0648\u064e\u0644\u064e\u0627 \u064a\u064f\u0624\u0652\u0645\u0650\u0646\u064f \u0628\u0650\u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0671\u0644\u0652\u064a\u064e\u0648\u0652\u0645\u0650 \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u062e\u0650\u0631\u0650 \u06d6 \u0641\u064e\u0645\u064e\u062b\u064e\u0644\u064f\u0647\u064f\u06e5 \u0643\u064e\u0645\u064e\u062b\u064e\u0644\u0650 \u0635\u064e\u0641\u0652\u0648\u064e\u0627\u0646\u064d \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u062a\u064f\u0631\u064e\u0627\u0628\u064c\u06ed \u0641\u064e\u0623\u064e\u0635\u064e\u0627\u0628\u064e\u0647\u064f\u06e5 \u0648\u064e\u0627\u0628\u0650\u0644\u064c\u06ed \u0641\u064e\u062a\u064e\u0631\u064e\u0643\u064e\u0647\u064f\u06e5 \u0635\u064e\u0644\u0652\u062f\u064b\u06ed\u0627 \u06d6 \u0644\u0651\u064e\u0627 \u064a\u064e\u0642\u0652\u062f\u0650\u0631\u064f\u0648\u0646\u064e \u0639\u064e\u0644\u064e\u0649\u0670 \u0634\u064e\u0649\u0652\u0621\u064d\u06e2 \u0645\u0651\u0650\u0645\u0651\u064e\u0627 \u0643\u064e\u0633\u064e\u0628\u064f\u0648\u0627\u06df \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0644\u064e\u0627 \u064a\u064e\u0647\u0652\u062f\u0650\u0649 \u0671\u0644\u0652\u0642\u064e\u0648\u0652\u0645\u064e \u0671\u0644\u0652\u0643\u064e\u0640\u0670\u0641\u0650\u0631\u0650\u064a\u0646\u064e", "num": 264}
{"line": "\u0648\u064e\u0645\u064e\u062b\u064e\u0644\u064f \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064f\u0646\u0641\u0650\u0642\u064f\u0648\u0646\u064e \u0623\u064e\u0645\u0652\u0648\u064e\u0670\u0644\u064e\u0647\u064f\u0645\u064f \u0671\u0628\u0652\u062a\u0650\u063a\u064e\u0627\u0653\u0621\u064e \u0645\u064e\u0631\u0652\u0636\u064e\u0627\u062a\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u062a\u064e\u062b\u0652\u0628\u0650\u064a\u062a\u064b\u06ed\u0627 \u0645\u0651\u0650\u0646\u0652 \u0623\u064e\u0646\u0641\u064f\u0633\u0650\u0647\u0650\u0645\u0652 \u0643\u064e\u0645\u064e\u062b\u064e\u0644\u0650 \u062c\u064e\u0646\u0651\u064e\u0629\u064d\u06ed \u0628\u0650\u0631\u064e\u0628\u0652\u0648\u064e\u0629\u064d \u0623\u064e\u0635\u064e\u0627\u0628\u064e\u0647\u064e\u0627 \u0648\u064e\u0627\u0628\u0650\u0644\u064c\u06ed \u0641\u064e\u0640\u0654\u064e\u0627\u062a\u064e\u062a\u0652 \u0623\u064f\u0643\u064f\u0644\u064e\u0647\u064e\u0627 \u0636\u0650\u0639\u0652\u0641\u064e\u064a\u0652\u0646\u0650 \u0641\u064e\u0625\u0650\u0646 \u0644\u0651\u064e\u0645\u0652 \u064a\u064f\u0635\u0650\u0628\u0652\u0647\u064e\u0627 \u0648\u064e\u0627\u0628\u0650\u0644\u064c\u06ed \u0641\u064e\u0637\u064e\u0644\u0651\u064c\u06ed \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u0645\u064e\u0627 \u062a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e \u0628\u064e\u0635\u0650\u064a\u0631\u064c", "num": 265}
{"line": "\u0623\u064e\u064a\u064e\u0648\u064e\u062f\u0651\u064f \u0623\u064e\u062d\u064e\u062f\u064f\u0643\u064f\u0645\u0652 \u0623\u064e\u0646 \u062a\u064e\u0643\u064f\u0648\u0646\u064e \u0644\u064e\u0647\u064f\u06e5 \u062c\u064e\u0646\u0651\u064e\u0629\u064c\u06ed \u0645\u0651\u0650\u0646 \u0646\u0651\u064e\u062e\u0650\u064a\u0644\u064d\u06e2 \u0648\u064e\u0623\u064e\u0639\u0652\u0646\u064e\u0627\u0628\u064d\u06e2 \u062a\u064e\u062c\u0652\u0631\u0650\u0649 \u0645\u0650\u0646 \u062a\u064e\u062d\u0652\u062a\u0650\u0647\u064e\u0627 \u0671\u0644\u0652\u0623\u064e\u0646\u0652\u0647\u064e\u0640\u0670\u0631\u064f \u0644\u064e\u0647\u064f\u06e5 \u0641\u0650\u064a\u0647\u064e\u0627 \u0645\u0650\u0646 \u0643\u064f\u0644\u0651\u0650 \u0671\u0644\u062b\u0651\u064e\u0645\u064e\u0631\u064e\u0670\u062a\u0650 \u0648\u064e\u0623\u064e\u0635\u064e\u0627\u0628\u064e\u0647\u064f \u0671\u0644\u0652\u0643\u0650\u0628\u064e\u0631\u064f \u0648\u064e\u0644\u064e\u0647\u064f\u06e5 \u0630\u064f\u0631\u0651\u0650\u064a\u0651\u064e\u0629\u064c\u06ed \u0636\u064f\u0639\u064e\u0641\u064e\u0627\u0653\u0621\u064f \u0641\u064e\u0623\u064e\u0635\u064e\u0627\u0628\u064e\u0647\u064e\u0627\u0653 \u0625\u0650\u0639\u0652\u0635\u064e\u0627\u0631\u064c\u06ed \u0641\u0650\u064a\u0647\u0650 \u0646\u064e\u0627\u0631\u064c\u06ed \u0641\u064e\u0671\u062d\u0652\u062a\u064e\u0631\u064e\u0642\u064e\u062a\u0652 \u06d7 \u0643\u064e\u0630\u064e\u0670\u0644\u0650\u0643\u064e \u064a\u064f\u0628\u064e\u064a\u0651\u0650\u0646\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0644\u064e\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u0640\u0654\u064e\u0627\u064a\u064e\u0640\u0670\u062a\u0650 \u0644\u064e\u0639\u064e\u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u062a\u064e\u062a\u064e\u0641\u064e\u0643\u0651\u064e\u0631\u064f\u0648\u0646\u064e", "num": 266}
{"line": "\u064a\u064e\u0640\u0670\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0641\u0650\u0642\u064f\u0648\u0627\u06df \u0645\u0650\u0646 \u0637\u064e\u064a\u0651\u0650\u0628\u064e\u0640\u0670\u062a\u0650 \u0645\u064e\u0627 \u0643\u064e\u0633\u064e\u0628\u0652\u062a\u064f\u0645\u0652 \u0648\u064e\u0645\u0650\u0645\u0651\u064e\u0627\u0653 \u0623\u064e\u062e\u0652\u0631\u064e\u062c\u0652\u0646\u064e\u0627 \u0644\u064e\u0643\u064f\u0645 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u06d6 \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u064a\u064e\u0645\u0651\u064e\u0645\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u062e\u064e\u0628\u0650\u064a\u062b\u064e \u0645\u0650\u0646\u0652\u0647\u064f \u062a\u064f\u0646\u0641\u0650\u0642\u064f\u0648\u0646\u064e \u0648\u064e\u0644\u064e\u0633\u0652\u062a\u064f\u0645 \u0628\u0650\u0640\u0654\u064e\u0627\u062e\u0650\u0630\u0650\u064a\u0647\u0650 \u0625\u0650\u0644\u0651\u064e\u0627\u0653 \u0623\u064e\u0646 \u062a\u064f\u063a\u0652\u0645\u0650\u0636\u064f\u0648\u0627\u06df \u0641\u0650\u064a\u0647\u0650 \u06da \u0648\u064e\u0671\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u063a\u064e\u0646\u0650\u0649\u0651\u064c \u062d\u064e\u0645\u0650\u064a\u062f\u064c", "num": 267}
{"line": "\u0671\u0644\u0634\u0651\u064e\u064a\u0652\u0637\u064e\u0640\u0670\u0646\u064f \u064a\u064e\u0639\u0650\u062f\u064f\u0643\u064f\u0645\u064f \u0671\u0644\u0652\u0641\u064e\u0642\u0652\u0631\u064e \u0648\u064e\u064a\u064e\u0623\u0652\u0645\u064f\u0631\u064f\u0643\u064f\u0645 \u0628\u0650\u0671\u0644\u0652\u0641\u064e\u062d\u0652\u0634\u064e\u0627\u0653\u0621\u0650 \u06d6 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u064a\u064e\u0639\u0650\u062f\u064f\u0643\u064f\u0645 \u0645\u0651\u064e\u063a\u0652\u0641\u0650\u0631\u064e\u0629\u064b\u06ed \u0645\u0651\u0650\u0646\u0652\u0647\u064f \u0648\u064e\u0641\u064e\u0636\u0652\u0644\u064b\u06ed\u0627 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0648\u064e\u0670\u0633\u0650\u0639\u064c \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 268}
{"line": "\u064a\u064f\u0624\u0652\u062a\u0650\u0649 \u0671\u0644\u0652\u062d\u0650\u0643\u0652\u0645\u064e\u0629\u064e \u0645\u064e\u0646 \u064a\u064e\u0634\u064e\u0627\u0653\u0621\u064f \u06da \u0648\u064e\u0645\u064e\u0646 \u064a\u064f\u0624\u0652\u062a\u064e \u0671\u0644\u0652\u062d\u0650\u0643\u0652\u0645\u064e\u0629\u064e \u0641\u064e\u0642\u064e\u062f\u0652 \u0623\u064f\u0648\u062a\u0650\u0649\u064e \u062e\u064e\u064a\u0652\u0631\u064b\u06ed\u0627 \u0643\u064e\u062b\u0650\u064a\u0631\u064b\u06ed\u0627 \u06d7 \u0648\u064e\u0645\u064e\u0627 \u064a\u064e\u0630\u0651\u064e\u0643\u0651\u064e\u0631\u064f \u0625\u0650\u0644\u0651\u064e\u0627\u0653 \u0623\u064f\u0648\u06df\u0644\u064f\u0648\u0627\u06df \u0671\u0644\u0652\u0623\u064e\u0644\u0652\u0628\u064e\u0640\u0670\u0628\u0650", "num": 269}
{"line": "\u0648\u064e\u0645\u064e\u0627\u0653 \u0623\u064e\u0646\u0641\u064e\u0642\u0652\u062a\u064f\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064e\u0641\u064e\u0642\u064e\u0629\u064d \u0623\u064e\u0648\u0652 \u0646\u064e\u0630\u064e\u0631\u0652\u062a\u064f\u0645 \u0645\u0651\u0650\u0646 \u0646\u0651\u064e\u0630\u0652\u0631\u064d\u06e2 \u0641\u064e\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u064a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0647\u064f\u06e5 \u06d7 \u0648\u064e\u0645\u064e\u0627 \u0644\u0650\u0644\u0638\u0651\u064e\u0640\u0670\u0644\u0650\u0645\u0650\u064a\u0646\u064e \u0645\u0650\u0646\u0652 \u0623\u064e\u0646\u0635\u064e\u0627\u0631\u064d", "num": 270}
{"line": "\u0625\u0650\u0646 \u062a\u064f\u0628\u0652\u062f\u064f\u0648\u0627\u06df \u0671\u0644\u0635\u0651\u064e\u062f\u064e\u0642\u064e\u0640\u0670\u062a\u0650 \u0641\u064e\u0646\u0650\u0639\u0650\u0645\u0651\u064e\u0627 \u0647\u0650\u0649\u064e \u06d6 \u0648\u064e\u0625\u0650\u0646 \u062a\u064f\u062e\u0652\u0641\u064f\u0648\u0647\u064e\u0627 \u0648\u064e\u062a\u064f\u0624\u0652\u062a\u064f\u0648\u0647\u064e\u0627 \u0671\u0644\u0652\u0641\u064f\u0642\u064e\u0631\u064e\u0627\u0653\u0621\u064e \u0641\u064e\u0647\u064f\u0648\u064e \u062e\u064e\u064a\u0652\u0631\u064c\u06ed \u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u06da \u0648\u064e\u064a\u064f\u0643\u064e\u0641\u0651\u0650\u0631\u064f \u0639\u064e\u0646\u0643\u064f\u0645 \u0645\u0651\u0650\u0646 \u0633\u064e\u064a\u0651\u0650\u0640\u0654\u064e\u0627\u062a\u0650\u0643\u064f\u0645\u0652 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u0645\u064e\u0627 \u062a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e \u062e\u064e\u0628\u0650\u064a\u0631\u064c\u06ed", "num": 271}
{"line": "\u06de \u0644\u0651\u064e\u064a\u0652\u0633\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064e \u0647\u064f\u062f\u064e\u0649\u0670\u0647\u064f\u0645\u0652 \u0648\u064e\u0644\u064e\u0640\u0670\u0643\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u064a\u064e\u0647\u0652\u062f\u0650\u0649 \u0645\u064e\u0646 \u064a\u064e\u0634\u064e\u0627\u0653\u0621\u064f \u06d7 \u0648\u064e\u0645\u064e\u0627 \u062a\u064f\u0646\u0641\u0650\u0642\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u0652 \u062e\u064e\u064a\u0652\u0631\u064d\u06e2 \u0641\u064e\u0644\u0650\u0623\u064e\u0646\u0641\u064f\u0633\u0650\u0643\u064f\u0645\u0652 \u06da \u0648\u064e\u0645\u064e\u0627 \u062a\u064f\u0646\u0641\u0650\u0642\u064f\u0648\u0646\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0671\u0628\u0652\u062a\u0650\u063a\u064e\u0627\u0653\u0621\u064e \u0648\u064e\u062c\u0652\u0647\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06da \u0648\u064e\u0645\u064e\u0627 \u062a\u064f\u0646\u0641\u0650\u0642\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u0652 \u062e\u064e\u064a\u0652\u0631\u064d\u06e2 \u064a\u064f\u0648\u064e\u0641\u0651\u064e \u0625\u0650\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u0648\u064e\u0623\u064e\u0646\u062a\u064f\u0645\u0652 \u0644\u064e\u0627 \u062a\u064f\u0638\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 272}
{"line": "\u0644\u0650\u0644\u0652\u0641\u064f\u0642\u064e\u0631\u064e\u0627\u0653\u0621\u0650 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0623\u064f\u062d\u0652\u0635\u0650\u0631\u064f\u0648\u0627\u06df \u0641\u0650\u0649 \u0633\u064e\u0628\u0650\u064a\u0644\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0644\u064e\u0627 \u064a\u064e\u0633\u0652\u062a\u064e\u0637\u0650\u064a\u0639\u064f\u0648\u0646\u064e \u0636\u064e\u0631\u0652\u0628\u064b\u06ed\u0627 \u0641\u0650\u0649 \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u064a\u064e\u062d\u0652\u0633\u064e\u0628\u064f\u0647\u064f\u0645\u064f \u0671\u0644\u0652\u062c\u064e\u0627\u0647\u0650\u0644\u064f \u0623\u064e\u063a\u0652\u0646\u0650\u064a\u064e\u0627\u0653\u0621\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u062a\u0651\u064e\u0639\u064e\u0641\u0651\u064f\u0641\u0650 \u062a\u064e\u0639\u0652\u0631\u0650\u0641\u064f\u0647\u064f\u0645 \u0628\u0650\u0633\u0650\u064a\u0645\u064e\u0640\u0670\u0647\u064f\u0645\u0652 \u0644\u064e\u0627 \u064a\u064e\u0633\u0652\u0640\u0654\u064e\u0644\u064f\u0648\u0646\u064e \u0671\u0644\u0646\u0651\u064e\u0627\u0633\u064e \u0625\u0650\u0644\u0652\u062d\u064e\u0627\u0641\u064b\u06ed\u0627 \u06d7 \u0648\u064e\u0645\u064e\u0627 \u062a\u064f\u0646\u0641\u0650\u0642\u064f\u0648\u0627\u06df \u0645\u0650\u0646\u0652 \u062e\u064e\u064a\u0652\u0631\u064d\u06e2 \u0641\u064e\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0628\u0650\u0647\u0650\u06e6 \u0639\u064e\u0644\u0650\u064a\u0645\u064c", "num": 273}
{"line": "\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064f\u0646\u0641\u0650\u0642\u064f\u0648\u0646\u064e \u0623\u064e\u0645\u0652\u0648\u064e\u0670\u0644\u064e\u0647\u064f\u0645 \u0628\u0650\u0671\u0644\u0651\u064e\u064a\u0652\u0644\u0650 \u0648\u064e\u0671\u0644\u0646\u0651\u064e\u0647\u064e\u0627\u0631\u0650 \u0633\u0650\u0631\u0651\u064b\u06ed\u0627 \u0648\u064e\u0639\u064e\u0644\u064e\u0627\u0646\u0650\u064a\u064e\u0629\u064b\u06ed \u0641\u064e\u0644\u064e\u0647\u064f\u0645\u0652 \u0623\u064e\u062c\u0652\u0631\u064f\u0647\u064f\u0645\u0652 \u0639\u0650\u0646\u062f\u064e \u0631\u064e\u0628\u0651\u0650\u0647\u0650\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u062e\u064e\u0648\u0652\u0641\u064c \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u0647\u064f\u0645\u0652 \u064a\u064e\u062d\u0652\u0632\u064e\u0646\u064f\u0648\u0646\u064e", "num": 274}
{"line": "\u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u064a\u064e\u0623\u0652\u0643\u064f\u0644\u064f\u0648\u0646\u064e \u0671\u0644\u0631\u0651\u0650\u0628\u064e\u0648\u0670\u0627\u06df \u0644\u064e\u0627 \u064a\u064e\u0642\u064f\u0648\u0645\u064f\u0648\u0646\u064e \u0625\u0650\u0644\u0651\u064e\u0627 \u0643\u064e\u0645\u064e\u0627 \u064a\u064e\u0642\u064f\u0648\u0645\u064f \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u064a\u064e\u062a\u064e\u062e\u064e\u0628\u0651\u064e\u0637\u064f\u0647\u064f \u0671\u0644\u0634\u0651\u064e\u064a\u0652\u0637\u064e\u0640\u0670\u0646\u064f \u0645\u0650\u0646\u064e \u0671\u0644\u0652\u0645\u064e\u0633\u0651\u0650 \u06da \u0630\u064e\u0670\u0644\u0650\u0643\u064e \u0628\u0650\u0623\u064e\u0646\u0651\u064e\u0647\u064f\u0645\u0652 \u0642\u064e\u0627\u0644\u064f\u0648\u0653\u0627\u06df \u0625\u0650\u0646\u0651\u064e\u0645\u064e\u0627 \u0671\u0644\u0652\u0628\u064e\u064a\u0652\u0639\u064f \u0645\u0650\u062b\u0652\u0644\u064f \u0671\u0644\u0631\u0651\u0650\u0628\u064e\u0648\u0670\u0627\u06df \u06d7 \u0648\u064e\u0623\u064e\u062d\u064e\u0644\u0651\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0671\u0644\u0652\u0628\u064e\u064a\u0652\u0639\u064e \u0648\u064e\u062d\u064e\u0631\u0651\u064e\u0645\u064e \u0671\u0644\u0631\u0651\u0650\u0628\u064e\u0648\u0670\u0627\u06df \u06da \u0641\u064e\u0645\u064e\u0646 \u062c\u064e\u0627\u0653\u0621\u064e\u0647\u064f\u06e5 \u0645\u064e\u0648\u0652\u0639\u0650\u0638\u064e\u0629\u064c\u06ed \u0645\u0651\u0650\u0646 \u0631\u0651\u064e\u0628\u0651\u0650\u0647\u0650\u06e6 \u0641\u064e\u0671\u0646\u062a\u064e\u0647\u064e\u0649\u0670 \u0641\u064e\u0644\u064e\u0647\u064f\u06e5 \u0645\u064e\u0627 \u0633\u064e\u0644\u064e\u0641\u064e \u0648\u064e\u0623\u064e\u0645\u0652\u0631\u064f\u0647\u064f\u06e5\u0653 \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d6 \u0648\u064e\u0645\u064e\u0646\u0652 \u0639\u064e\u0627\u062f\u064e \u0641\u064e\u0623\u064f\u0648\u06df\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e \u0623\u064e\u0635\u0652\u062d\u064e\u0640\u0670\u0628\u064f \u0671\u0644\u0646\u0651\u064e\u0627\u0631\u0650 \u06d6 \u0647\u064f\u0645\u0652 \u0641\u0650\u064a\u0647\u064e\u0627 \u062e\u064e\u0640\u0670\u0644\u0650\u062f\u064f\u0648\u0646\u064e", "num": 275}
{"line": "\u064a\u064e\u0645\u0652\u062d\u064e\u0642\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0671\u0644\u0631\u0651\u0650\u0628\u064e\u0648\u0670\u0627\u06df \u0648\u064e\u064a\u064f\u0631\u0652\u0628\u0650\u0649 \u0671\u0644\u0635\u0651\u064e\u062f\u064e\u0642\u064e\u0640\u0670\u062a\u0650 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0644\u064e\u0627 \u064a\u064f\u062d\u0650\u0628\u0651\u064f \u0643\u064f\u0644\u0651\u064e \u0643\u064e\u0641\u0651\u064e\u0627\u0631\u064d \u0623\u064e\u062b\u0650\u064a\u0645\u064d", "num": 276}
{"line": "\u0625\u0650\u0646\u0651\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0648\u064e\u0639\u064e\u0645\u0650\u0644\u064f\u0648\u0627\u06df \u0671\u0644\u0635\u0651\u064e\u0640\u0670\u0644\u0650\u062d\u064e\u0640\u0670\u062a\u0650 \u0648\u064e\u0623\u064e\u0642\u064e\u0627\u0645\u064f\u0648\u0627\u06df \u0671\u0644\u0635\u0651\u064e\u0644\u064e\u0648\u0670\u0629\u064e \u0648\u064e\u0621\u064e\u0627\u062a\u064e\u0648\u064f\u0627\u06df \u0671\u0644\u0632\u0651\u064e\u0643\u064e\u0648\u0670\u0629\u064e \u0644\u064e\u0647\u064f\u0645\u0652 \u0623\u064e\u062c\u0652\u0631\u064f\u0647\u064f\u0645\u0652 \u0639\u0650\u0646\u062f\u064e \u0631\u064e\u0628\u0651\u0650\u0647\u0650\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u062e\u064e\u0648\u0652\u0641\u064c \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650\u0645\u0652 \u0648\u064e\u0644\u064e\u0627 \u0647\u064f\u0645\u0652 \u064a\u064e\u062d\u0652\u0632\u064e\u0646\u064f\u0648\u0646\u064e", "num": 277}
{"line": "\u064a\u064e\u0640\u0670\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0627\u06df \u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0648\u064e\u0630\u064e\u0631\u064f\u0648\u0627\u06df \u0645\u064e\u0627 \u0628\u064e\u0642\u0650\u0649\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0631\u0651\u0650\u0628\u064e\u0648\u0670\u0653\u0627\u06df \u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645 \u0645\u0651\u064f\u0624\u0652\u0645\u0650\u0646\u0650\u064a\u0646\u064e", "num": 278}
{"line": "\u0641\u064e\u0625\u0650\u0646 \u0644\u0651\u064e\u0645\u0652 \u062a\u064e\u0641\u0652\u0639\u064e\u0644\u064f\u0648\u0627\u06df \u0641\u064e\u0623\u0652\u0630\u064e\u0646\u064f\u0648\u0627\u06df \u0628\u0650\u062d\u064e\u0631\u0652\u0628\u064d\u06e2 \u0645\u0651\u0650\u0646\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0631\u064e\u0633\u064f\u0648\u0644\u0650\u0647\u0650\u06e6 \u06d6 \u0648\u064e\u0625\u0650\u0646 \u062a\u064f\u0628\u0652\u062a\u064f\u0645\u0652 \u0641\u064e\u0644\u064e\u0643\u064f\u0645\u0652 \u0631\u064f\u0621\u064f\u0648\u0633\u064f \u0623\u064e\u0645\u0652\u0648\u064e\u0670\u0644\u0650\u0643\u064f\u0645\u0652 \u0644\u064e\u0627 \u062a\u064e\u0638\u0652\u0644\u0650\u0645\u064f\u0648\u0646\u064e \u0648\u064e\u0644\u064e\u0627 \u062a\u064f\u0638\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 279}
{"line": "\u0648\u064e\u0625\u0650\u0646 \u0643\u064e\u0627\u0646\u064e \u0630\u064f\u0648 \u0639\u064f\u0633\u0652\u0631\u064e\u0629\u064d\u06e2 \u0641\u064e\u0646\u064e\u0638\u0650\u0631\u064e\u0629\u064c \u0625\u0650\u0644\u064e\u0649\u0670 \u0645\u064e\u064a\u0652\u0633\u064e\u0631\u064e\u0629\u064d\u06e2 \u06da \u0648\u064e\u0623\u064e\u0646 \u062a\u064e\u0635\u064e\u062f\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u062e\u064e\u064a\u0652\u0631\u064c\u06ed \u0644\u0651\u064e\u0643\u064f\u0645\u0652 \u06d6 \u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u062a\u064e\u0639\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 280}
{"line": "\u0648\u064e\u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u064a\u064e\u0648\u0652\u0645\u064b\u06ed\u0627 \u062a\u064f\u0631\u0652\u062c\u064e\u0639\u064f\u0648\u0646\u064e \u0641\u0650\u064a\u0647\u0650 \u0625\u0650\u0644\u064e\u0649 \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u06d6 \u062b\u064f\u0645\u0651\u064e \u062a\u064f\u0648\u064e\u0641\u0651\u064e\u0649\u0670 \u0643\u064f\u0644\u0651\u064f \u0646\u064e\u0641\u0652\u0633\u064d\u06e2 \u0645\u0651\u064e\u0627 \u0643\u064e\u0633\u064e\u0628\u064e\u062a\u0652 \u0648\u064e\u0647\u064f\u0645\u0652 \u0644\u064e\u0627 \u064a\u064f\u0638\u0652\u0644\u064e\u0645\u064f\u0648\u0646\u064e", "num": 281}
{"line": "\u064a\u064e\u0640\u0670\u0653\u0623\u064e\u064a\u0651\u064f\u0647\u064e\u0627 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0621\u064e\u0627\u0645\u064e\u0646\u064f\u0648\u0653\u0627\u06df \u0625\u0650\u0630\u064e\u0627 \u062a\u064e\u062f\u064e\u0627\u064a\u064e\u0646\u062a\u064f\u0645 \u0628\u0650\u062f\u064e\u064a\u0652\u0646\u064d \u0625\u0650\u0644\u064e\u0649\u0670\u0653 \u0623\u064e\u062c\u064e\u0644\u064d\u06e2 \u0645\u0651\u064f\u0633\u064e\u0645\u0651\u064b\u06ed\u0649 \u0641\u064e\u0671\u0643\u0652\u062a\u064f\u0628\u064f\u0648\u0647\u064f \u06da \u0648\u064e\u0644\u0652\u064a\u064e\u0643\u0652\u062a\u064f\u0628 \u0628\u0651\u064e\u064a\u0652\u0646\u064e\u0643\u064f\u0645\u0652 \u0643\u064e\u0627\u062a\u0650\u0628\u064c\u06e2 \u0628\u0650\u0671\u0644\u0652\u0639\u064e\u062f\u0652\u0644\u0650 \u06da \u0648\u064e\u0644\u064e\u0627 \u064a\u064e\u0623\u0652\u0628\u064e \u0643\u064e\u0627\u062a\u0650\u0628\u064c \u0623\u064e\u0646 \u064a\u064e\u0643\u0652\u062a\u064f\u0628\u064e \u0643\u064e\u0645\u064e\u0627 \u0639\u064e\u0644\u0651\u064e\u0645\u064e\u0647\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u06da \u0641\u064e\u0644\u0652\u064a\u064e\u0643\u0652\u062a\u064f\u0628\u0652 \u0648\u064e\u0644\u0652\u064a\u064f\u0645\u0652\u0644\u0650\u0644\u0650 \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0671\u0644\u0652\u062d\u064e\u0642\u0651\u064f \u0648\u064e\u0644\u0652\u064a\u064e\u062a\u0651\u064e\u0642\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0631\u064e\u0628\u0651\u064e\u0647\u064f\u06e5 \u0648\u064e\u0644\u064e\u0627 \u064a\u064e\u0628\u0652\u062e\u064e\u0633\u0652 \u0645\u0650\u0646\u0652\u0647\u064f \u0634\u064e\u064a\u0652\u0640\u0654\u064b\u06ed\u0627 \u06da \u0641\u064e\u0625\u0650\u0646 \u0643\u064e\u0627\u0646\u064e \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u0639\u064e\u0644\u064e\u064a\u0652\u0647\u0650 \u0671\u0644\u0652\u062d\u064e\u0642\u0651\u064f \u0633\u064e\u0641\u0650\u064a\u0647\u064b\u0627 \u0623\u064e\u0648\u0652 \u0636\u064e\u0639\u0650\u064a\u0641\u064b\u0627 \u0623\u064e\u0648\u0652 \u0644\u064e\u0627 \u064a\u064e\u0633\u0652\u062a\u064e\u0637\u0650\u064a\u0639\u064f \u0623\u064e\u0646 \u064a\u064f\u0645\u0650\u0644\u0651\u064e \u0647\u064f\u0648\u064e \u0641\u064e\u0644\u0652\u064a\u064f\u0645\u0652\u0644\u0650\u0644\u0652 \u0648\u064e\u0644\u0650\u064a\u0651\u064f\u0647\u064f\u06e5 \u0628\u0650\u0671\u0644\u0652\u0639\u064e\u062f\u0652\u0644\u0650 \u06da \u0648\u064e\u0671\u0633\u0652\u062a\u064e\u0634\u0652\u0647\u0650\u062f\u064f\u0648\u0627\u06df \u0634\u064e\u0647\u0650\u064a\u062f\u064e\u064a\u0652\u0646\u0650 \u0645\u0650\u0646 \u0631\u0651\u0650\u062c\u064e\u0627\u0644\u0650\u0643\u064f\u0645\u0652 \u06d6 \u0641\u064e\u0625\u0650\u0646 \u0644\u0651\u064e\u0645\u0652 \u064a\u064e\u0643\u064f\u0648\u0646\u064e\u0627 \u0631\u064e\u062c\u064f\u0644\u064e\u064a\u0652\u0646\u0650 \u0641\u064e\u0631\u064e\u062c\u064f\u0644\u064c\u06ed \u0648\u064e\u0671\u0645\u0652\u0631\u064e\u0623\u064e\u062a\u064e\u0627\u0646\u0650 \u0645\u0650\u0645\u0651\u064e\u0646 \u062a\u064e\u0631\u0652\u0636\u064e\u0648\u0652\u0646\u064e \u0645\u0650\u0646\u064e \u0671\u0644\u0634\u0651\u064f\u0647\u064e\u062f\u064e\u0627\u0653\u0621\u0650 \u0623\u064e\u0646 \u062a\u064e\u0636\u0650\u0644\u0651\u064e \u0625\u0650\u062d\u0652\u062f\u064e\u0649\u0670\u0647\u064f\u0645\u064e\u0627 \u0641\u064e\u062a\u064f\u0630\u064e\u0643\u0651\u0650\u0631\u064e \u0625\u0650\u062d\u0652\u062f\u064e\u0649\u0670\u0647\u064f\u0645\u064e\u0627 \u0671\u0644\u0652\u0623\u064f\u062e\u0652\u0631\u064e\u0649\u0670 \u06da \u0648\u064e\u0644\u064e\u0627 \u064a\u064e\u0623\u0652\u0628\u064e \u0671\u0644\u0634\u0651\u064f\u0647\u064e\u062f\u064e\u0627\u0653\u0621\u064f \u0625\u0650\u0630\u064e\u0627 \u0645\u064e\u0627 \u062f\u064f\u0639\u064f\u0648\u0627\u06df \u06da \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0633\u0652\u0640\u0654\u064e\u0645\u064f\u0648\u0653\u0627\u06df \u0623\u064e\u0646 \u062a\u064e\u0643\u0652\u062a\u064f\u0628\u064f\u0648\u0647\u064f \u0635\u064e\u063a\u0650\u064a\u0631\u064b\u0627 \u0623\u064e\u0648\u0652 \u0643\u064e\u0628\u0650\u064a\u0631\u064b\u0627 \u0625\u0650\u0644\u064e\u0649\u0670\u0653 \u0623\u064e\u062c\u064e\u0644\u0650\u0647\u0650\u06e6 \u06da \u0630\u064e\u0670\u0644\u0650\u0643\u064f\u0645\u0652 \u0623\u064e\u0642\u0652\u0633\u064e\u0637\u064f \u0639\u0650\u0646\u062f\u064e \u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0623\u064e\u0642\u0652\u0648\u064e\u0645\u064f \u0644\u0650\u0644\u0634\u0651\u064e\u0647\u064e\u0640\u0670\u062f\u064e\u0629\u0650 \u0648\u064e\u0623\u064e\u062f\u0652\u0646\u064e\u0649\u0670\u0653 \u0623\u064e\u0644\u0651\u064e\u0627 \u062a\u064e\u0631\u0652\u062a\u064e\u0627\u0628\u064f\u0648\u0653\u0627\u06df \u06d6 \u0625\u0650\u0644\u0651\u064e\u0627\u0653 \u0623\u064e\u0646 \u062a\u064e\u0643\u064f\u0648\u0646\u064e \u062a\u0650\u062c\u064e\u0640\u0670\u0631\u064e\u0629\u064b \u062d\u064e\u0627\u0636\u0650\u0631\u064e\u0629\u064b\u06ed \u062a\u064f\u062f\u0650\u064a\u0631\u064f\u0648\u0646\u064e\u0647\u064e\u0627 \u0628\u064e\u064a\u0652\u0646\u064e\u0643\u064f\u0645\u0652 \u0641\u064e\u0644\u064e\u064a\u0652\u0633\u064e \u0639\u064e\u0644\u064e\u064a\u0652\u0643\u064f\u0645\u0652 \u062c\u064f\u0646\u064e\u0627\u062d\u064c \u0623\u064e\u0644\u0651\u064e\u0627 \u062a\u064e\u0643\u0652\u062a\u064f\u0628\u064f\u0648\u0647\u064e\u0627 \u06d7 \u0648\u064e\u0623\u064e\u0634\u0652\u0647\u0650\u062f\u064f\u0648\u0653\u0627\u06df \u0625\u0650\u0630\u064e\u0627 \u062a\u064e\u0628\u064e\u0627\u064a\u064e\u0639\u0652\u062a\u064f\u0645\u0652 \u06da \u0648\u064e\u0644\u064e\u0627 \u064a\u064f\u0636\u064e\u0627\u0653\u0631\u0651\u064e \u0643\u064e\u0627\u062a\u0650\u0628\u064c\u06ed \u0648\u064e\u0644\u064e\u0627 \u0634\u064e\u0647\u0650\u064a\u062f\u064c\u06ed \u06da \u0648\u064e\u0625\u0650\u0646 \u062a\u064e\u0641\u0652\u0639\u064e\u0644\u064f\u0648\u0627\u06df \u0641\u064e\u0625\u0650\u0646\u0651\u064e\u0647\u064f\u06e5 \u0641\u064f\u0633\u064f\u0648\u0642\u064c\u06e2 \u0628\u0650\u0643\u064f\u0645\u0652 \u06d7 \u0648\u064e\u0671\u062a\u0651\u064e\u0642\u064f\u0648\u0627\u06df \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u06d6 \u0648\u064e\u064a\u064f\u0639\u064e\u0644\u0651\u0650\u0645\u064f\u0643\u064f\u0645\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u0643\u064f\u0644\u0651\u0650 \u0634\u064e\u0649\u0652\u0621\u064d \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 282}
{"line": "\u06de \u0648\u064e\u0625\u0650\u0646 \u0643\u064f\u0646\u062a\u064f\u0645\u0652 \u0639\u064e\u0644\u064e\u0649\u0670 \u0633\u064e\u0641\u064e\u0631\u064d\u06e2 \u0648\u064e\u0644\u064e\u0645\u0652 \u062a\u064e\u062c\u0650\u062f\u064f\u0648\u0627\u06df \u0643\u064e\u0627\u062a\u0650\u0628\u064b\u06ed\u0627 \u0641\u064e\u0631\u0650\u0647\u064e\u0640\u0670\u0646\u064c\u06ed \u0645\u0651\u064e\u0642\u0652\u0628\u064f\u0648\u0636\u064e\u0629\u064c\u06ed \u06d6 \u0641\u064e\u0625\u0650\u0646\u0652 \u0623\u064e\u0645\u0650\u0646\u064e \u0628\u064e\u0639\u0652\u0636\u064f\u0643\u064f\u0645 \u0628\u064e\u0639\u0652\u0636\u064b\u06ed\u0627 \u0641\u064e\u0644\u0652\u064a\u064f\u0624\u064e\u062f\u0651\u0650 \u0671\u0644\u0651\u064e\u0630\u0650\u0649 \u0671\u0624\u0652\u062a\u064f\u0645\u0650\u0646\u064e \u0623\u064e\u0645\u064e\u0640\u0670\u0646\u064e\u062a\u064e\u0647\u064f\u06e5 \u0648\u064e\u0644\u0652\u064a\u064e\u062a\u0651\u064e\u0642\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u064e \u0631\u064e\u0628\u0651\u064e\u0647\u064f\u06e5 \u06d7 \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u0643\u0652\u062a\u064f\u0645\u064f\u0648\u0627\u06df \u0671\u0644\u0634\u0651\u064e\u0647\u064e\u0640\u0670\u062f\u064e\u0629\u064e \u06da \u0648\u064e\u0645\u064e\u0646 \u064a\u064e\u0643\u0652\u062a\u064f\u0645\u0652\u0647\u064e\u0627 \u0641\u064e\u0625\u0650\u0646\u0651\u064e\u0647\u064f\u06e5\u0653 \u0621\u064e\u0627\u062b\u0650\u0645\u064c\u06ed \u0642\u064e\u0644\u0652\u0628\u064f\u0647\u064f\u06e5 \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0628\u0650\u0645\u064e\u0627 \u062a\u064e\u0639\u0652\u0645\u064e\u0644\u064f\u0648\u0646\u064e \u0639\u064e\u0644\u0650\u064a\u0645\u064c\u06ed", "num": 283}
{"line": "\u0644\u0651\u0650\u0644\u0651\u064e\u0647\u0650 \u0645\u064e\u0627 \u0641\u0650\u0649 \u0671\u0644\u0633\u0651\u064e\u0645\u064e\u0640\u0670\u0648\u064e\u0670\u062a\u0650 \u0648\u064e\u0645\u064e\u0627 \u0641\u0650\u0649 \u0671\u0644\u0652\u0623\u064e\u0631\u0652\u0636\u0650 \u06d7 \u0648\u064e\u0625\u0650\u0646 \u062a\u064f\u0628\u0652\u062f\u064f\u0648\u0627\u06df \u0645\u064e\u0627 \u0641\u0650\u0649\u0653 \u0623\u064e\u0646\u0641\u064f\u0633\u0650\u0643\u064f\u0645\u0652 \u0623\u064e\u0648\u0652 \u062a\u064f\u062e\u0652\u0641\u064f\u0648\u0647\u064f \u064a\u064f\u062d\u064e\u0627\u0633\u0650\u0628\u0652\u0643\u064f\u0645 \u0628\u0650\u0647\u0650 \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u06d6 \u0641\u064e\u064a\u064e\u063a\u0652\u0641\u0650\u0631\u064f \u0644\u0650\u0645\u064e\u0646 \u064a\u064e\u0634\u064e\u0627\u0653\u0621\u064f \u0648\u064e\u064a\u064f\u0639\u064e\u0630\u0651\u0650\u0628\u064f \u0645\u064e\u0646 \u064a\u064e\u0634\u064e\u0627\u0653\u0621\u064f \u06d7 \u0648\u064e\u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0639\u064e\u0644\u064e\u0649\u0670 \u0643\u064f\u0644\u0651\u0650 \u0634\u064e\u0649\u0652\u0621\u064d\u06e2 \u0642\u064e\u062f\u0650\u064a\u0631\u064c", "num": 284}
{"line": "\u0621\u064e\u0627\u0645\u064e\u0646\u064e \u0671\u0644\u0631\u0651\u064e\u0633\u064f\u0648\u0644\u064f \u0628\u0650\u0645\u064e\u0627\u0653 \u0623\u064f\u0646\u0632\u0650\u0644\u064e \u0625\u0650\u0644\u064e\u064a\u0652\u0647\u0650 \u0645\u0650\u0646 \u0631\u0651\u064e\u0628\u0651\u0650\u0647\u0650\u06e6 \u0648\u064e\u0671\u0644\u0652\u0645\u064f\u0624\u0652\u0645\u0650\u0646\u064f\u0648\u0646\u064e \u06da \u0643\u064f\u0644\u0651\u064c \u0621\u064e\u0627\u0645\u064e\u0646\u064e \u0628\u0650\u0671\u0644\u0644\u0651\u064e\u0647\u0650 \u0648\u064e\u0645\u064e\u0644\u064e\u0640\u0670\u0653\u0626\u0650\u0643\u064e\u062a\u0650\u0647\u0650\u06e6 \u0648\u064e\u0643\u064f\u062a\u064f\u0628\u0650\u0647\u0650\u06e6 \u0648\u064e\u0631\u064f\u0633\u064f\u0644\u0650\u0647\u0650\u06e6 \u0644\u064e\u0627 \u0646\u064f\u0641\u064e\u0631\u0651\u0650\u0642\u064f \u0628\u064e\u064a\u0652\u0646\u064e \u0623\u064e\u062d\u064e\u062f\u064d\u06e2 \u0645\u0651\u0650\u0646 \u0631\u0651\u064f\u0633\u064f\u0644\u0650\u0647\u0650\u06e6 \u06da \u0648\u064e\u0642\u064e\u0627\u0644\u064f\u0648\u0627\u06df \u0633\u064e\u0645\u0650\u0639\u0652\u0646\u064e\u0627 \u0648\u064e\u0623\u064e\u0637\u064e\u0639\u0652\u0646\u064e\u0627 \u06d6 \u063a\u064f\u0641\u0652\u0631\u064e\u0627\u0646\u064e\u0643\u064e \u0631\u064e\u0628\u0651\u064e\u0646\u064e\u0627 \u0648\u064e\u0625\u0650\u0644\u064e\u064a\u0652\u0643\u064e \u0671\u0644\u0652\u0645\u064e\u0635\u0650\u064a\u0631\u064f", "num": 285}
{"line": "\u0644\u064e\u0627 \u064a\u064f\u0643\u064e\u0644\u0651\u0650\u0641\u064f \u0671\u0644\u0644\u0651\u064e\u0647\u064f \u0646\u064e\u0641\u0652\u0633\u064b\u0627 \u0625\u0650\u0644\u0651\u064e\u0627 \u0648\u064f\u0633\u0652\u0639\u064e\u0647\u064e\u0627 \u06da \u0644\u064e\u0647\u064e\u0627 \u0645\u064e\u0627 \u0643\u064e\u0633\u064e\u0628\u064e\u062a\u0652 \u0648\u064e\u0639\u064e\u0644\u064e\u064a\u0652\u0647\u064e\u0627 \u0645\u064e\u0627 \u0671\u0643\u0652\u062a\u064e\u0633\u064e\u0628\u064e\u062a\u0652 \u06d7 \u0631\u064e\u0628\u0651\u064e\u0646\u064e\u0627 \u0644\u064e\u0627 \u062a\u064f\u0624\u064e\u0627\u062e\u0650\u0630\u0652\u0646\u064e\u0627\u0653 \u0625\u0650\u0646 \u0646\u0651\u064e\u0633\u0650\u064a\u0646\u064e\u0627\u0653 \u0623\u064e\u0648\u0652 \u0623\u064e\u062e\u0652\u0637\u064e\u0623\u0652\u0646\u064e\u0627 \u06da \u0631\u064e\u0628\u0651\u064e\u0646\u064e\u0627 \u0648\u064e\u0644\u064e\u0627 \u062a\u064e\u062d\u0652\u0645\u0650\u0644\u0652 \u0639\u064e\u0644\u064e\u064a\u0652\u0646\u064e\u0627\u0653 \u0625\u0650\u0635\u0652\u0631\u064b\u06ed\u0627 \u0643\u064e\u0645\u064e\u0627 \u062d\u064e\u0645\u064e\u0644\u0652\u062a\u064e\u0647\u064f\u06e5 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0651\u064e\u0630\u0650\u064a\u0646\u064e \u0645\u0650\u0646 \u0642\u064e\u0628\u0652\u0644\u0650\u0646\u064e\u0627 \u06da \u0631\u064e\u0628\u0651\u064e\u0646\u064e\u0627 \u0648\u064e\u0644\u064e\u0627 \u062a\u064f\u062d\u064e\u0645\u0651\u0650\u0644\u0652\u0646\u064e\u0627 \u0645\u064e\u0627 \u0644\u064e\u0627 \u0637\u064e\u0627\u0642\u064e\u0629\u064e \u0644\u064e\u0646\u064e\u0627 \u0628\u0650\u0647\u0650\u06e6 \u06d6 \u0648\u064e\u0671\u0639\u0652\u0641\u064f \u0639\u064e\u0646\u0651\u064e\u0627 \u0648\u064e\u0671\u063a\u0652\u0641\u0650\u0631\u0652 \u0644\u064e\u0646\u064e\u0627 \u0648\u064e\u0671\u0631\u0652\u062d\u064e\u0645\u0652\u0646\u064e\u0627\u0653 \u06da \u0623\u064e\u0646\u062a\u064e \u0645\u064e\u0648\u0652\u0644\u064e\u0649\u0670\u0646\u064e\u0627 \u0641\u064e\u0671\u0646\u0635\u064f\u0631\u0652\u0646\u064e\u0627 \u0639\u064e\u0644\u064e\u0649 \u0671\u0644\u0652\u0642\u064e\u0648\u0652\u0645\u0650 \u0671\u0644\u0652\u0643\u064e\u0640\u0670\u0641\u0650\u0631\u0650\u064a\u0646\u064e", "num": 286}
